(1, 'Zakon i red: Odjel za žrtve 10, serija', 0, '2011-06-08 23:42:00', '2011-06-09 00:26:00', '.Kad u rijeci Hudson nađu truplo tinejdžerice, detektivi pokušavaju otkriti žrtvin identitet, pri čemu detektivka Benson mora glumiti madame u javnoj kući..', 0, '', 1, 0, 0, 6, 1),
(2, 'Dnevnik plavuše: Kad starci prolupaju, emisija pod pokroviteljstvom', 0, '2011-06-09 00:26:00', '2011-06-09 00:36:00', '.Moranini roditelji su ovaj put u svojim novim idejama nadmašili sebe. Predali su zahtjeve za prijevremenu mirovinu i planiraju ostvariti putovanje svoga života u svom novom "pokretnom" domu, kućici na kotačima. Morana je zbunjena i ne može se pomiriti s njihovim novim i iznenadnim odlukama, te zove u pomoć prijateljice. Gabi će savjetovati najpovoljnije kreditno rješenje jer radi u banci, što će inspirirati i Laru za odluku o štednji, ali novi šok za Moranu dolazi kad sazna da roditelji žele pr', 0, '', 1, 0, 0, 6, 2),
(3, 'Druga prilika, američki film', 0, '2011-06-09 00:36:00', '2011-06-09 02:06:00', '.New York, 1960. Dr. Richard Radley (V. Redgrave) mladi je i daroviti oftalmolog iz ugledne liječničke obitelji, koji naoko ima sve: karijeru, uspjehe u amaterskom tenisu, roditelje koji ga podržavaju i zaručnicu Gwen (A. Krige) koja s njim priželjkuje brak. Međutim, mladić ima tajnu. Navečer se odijeva u žensku odjeću, izlazi u javnost i pretvara da je žena. Kada o tome pokuša razgovarati sa svojom majkom psihijatricom dr. Sadie Bishop (L. Fletcher), ona za njegovo stanje okrivi sebe te ga uput', 0, '', 1, 0, 0, 6, 3),
