(9, 'Gospodarica tvoga srca, telenovela', 0, '2011-06-09 06:23:00', '2011-06-09 07:07:00', '.Gabriela kaže da se Ivana samo pretvara da joj je drago zbog njih dvoje te da je ljubomorna i licemjerna. Valentina joj kaže da je i ona posumnjala u to. Enriqueta kaže Felipeu kako joj je Sandra rekla da joj on ne znači ništa i da je pristala biti njegovom djevojkom samo da učini Horacija ljubomornim. Shvativši da Enriqueta previše priča, Leonor joj kaže da Arcelia Olivares govori da je imala sina s Joséom Miguelom. José Miguel kaže Valentini da će otići u grad kako bi prodao kuću jer želi ulo', 0, '', 1, 0, 0, 6, 1),
