(18, 'Kokice', 0, '2011-06-09 09:05:00', '2011-06-09 09:20:00', '.Kokice doznaju što rade članovi filmske družine OŠ Eugena Kumičića iz Velike Gorice, kakve eksponate možete pogledati na izložbi Surogat stvarnosti te tko su dobitnici nagrada na upravo završenom 21. animafestu. Kao hit tjedna predstavljamo znanstveno-fantastični triler Super 8 i upoznajemo vas s mladim holivudskim zvijezdama Elle Fanning i Jennifer Lawrence. Na kraju emisije pogledajte insert iz igranog filma Krivi korak, mladih filmaša iz Filmske škole Motovun..', 0, '', 1, 0, 0, 6, 9),
