(26, 'Eve i vatreni konj, kanadski film', 0, '2011-06-09 14:00:00', '2011-06-09 15:30:00', '.Eva (P. Jojo Kut) je, kako sama pripovijeda, rođena u znaku vatrenog konja i sretna je što je uopće živa, jer su se nekada u Kini djeca rođena u tom znaku odmah bacala u rijeku, zato što se vjerovalo da će biti svojeglava, pa je rijeka bila ispunjena energijom potopljenih vatrenih konja. Eva je iznimno inteligentna, senzibilna, maštovita i više od svega radoznala. Nije pokorna pravilima ako ne razumije njihovu svrhu. Ima stariju sestru Karenu (H. Lo), mamu (V. Wu), tatu (C. Chit Man Lester) i b', 0, '', 1, 0, 0, 6, 3),
(27, 'Županijska panorama (nije kod. na sat.)', 0, '2011-06-09 15:30:00', '2011-06-09 15:45:00', '..', 0, '', 1, 0, 0, 6, 2),
(28, 'Hotel dvorac Orth 4, serija', 0, '2011-06-09 15:45:00', '2011-06-09 16:31:00', '.Wilhelm Eberding, uglađeni gospodin u 50-im godinama, stalni je gost u dvorcu Orth gdje provodi odmor sa ženom Mathildom. No ovaj put je stigao sam. Mathilde ga je napustila jer se osjećala zapostavljenom. Wilhelm, naime, voli samo jedno - svoje orhideje. I mlada Tanja Schöfeld je gošća u hotelu i stanuje upravo u sobi pokraj konzervativnoga Wilhelma. Sluša glasno glazbu, što smeta Wilhelmu. Nešto kasnije Tanja dobiva poruku kako ju je dečko Julius napustio. Razljućena, opije se u hotelskom bar', 0, '', 1, 0, 0, 6, 1),
(29, 'Šaptač psima 4 (30/36)', 0, '2011-06-09 16:31:00', '2011-06-09 17:21:00', '.Cesar okuplja sto pasa kojima je pomogao otkad je serija počela. Iznenada se pojavljuje i Lassie, Cesarov idol iz djetinjstva..', 0, '', 1, 0, 0, 6, 8),
(30, 'Johnny Bravo, crtana serija (14/52)', 0, '2011-06-09 17:21:00', '2011-06-09 17:44:00', '..', 0, '', 1, 0, 0, 6, 6),
(31, 'Trava zelena 3, humoristična serija', 0, '2011-06-09 17:44:00', '2011-06-09 18:13:00', '.Bryan dobiva više nego što je tražio kad upozna novu ljubav. Llewellyn grabi priliku da osigura dodatnu radnu snagu.....', 0, '', 1, 0, 0, 6, 1),
(32, 'Roditelji i djeca, serija', 0, '2011-06-09 18:13:00', '2011-06-09 18:56:00', '.Intenzivira se Crosbyjeva i Jasmineina veza i moraju smisliti kako će to objasniti Jabbaru. Adam i Kristina traže prijatelje, ali otkrivaju da je to teže nego što su mislili. Sarah otkriva Zeekove financijske probleme. Julia postaje trenerica Sydneyne nogometne momčadi, a Haddie traži savjet od Amber kad je dečko počne nagovarati na seks..', 0, '', 1, 0, 0, 6, 1),
(33, 'Krstarenja svjetskim ljepotama: Dunav - putovanje središtem Europe, dokumentarna serija (71/75)', 0, '2011-06-09 18:56:00', '2011-06-09 19:49:00', '.Već tisućljećima Dunav mirno teče Europom. Romantična, često opjevana rijeka, "plavi Dunav" zauzima jedinstveno mjesto u europskoj povijesti. Duž 2850 km toka, od Crne šume u Njemačkoj u kojoj izvire do Rumunjske u kojoj se ulijeva u Crno more, nema zavoja ni obale koji nisu bili u središtu povijesti: sjeverna granica Rimskog Carstva, put za osvajanja i trgovinu za Vikinge ili simbol ujedinjenja Austro-Ugarskog Carstva. Ploviti uzvodno Dunavom znači upoznati kulturnu, jezičnu i vjersku raznolik', 0, '', 1, 0, 0, 6, 8),
(34, 'Hit dana', 0, '2011-06-09 19:49:00', '2011-06-09 20:00:00', '..', 0, '', 1, 0, 0, 6, 4),
(35, 'Braća i sestre 3, serija', 0, '2011-06-09 20:00:00', '2011-06-09 20:48:00', '.Rebeccina rastrganost između odanosti Holly i Walkerima postaje teža nego ikada kad otkrije Tommyjev plan da izgura njezinu majku iz obiteljske tvrtke. Važna osoba iz Williamove prošlosti iznenađuje Noru telefonskim pozivom.\n\nOstale uloge: Ken Olin (David Caplan), Luke Grimes (Ryan Lafferty), Nigel Havers (Roger Grant), John Rubinstein (Dr. Marc Wilson), Scott Klace (Kent Barnes), S.E. Perry (Winston), Michael B. Silver (Stu Orenbacher), John Glover (Henry Mittner), Kaitlin Doubleday (Chelsea Y', 0, '', 1, 0, 0, 6, 1),
(36, 'Afrički dnevnik, Hakuna Matata (4/4)', 0, '2011-06-09 20:48:00', '2011-06-09 21:30:00', '.Kenija je najpoznatije safari odredište svijeta. Naš safari bio je dug više od 2500 kilometara. Bogati životinjski svijet, nepregledne savane, vulkanski krajolik svakog putnika ostavljaju bez daha. Doživjeli smo najuzbudljiviju afričku pustolovinu i saznali tko su bili "oni koji jedu ljude", kako i pod koju cijenu se gradila prva afrička pruga Uganda - Kenija. \nNajpoznatija snježna planina u srcu Afrike pokazala je svoje najljepše lice. Otkrivamo južnu obalu Mombase Diani Beach, jednu od najlje', 0, '', 1, 0, 0, 6, 2),
(37, 'Filmovi naših susjeda: Mi nismo anđeli, srpski film', 0, '2011-06-09 21:30:00', '2011-06-09 23:20:00', '.Komedija. Nikola (N. Kojo) je apsolvent svjetske književnosti i veliki je frajer. Vozi preuređenu žabu, sluša Zappu, živi s otkvačenom cimericom (S. Savić), opija se i mijenja žene. Tako se Nikola često budi u tuđim krevetima da sam ne zna kako je u njih dospio, a imena tih žena uopće se ne sjeća. Jedva punoljetna maturantica Marina upozna Nikolu na nekom tulumu te završe zajedno. Osim što se zaljubila Marina je i trudna, no Nikola se nje uopće ne sjeća. Marina ne želi pobaciti, te njezina najb', 0, '', 1, 0, 0, 6, 3),
(38, 'Zakon i red: Odjel za žrtve 10, serija', 0, '2011-06-09 23:20:00', '2011-06-10 00:05:00', '.Majka otete djevojčice upućuje detektive na oca, bivšega robijaša, ali uskoro se otkriva da je djed veliki lopov i ima mnogo neprijatelja. No, djed boluje od Alzheimerove bolesti i ne može se sjetiti velikoga dijela prošlosti..', 0, '', 1, 0, 0, 6, 1),
(39, 'Dnevnik plavuše: Kad starci prolupaju, emisija pod pokroviteljstvom', 0, '2011-06-10 00:05:00', '2011-06-10 00:15:00', '.Moranini roditelji su ovaj put u svojim novim idejama nadmašili sebe. Predali su zahtjeve za prijevremenu mirovinu i planiraju ostvariti putovanje svoga života u svom novom "pokretnom" domu, kućici na kotačima. Morana je zbunjena i ne može se pomiriti s njihovim novim i iznenadnim odlukama, te zove u pomoć prijateljice. Gabi će savjetovati najpovoljnije kreditno rješenje jer radi u banci, što će inspirirati i Laru za odluku o štednji, ali novi šok za Moranu dolazi kad sazna da roditelji žele pr', 0, '', 1, 0, 0, 6, 2),
(40, 'T-mobile In Music festival: Flaming Lips, snimka koncerta', 0, '2011-06-10 00:15:00', '2011-06-10 01:15:00', '.Prikazujemo snimku nastupa grupe The Flaming Lips na zagrebačkom Jarunu prošlog ljeta u sklopu T-mobile In Music Festivala. \nThe Flaming Lips postaju poznati po višeslojnim aranžmanima i zanimljivim tekstovima, kao i neobičnim nazivima pjesama te prepoznatljivi po vizualno atraktivnim i razrađenim nastupima u živo, koji uključuju kostime, balone, lutke, video projekcije, složene svjetlosne konfiguracije... Neizostavan dio njihovih atraktivnih nastupa je i veliki "balon" u kojem frontmena Waynea', 0, '', 1, 0, 0, 6, 4),
(41, 'Noćni glazbeni program: Hit dana', 0, '2011-06-10 01:15:00', '2011-06-10 01:17:00', '..', 0, '', 1, 0, 0, 6, 4),
(42, 'Noćni glazbeni program: Glazbeni spotovi', 0, '2011-06-10 01:17:00', '2011-06-10 04:41:00', '.I ovaj četvrtak će biti veselo, ali i svečano. Najprije se vraćamo u 1994. kada je 29. travnja Josip Klima u Koncertnoj dvorani Vatroslava Lisinskog slavio 40 godina umjetničkog rada. To je koncert - Peppi czardas. \nPred zoru ćemo razgledati pulsku Arenu uz 1. dio koncerta Klape u Areni, održan 7. rujna 2007..', 0, '', 1, 0, 0, 6, 4),
(43, 'Noćni glazbeni program: Hit dana', 0, '2011-06-10 04:41:00', '2011-06-10 04:43:00', '..', 0, '', 1, 0, 0, 6, 4),
