(47, 'Gospodarica tvoga srca, telenovela', 0, '2011-06-10 06:25:00', '2011-06-10 07:10:00', '.José Miguel i Valentina upoznaju Gabrielu s Horaciom, no oni se već poznaju od ranije. Otac Ventura razgovara s Felipeom, a Felipe mu kaže kako je prekinuo sa Sandrom jer ga je iskoristila. José Miguel, Valentina, Gabriela i Horacio provode se na festivalu koji se održava u selu. Iluminada plače i moli se djevici jer ne zna hoće li se ikada moći udati nakon što ju je Rosendo silovao. Federico i Leonor se prepiru jer ona vrijeđa Valentinu, govori mu da je ona Rosendova ljubavnica, a Federico joj', 0, '', 1, 0, 0, 6, 1),
