(65, 'Dragi moj lažljivče, američki flm', 0, '2011-06-10 14:15:00', '2011-06-10 15:45:00', '.Kazališna predstava koja govori o odnosu između Georgea Bernarda Shawa (E. Herrmann) i Stelle Campbell (J. Alexander) kroz njihova pisma koja su izmjenjivali od 1899. do Stelline smrti, 1939. godine. Kroz pisma doznajemo o njihovim brakovima, dramama i predstavama, kako su pripremali Pygmaliona, te kako je Stella namjeravala objaviti knjigu Shawovih pisama (daleke 1920. godine), što Shaw nije dopustio. I pisma i dijalozi što ih dva lika izmjenjuju duhoviti su, inteligentni, često humoristični, ', 0, '', 1, 0, 0, 6, 3),
