(67, 'Hotel dvorac Orth 4, serija', 0, '2011-06-10 16:00:00', '2011-06-10 16:50:00', '.Bračni par Herbert i Irma Loderer provode godišnji odmor u dvorcu Orth. Herbert ne uživa jer ga je Irma natjerala na dijetu. Herbert je preko dana kod Markusa u dvorani za fitnes, navečer sjedi pred tanjurom salate, ali koliko god se trudio, nije izgubio ni grama. Nije ni čudo jer Herbert potajno jede! \nJacobu se sviđa zgodna Gaby Ollinger, koja je sommelier, a ni ona ne može odoljeti njegovu šarmu. Provode zajedno noć, no za Jacoba to nije nešto ozbiljno. Gaby Ollinger je duboko povrijeđena je', 0, '', 1, 0, 0, 6, 1),
(68, 'Briljanteen', 0, '2011-06-10 16:50:00', '2011-06-10 17:30:00', '.600. izdanje Briljanteena bavi se autorskim pravima na Internetu, o čemu će govoriti gost emisije Nenad Romić aka Marcell Mars, jedan od osnivača Multimedijalnog instituta - mi2. Bili smo u Teatru Exit na predstavi Kauboji za koju i ove sezone vlada veliki interes publike. Nastavljamo s upoznavanjem stranih državljana u Hrvatskoj - ovaj put donosimo priču o dva mlada Japanca. Filmski kritičar Mario Kozina predstavlja ratnu dramu Narednik James..', 0, '', 1, 0, 0, 6, 7),
(69, 'Ritam tjedna, glazbeni magazin', 0, '2011-06-10 17:30:00', '2011-06-10 18:05:00', '.Središnja gošća ovaj tjedan je Severina. U rubrici Konzerva pod nazivom "Pjevali su jedno ljeto" prisjećamo se izvođača s jednim velikim hitom.\nNajavljujemo veliki hip-hop spektakl "Zagreb se budi". U konkurenciji za spot tjedna prikazat ćemo tri nova premijerna spota..', 0, '', 1, 0, 0, 6, 4),
(70, 'Roditelji i djeca, serija', 0, '2011-06-10 18:05:00', '2011-06-10 18:50:00', '.Zeek postaje naporan dok živi s Adamom i Kristinom. Za to se vrijeme Camille usredotočava na umjetnost umjesto na muža. Da bi oca izvukla iz dugova, Julia zove u pomoć staru ljubav s fakulteta, što smeta Joelu. Amber se grize jer je izdala Haddie..', 0, '', 1, 0, 0, 6, 1),
(71, 'Krstarenja svjetskim ljepotama: Na tragu flamanskih i nizozemskih majstora, dokumentarna serija (72/75)', 0, '2011-06-10 18:50:00', '2011-06-10 19:45:00', '.Flandrija i Nizozemska otvorene su prema oceanu zahvaljujući širokim ušćima rijeke Rajne i Schelde, a mreža rijeka i kanala, na kojima se odvija važan trgovački promet, povezuje ih s ostatkom Europe. Zbog ovih razloga ove su dvije zemlje stoljećima bile među najbogatijima na svijetu.\nA bogatstvo koje su stekli bankari i brodovlasnici, zahvaljujući trgovinom začina i tkanina, omogućilo je razvoj trgovačkih gradova kao što su Amsterdam, Delft, Antwerpen, Brugge ili Gent.\nNo ekonomskoj i trgovačko', 0, '', 1, 0, 0, 6, 8),
