(74, 'Legende američkog sna: William Eduard Boeing - Avioindustrijski as, dokumentarna serija (1/5)', 0, '2011-06-10 20:00:00', '2011-06-10 21:00:00', '.Petorica vizionarskih poduzetnika iz Starog svijeta revolucionirali su privredu Novog svijeta i uvelike utjecali na američku kulturu. Cijeli svijet danas zna za Levija Straussa, Henryja E. Steinwaya, Williama E. Boeinga, Johna Jacoba Astora, Henryja J. Heinza i njihove proizvode. U tuđoj i nepoznatoj zemlji uspjeli su zahvaljujući inovatorskom duhu, hrabrosti, upornosti i marljivu radu. S pomoću raskošnih rekonstrukcija i sjajnoga arhivskog materijala, serija prikazuje jedno od najzanimljivijih', 0, '', 1, 0, 0, 6, 8),
(75, 'Muškarci na stablima 2, serija', 0, '2011-06-10 21:00:00', '2011-06-10 21:45:00', '.Marin slavi dovršetak svoje knjige odlaskom u toplice u Anchorageu. Ondje se iznenadi ugledavši Julijinog (Kelli Williams) supruga Jima (Josh Stamberg) s drugom ženom, te se dvoumi treba li reći Jacku. Sada kad mu se vratilo pamćenje, Patricka dočeka nekoliko iznenađenja na povratku u Elmo: Annie i Ivan (Diego Klattenhoff) su postali bliski, a Celia je preuredila njegovu spavaću sobu - za svojeg novog psa. Za to vrijeme u New Yorku Sam (Ty Olsson) neočekivano postane junak, a Jane se boji da mu', 0, '', 1, 0, 0, 6, 1),
(76, 'Dnevnik plavuše: Kad starci prolupaju, emisija pod pokroviteljstvom', 0, '2011-06-10 21:45:00', '2011-06-10 22:00:00', '.Moranini roditelji su ovaj put u svojim novim idejama nadmašili sebe. Predali su zahtjeve za prijevremenu mirovinu i planiraju ostvariti putovanje svoga života u svom novom "pokretnom" domu, kućici na kotačima. Morana je zbunjena i ne može se pomiriti s njihovim novim i iznenadnim odlukama, te zove u pomoć prijateljice. Gabi će savjetovati najpovoljnije kreditno rješenje jer radi u banci, što će inspirirati i Laru za odluku o štednji, ali novi šok za Moranu dolazi kad sazna da roditelji žele pr', 0, '', 1, 0, 0, 6, 2),
(77, 'Izgaranje, mini-serija  (1/2)', 0, '2011-06-10 22:00:00', '2011-06-10 23:35:00', '.Napet triler o uroti u kojoj se dvojica prijatelja i moćna "igrača" međunarodne naftne industrije suočavaju sa serijom nasilnih događaja i šokantnih otkrića koja bi mogla razoriti njihovo prijateljstvo, njihov posao, pa čak i cijelu civilizaciju.\nRupert Penry-Jones glumi Toma O''Connella, uspješnog naftaša čiji je najbolji prijatelj Mack (dobitnik Emmyja Bradley Whitford) glavni naftni lobist u Washingtonu. Kada se zelena aktivistica Holly, koju glumi Neve Campbell (publici poznata po ulozi Juli', 0, '', 1, 0, 0, 6, 1),
(78, 'Na rubu znanosti: Mira Omerzel Mirit, Glazba Slavena iz davnina', 0, '2011-06-10 23:35:00', '2011-06-11 00:30:00', '.Nekada davno instrumenti su bili akustični, bili su od drveta, kosti, kože ili dlake, a glazba je rijetko bila tek zabava. Puno češće bila je obred slavlja ili pak iscjeljivanja. I u slavenskim krajevima postojala je takva tradicija, a etnologinja i doktorica muzikoloških znanosti Mira Omerzel-Mirit ponovno ju je oživjela s ansamblom Vedun, i glazbeno i filozofski. Istraživanje i skupljanje stotina starih instrumenata neizostavno je dovelo i do stvaranja glazbe, stare koliko i nove u isto vrije', 0, '', 1, 0, 0, 6, 12),
(79, 'Garaža: Stidljiva ljubičica', 0, '2011-06-11 00:30:00', '2011-06-11 01:00:00', '.Stidljiva ljubičica novovalna grupa iz osamdesetih je jedna od najorginalnijih i najneobičnijih grupa iz toga vremena. Rock kritika je smatra neizostavnom grupom za razumijevanje tadašnje scene. Renato Happ, pjevač, klavirist i frontman grupe, Zlatko Đurašina, autor pjesama i gitarist, dvojac su koji je nosio grupu i činio njezinu okosnicu. Danas, nakon 30 godina, grupi i pjesmama žele dodati novi izražaj ne odustajući od jakih emocija i njima svojstvenog pop artizma. Za svoje nastupe odabiru n', 0, '', 1, 0, 0, 6, 4),
