(94, 'ni DA ni NE: Pokusi na životinjama', 0, '2011-06-11 10:05:00', '2011-06-11 11:05:00', '.U ovoj epizodi ispitujemo granice znanstvenih pokusa i moralnih dilema. Tema su medicinski pokusi na životinjama. Kako se čovjek odnosi prema životinjama, a kako bi se trebao odnositi? Je li opravdano da čovjek iskorištava životinje i u kojim situacijama? U emisiji sudjeluju učenici I. gimnazije iz Zagreba i debatanti Hrvatskog debatnog društva. Tu je kao i svaki put naš stručnjak profesor Tomislav Reškovac, a gosti su predsjednik udruge Prijatelji životinja Luka Oman i dr. Tomislav Babić s Vet', 0, '', 1, 0, 0, 6, 7),
(95, 'Batman protiv Drakule, američki animirani film', 0, '2011-06-11 11:05:00', '2011-06-11 12:30:00', '.Joker i Penguin bježe iz zatvora Arkham i ponovno kreću u zločinački pohod na Gotham. Za to vrijeme Bruce Wayne očaran je novinarkom Vicky Vale koja ga intervjuira za vijesti TV Gotham. Bruce ima tvornicu u kojoj se istražuju i poizvode najsloženiji uređaji za prikupljanje sunčeve energije i njezino iskorištavanje za sve ljudske potrebe. Koliko je danju borac za svjetlo, toliko je noću biće mraka: Bruce noću postaje Batman, čovjek-šišmiš, od kojega strepe gotamski zločinci. Penguin odlazi na gr', 0, '', 1, 0, 0, 6, 3),
(96, 'Filmska matineja: Novčić i Faca protiv otmičara, američki film', 0, '2011-06-11 12:30:00', '2011-06-11 14:00:00', '.Komedija. Tyler (L. Eckstrom) i Katie (R. Crane) najbolje su prijateljice, no vrlo su različite. Tyler je poslušna i mirna, a Katie prodorna, neposlušna i sklona pustolovinama. Osim s Katie, Tyler najviše vremena provodi sa svojim ljubimcem, ponijem Two-Bitsem i konjem Pepperom. Jednog dana Katie nagovori Tyler da s Two-Bitsom i Pepperom odu u grad na sajam iako to roditelji ne dopuštaju...\nFilm je prema svom scenariju režirao Corey Michael Eubanks, poznat kao TV redatelj, scenarist (Payback, B', 0, '', 1, 0, 0, 6, 3),
(97, 'Zvonimir Bajsić: Gle kako dan lijepo počinje, TV drama', 0, '2011-06-11 14:00:00', '2011-06-11 15:15:00', '.Jednog lijepog jutra na vratima stana osamljene udovice pojavljuje se smušeni i dobroćudni muškarac njezinih godina. Dvije do tada nepoznate i osamljene osobe započinju tu, u nekoj od naših prenapučenih gradskih periferija, graditi viziju zajedničkog života. Ubrzo se ispostavlja da taj muškarac nije tako dobroćudan kako se predstavlja, ali mu ni udovica ne ostaje dužna.\nFabijan Šovagović (Miroslav) i Zdenka Heršak (Mariola) ostvarili su uloge antologijskog domašaja, a režijski postupak Ladislav', 0, '', 1, 0, 0, 6, 15),
