(101, 'Zvjezdana prašina, koncert', 0, '2011-06-11 16:55:00', '2011-06-11 17:55:00', '.Ovo je mozaična glazbeno-dokumentarna emisija koja se u trajanju od četiri i pol sata emitira u kontinuitetu već 20 godina svaki petak na Drugom programu Hrvatskoga radija. Emisija promovira glazbu od "Bacha do jazza", mjuzikla i filma. U proteklih 20 godina u ovoj emisiji nastupili su mnogi domaći i inozemni umjetnici, koji su ušli u tzv. "Dvoranu slavnih" - Hall of Fame. Koncert je snimljen u Studiju "Bajsić" Hrvatske radiotelevzije u povodu obilježavanja 900. emitiranja ove radijske emisije.', 0, '', 1, 0, 0, 6, 4),
