(103, 'Lady Gaga i Hiromi Specijal', 0, '2011-06-11 19:30:00', '2011-06-11 20:00:00', '.U najnovijem izdanju Glazbenog specijala Ante Batinovića bit će Lady Gaga, trenutačno tržišno najjača pop-zvijezda na svijetu. Kroz razgovor ona otkriva neke pojedinosti o sebi kao osobi, otkriva koji joj je najdraži umjetnik izvan svijeta glazbe, koja joj je zemlja najdraža i kojim se stihovima najviše ponosi.\nOdgovori, naravno, potvrđuju njezinu silnu želju da bude drukčija i izazovna, koji put i pod svaku cijenu. Istodobno naglašava kako se ona bavi umjetnošću ne spominjući termin zabave.\nJa', 0, '', 1, 0, 0, 6, 4),
