(105, 'Draga smanjio sam djecu, komedija', 0, '2011-06-11 20:05:00', '2011-06-11 21:40:00', '.Wayne Szalinski (R. Moranis) izumitelj je koji cijele dane provodi u svom kućnom laboratoriju. To ide na živce njegovoj ženi Diane (M. Strassman), pa se često svađaju. Žena ga je upravo napustila i otišla majci. On je u kući ostao s djecom, tinejdžerkom Amy (A. O''Neil) i vrlo bistrim dječakom Nickom (R. Oliveri). Njegov prvi susjed, eksplozivni Russell Thompson (M. Frewer), prezire intelektualce, a oduševljava se samo sportom. Žena Mae (K. Sutherland) uvijek ga smiruje. Nesretan je što je njego', 0, '', 1, 0, 0, 6, 3),
(106, 'Zaštitnica svjedoka 1, serija', 0, '2011-06-11 21:40:00', '2011-06-11 22:25:00', '.Odvija se utrka s vremenom u kojoj nastoje spasiti Mary od otmice. Charles Andrew Johnson, to jest Brandin bezvrijedni dečko Chuck, iz svog doma u Northvaleu u New Jerseyju nastoji stupiti u kontakt s Brandi jer nije dostavila kovčeg pun metamfetamina, no upadnu dvojica agenata FBI-a i uhite ga zbog trgovine drogom. Chuck priznaje krivnju i otkriva sve što zna, no netom prije nego agenti FBI-a pristanu na nagodbu, nahrupe dvojica maskiranih muškaraca, ubiju agente i onesvijeste Chucka.\nU Albuqu', 0, '', 1, 0, 0, 6, 1),
(107, 'Avantura počinje - uvodna emisija Izbora Miss i Mr Hrvatske, emisija', 0, '2011-06-11 22:25:00', '2011-06-11 23:20:00', '.Uvodna emisija Izbora Miss i Mr Hrvatske 2011. predstavlja nam kandidate - 12 djevojaka i 12 mladića - kroz sport, osmišljavanje stylinga te debatiranje.\nNatjecatelji će se okušati u sportskim zadacima kombiniranog tipa, u kreiranju vlastitog modnog izričaja, te u debati kao prigodi da najizravnije pokažu svoju osobnost i sposobnost izlaganja stavova..', 0, '', 1, 0, 0, 6, 13),
(108, 'Vrijeme je za jazz: Igor Geržina Sax Lounge ansamble', 0, '2011-06-11 23:20:00', '2011-06-12 00:20:00', '.U prvom dijelu emisije predstavlja se Igor Geržina Sax Lounge Ensemble. Na nastupu u studiju HTV-a izvode smooth jazz skladbe vođe sastava, poznatog saksofonista i producenta Big banda HRT-a Igora Geržine.\nU drugom dijelu prikazat ćemo snimku koncerta "Funk on the Beach", koji je održan 20. kolovoza 2010. na plaži Bačvice u Splitu. Nastup na kojem su svirali hrvatski i američki glazbenici posvećen je Dini Dvorniku..', 0, '', 1, 0, 0, 6, 4),
