(123, 'Monk 7, serija', 0, '2011-06-12 12:05:00', '2011-06-12 12:45:00', '.Monka i Natalie posjećuje stari Mitchev prijatelj, mornarički poručnik Steven Albright. Njegov prijatelj Jason Pierce počinio je samoubojstvo, no Albright sumnja na ubojstvo pa želi da Monk provede istragu. Monk pristane, no iznenadi se kad vidi da je mjesto navodnog zločina podmornica. Albright objašnjava okolnosti Pierceove smrti, no u želji da što prije izađe iz podmornice Monk prihvaća službenu ocjenu da je riječ o samoubojstvu. Nedugo zatim oglasi se alarm i podmornica zaroni pod vodu. Gla', 0, '', 1, 0, 0, 6, 1),
(124, 'Monk 7, serija', 0, '2011-06-12 12:45:00', '2011-06-12 13:35:00', '.Poručnik Disher s prijateljicom ulazi u taksi i otkriva da je njegov vozač nasmrt izboden iglom za šešir. Stottlemeyer poziva Monka da se priključi istrazi u kojoj je ubojica najvjerojatnije žena iz istočnoeuropske zemlje - Zemenije. Ubrzo ih istraga odvede do Leyle Zlatavich koja savršeno odgovara profilu ubojice, no Monk je ustrajan da je Leyla nevina. Natalie posumnja da se Monk zaljubio, što on ljutito odbija. Jesu li Monku simpatije prema lijepoj Leyli oduzele moć rasuđivanja ili je slučaj', 0, '', 1, 0, 0, 6, 1),
