(126, 'Kruška i prijatelji, koncert', 0, '2011-06-12 14:05:00', '2011-06-12 15:20:00', '.Željko Krušlin Kruška 1975. počinje profesionalnu karijeru. Tri godine poslije napisao je svoj najveći hit "Divno je biti nekome nešto". Zatim nastupa sa svojom grupom "Latino", a izvodili su i svjetske hitove. Sa svojim prvim albumom "Gdje je ljubav tu si ti" grupa Latino potvrdila je svoj status na hrvatskoj estradnoj sceni.\nNakon grupe "Latino" Željko Krušlin Kruška nastavlja samostalnu glazbenu karijeru. Inače piše glazbu i tekstove i za druge izvođače.\nDanas ćemo prikazati snimku njegovog ', 0, '', 1, 0, 0, 6, 4),
