(128, 'Moji kenijski korijeni, dokumentarni film', 0, '2011-06-12 15:55:00', '2011-06-12 16:45:00', '.Ovaj poetičan film govori o prvom putovanju dvadesetogodišnje studentice Kahithe Kiiru u Keniju, u posjet svojoj afričkoj rodbini. Traži svoje korijene i silno je zanima prošlost i podrijetlo njezinog oca. Naime, ona je rođena u Zagrebu od majke Hrvatice i oca Kenijca. Boraveći u toj lijepoj afričkoj zemlji, Kahithe se oduševi gostoprimstvom, ljubaznošću i vječnim osmijehom Kenijaca i u najtežim okolnostima..', 0, '', 1, 0, 0, 6, 8),
