(137, 'Filmski klub: Divlja horda, američki film', 0, '2011-06-12 22:30:00', '2011-06-13 00:50:00', '.Vrhunski vestern, jedno od posljednjih remek-djela tog žanra i možda najuspjeliji film Sama Peckinpaha; film o prijestupnicima i mogućnosti njihova iskupljenja koji je dao novi pristup fenomenu nasilja u vesternu. Skupina deziluzioniranih ratnika veterana poraženoga američkog Juga pljačka municiju američke vojske koja je namijenjena revolucionarnoj vojsci Pancha Ville, a s namjerom da je bogato unovči kod meksičke vojske u službi tiranske vlasti. Nekadašnji član bande Thornton slijedi tu skupin', 0, '', 1, 0, 0, 6, 3),
