(157, 'Lijepom našom: Bibinje (1/2)', 0, '2011-06-13 10:45:00', '2011-06-13 11:45:00', '.Ekipa serije Lijepom našom u sljedeće dvije emisije gostuje u Bibinju, a nastupaju: KUD ''I.G.K.'' FS ''Veseli Bibinjci''- Bibinje, Klapa ''Garofuli'' - ''Kolo igra kod Sv. Roka'', Klapa ''Kadena''- Bibinje - ''Dalmatinski šajkaš'', Klapa ''Bibinje'' - ''U boj, u boj'', M. Tomašević I TZD - ''Majko Dalmacijo'', klapa ''Kondura'' - Zadar ''Pivaj, klapo'', Klapa ''Sol'' i TZD - ''Teštament'', Bepo i David & TZD - ''Kad si otišla ti'', Ivica Sikirić Ićo i TZD - ''Postelja od ruža'', klapa ''Maslina - ''Vratija se Šime'', Emilija ', 0, '', 1, 0, 0, 6, 16),
