(170, 'Trava zelena 3, humoristična serija', 0, '2011-06-13 17:25:00', '2011-06-13 18:10:00', '.Dok šeću, Boycie i Marlene s užasom otkrivaju da je Earl otkopao neeksplodiranu ručnu bombu. Svi bježe u zaštitu iza najbližeg traktora. Ali to je tek početak. Uz staju nalaze još oružja i Boycie kani farmu pretvoriti u vojni muzej. Priča se brzo širi i dospijeva u novine.\nU Oakham stiže američki biznismen Cliff Cooper koji želi ponovno posjetiti svoju staru vojnu bazu iz 1970-ih. Tada je živio u kući koja je sada dom Boyceovih. Boycie i Marlene ga ugoste, a Boycie postaje posebno uslužan kad s', 0, '', 1, 0, 0, 6, 1),
(171, 'Roditelji i djeca, serija', 0, '2011-06-13 18:10:00', '2011-06-13 18:55:00', '.Obiteljski marš za autizam dolazi u pitanje kad se Sarah i Adam posvađaju oko ponašanja svojih kćeri. Haddien i Amberin skriveni bijes izbija na površinu i podijeli obitelj. Za to vrijeme Julia pokušava pomoći Zeeku i dogovara mu sastanak. Crosby se boji da će Jasmine otići u New York nakon što je bila na audiciji za plesnu skupinu..', 0, '', 1, 0, 0, 6, 1);
