(176, 'Glee, serija za mlade', 0, '2011-06-13 20:45:00', '2011-06-13 21:35:00', '.Kurt je pronašao kompromitirajuću videosnimku trenerice Sue na kojoj ona pleše i pjeva pjesmu Olivije Newton-John Physical. Kako bi joj napakostili, učenici objave tu snimku na YouTubeu. Uzrujana, Sue se požali ravnatelju Figginsu. Također mu oda tajnu da školom kruži lista s imenima učenika iz Glee Cluba, na kojoj su rangirani po tome tko je najsumnjivijeg morala. Ravnatelj traži od profesora Schuestera da sazna tko stoji iza toga. Will je zabrinut zbog sve lošijeg ugleda svojega kluba. I dok ', 0, '', 1, 0, 0, 6, 1),
(177, 'Završni udarac 4, serija', 0, '2011-06-13 21:35:00', '2011-06-13 22:25:00', '.U centru Los Angelesa iz blizine je ustrijeljen čovjek koji je nosio prislušni uređaj, a na mjesto zločina prvi stiže baš Ricardo Ramos (gost Stephen Martines - Opća bolnica), koji za Los Angeles Times prati rad Jedinice za prioritetna ubojstva. Žrtvina povezanost s istragom o drogi preklapa se s Fritzovim poslom u FBI-u i dvoboj između Brende i njezina zaručnika oko kontrole nad slučajem dovodi do sukoba..', 0, '', 1, 0, 0, 6, 1),
