(237, 'Dodir života i smrti 2, serija', 0, '2011-06-09 00:30:00', '2011-06-09 01:12:00', '.Kad najpopularnijeg eskorta u agenciji za iznajmljivanje prijatelja pronađu mrtvoga, ekipa istražuje tko ga je ubio, a sumnjivci uključuju njegova asocijalnog cimera, čiji je hobi prepariranje, Randyja Manna (gostujuća zvijezda David Arquette - "Vrisak", "Hamlet 2"). Istovremeno, Emersona posjeti njegova mama, slavna privatna istražiteljica Calista Cod (gostujuća zvijezda Debra Mooney - "Everwood", "Bostonsko pravo", "Pravda za sve")..', 0, '', 1, 0, 0, 5, 1),
