(242, 'Oprah show (1344.)', 0, '2011-06-09 04:42:00', '2011-06-09 05:22:00', '.Glazbena super zvijezda Celine Dion današnja je Oprina gošća. Nakon što je deset godina pokušavala zatrudnjeti i nakon jednoga strašnoga pobačaja pjevačica je prošloga listopada rodila "čudesne" blizance. Ne propustite televizijski debi njezinih sinova Eddyja i Nelsona! Povest ćemo vas i na razgledavanje njezina spektakularnoga doma na Floridi. Uz to, pomoći će nam da priredimo nevjerojatno i dirljivo iznenađenje roditeljima osmomjesečnih šestorki..', 0, '', 1, 0, 0, 5, 21),
(243, '8. kat: Jedan čovjek, jedna žena, jedan život, talk show', 0, '2011-06-09 05:22:00', '2011-06-09 06:04:00', '.Što je predbračna čistoća, a što tantrički seks? Jesmo li monogamni ili\npoligamni? Jedan od najjačih pokretača i najjača stvaralačka snaga koju\nimamo je seks. O njemu govorimo u današnjoj emisiji..', 0, '', 1, 0, 0, 5, 21),
(244, 'Riječ i život: Kako učvrstiti zajedništvo? religijski program', 0, '2011-06-09 06:04:00', '2011-06-09 06:44:00', '.Geslo "Zajedno u Kristu" u sebi sadrži poziv na jedinstvo sa Svevišnjim i međusobno zajedništvo. Koliko su Papine poruke sjedinile hrvatski narod, a koliko ga približile političkim asocijacijama Europske unije? Kako učvrstiti zajedništvo? Gostuju glumica Renata Sabljak i akademik Josip Bratulić..', 0, '', 1, 0, 0, 5, 19),
