(253, 'Hotel dvorac Orth 4, serija', 0, '2011-06-09 09:08:00', '2011-06-09 09:54:00', '.Wilhelm Eberding, uglađeni gospodin u 50-im godinama, stalni je gost u dvorcu Orth gdje provodi odmor sa ženom Mathildom. No ovaj put je stigao sam. Mathilde ga je napustila jer se osjećala zapostavljenom. Wilhelm, naime, voli samo jedno - svoje orhideje. I mlada Tanja Schöfeld je gošća u hotelu i stanuje upravo u sobi pokraj konzervativnoga Wilhelma. Sluša glasno glazbu, što smeta Wilhelmu. Nešto kasnije Tanja dobiva poruku kako ju je dečko Julius napustio. Razljućena, opije se u hotelskom bar', 0, '', 1, 0, 0, 5, 1),
