(257, 'Krstarenja svjetskim ljepotama: Dunav - putovanje središtem Europe, dokumentarna serija (71/75)', 0, '2011-06-09 10:10:00', '2011-06-09 11:03:00', '.Već tisućljećima Dunav mirno teče Europom. Romantična, često opjevana rijeka, "plavi Dunav" zauzima jedinstveno mjesto u europskoj povijesti. Duž 2850 km toka, od Crne šume u Njemačkoj u kojoj izvire do Rumunjske u kojoj se ulijeva u Crno more, nema zavoja ni obale koji nisu bili u središtu povijesti: sjeverna granica Rimskog Carstva, put za osvajanja i trgovinu za Vikinge ili simbol ujedinjenja Austro-Ugarskog Carstva. Ploviti uzvodno Dunavom znači upoznati kulturnu, jezičnu i vjersku raznolik', 0, '', 1, 0, 0, 5, 8),
