(271, 'Mara Matočec - prva hrvatska političarka, dokumentarni film', 0, '2011-06-09 15:25:00', '2011-06-09 15:58:00', '.U Đelekovcu pokraj Koprivnice 1885. rođena je Mara Matočec, jedinstvena žena -političarka koja će prirodnom inteligencijom i velikom marljivošću postati idol seljačkih žena u Radićevu pokretu.\nMuž joj je 1918. nestao na istočnoj fronti pa je Mara poput mnogih žena ostala sama s djecom. Umjesto da tuguje u samoći, pisala je buntovne pjesme o seljačkim brigama. Učlanila se u Hrvatsku pučku seljačku stranku i ubrzo od naoko priproste i neuke seljanke postala žestoka agitatorica za ravnopravnost že', 0, '', 1, 0, 0, 5, 8),
