(305, '8. kat: Priprema, pozor, odmor, talk show', 0, '2011-06-10 05:14:00', '2011-06-10 06:02:00', '.Počinje sezona godišnjih odmora. Treba se pripremiti za put, izabrati\ndestinaciju, pripremiti auto, odlučiti s kime idemo, što ćemo raditi.\nKroz savjete i osobna iskustva pokušat ćemo vam pomoći da se što bolje\nodmorite..', 0, '', 1, 0, 0, 5, 21),
