(316, 'Hotel dvorac Orth 4, serija', 0, '2011-06-10 09:06:00', '2011-06-10 09:52:00', '.Bračni par Herbert i Irma Loderer provode godišnji odmor u dvorcu Orth. Herbert ne uživa jer ga je Irma natjerala na dijetu. Herbert je preko dana kod Markusa u dvorani za fitnes, navečer sjedi pred tanjurom salate, ali koliko god se trudio, nije izgubio ni grama. Nije ni čudo jer Herbert potajno jede! \nJacobu se sviđa zgodna Gaby Ollinger, koja je sommelier, a ni ona ne može odoljeti njegovu šarmu. Provode zajedno noć, no za Jacoba to nije nešto ozbiljno. Gaby Ollinger je duboko povrijeđena je', 0, '', 1, 0, 0, 5, 1),
