(320, 'Krstarenja svjetskim ljepotama: Na tragu flamanskih i nizozemskih majstora, dokumentarna serija (72/75)', 0, '2011-06-10 10:10:00', '2011-06-10 11:03:00', '.Flandrija i Nizozemska otvorene su prema oceanu zahvaljujući širokim ušćima rijeke Rajne i Schelde, a mreža rijeka i kanala, na kojima se odvija važan trgovački promet, povezuje ih s ostatkom Europe. Zbog ovih razloga ove su dvije zemlje stoljećima bile među najbogatijima na svijetu.\nA bogatstvo koje su stekli bankari i brodovlasnici, zahvaljujući trgovinom začina i tkanina, omogućilo je razvoj trgovačkih gradova kao što su Amsterdam, Delft, Antwerpen, Brugge ili Gent.\nNo ekonomskoj i trgovačko', 0, '', 1, 0, 0, 5, 8),
