(322, 'Oprah show (1346.)', 0, '2011-06-10 11:14:00', '2011-06-10 11:54:00', '.Oskarovka i dobitnica Grammyja Jennifer Hudson razgovarat će s Oprom o tome kako je smršavjela i što mora raditi da održi svoj nov izgled. Ekskluzivno će nam ispričati kako je skinula više konfekcijskih brojeva. A kroz sve to pratilo ju je 75 prijatelja i članova obitelji. Naš današnji gost je i guru stila Tim Gunn koji će nam pokazati nekoliko nevjerojatnih preobražaja nakon izgubljenih kilograma. Uz to, Jennifer će nam premijerno otpjevati svoju najnoviju pjesmu..', 0, '', 1, 0, 0, 5, 21),
