(328, 'Gospodarica tvoga srca, telenovela', 0, '2011-06-10 12:32:00', '2011-06-10 13:20:00', '.Felipe odlazi Sandri, no gospodin Moisés mu kaže da ga Sandra ne želi vidjeti. Moisés pita Sandru zašto ne želi razgovarati s Felipeom, a ona mu odgovori da joj Felipe ne vjeruje te da ne može podnijeti njegovu ljubomoru. Moises je podsjeti da je i ona bila ljubomorna dok je bila u vezi s Horaciom. Na festivalu se pojavljuju ljudi noseći lutku sa zmijskom glavom. José Miguel udari čovjeka s lutkom. Rosendo otima Valentinu. Šerif ga zaustavlja, no on mu govori da ne ide nikamo dok ne smjesti Val', 0, '', 1, 0, 0, 5, 1),
(329, 'Roditelji i djeca, serija', 0, '2011-06-10 13:20:00', '2011-06-10 14:05:00', '.Zeek postaje naporan dok živi s Adamom i Kristinom. Za to se vrijeme Camille usredotočava na umjetnost umjesto na muža. Da bi oca izvukla iz dugova, Julia zove u pomoć staru ljubav s fakulteta, što smeta Joelu. Amber se grize jer je izdala Haddie..', 0, '', 1, 0, 0, 5, 1),
