(332, 'Drugo mišljenje', 0, '2011-06-10 14:16:00', '2011-06-10 14:55:00', '.Koje su indikacije za primjenu hormona rasta, dakle. kome ga dajemo i zašto? Kod kojih bolesti nalazimo manjak hormona rasta, kako se dijagnosticira taj manjak te kakvi se učinci očekuju u primjeni. Koje su eventualne nus pojave, a koje moguće zlouporabe kod odraslih, ali i kod djece.\n\nGOSTI: prim.dr.sc JASENKA ILLE i doc.dr.sc DARKO KAŠTELAN.', 0, '', 1, 0, 0, 5, 10),
