(334, 'Dharma i Greg 4, humoristična serija', 0, '2011-06-10 15:02:00', '2011-06-10 15:25:00', '.Greg odluči pratiti Dharmu i njezine luckaste prijatelje na izlet u Meksiko dok Larry u Edwardovoj tvrtki prihvaća posao zaštitara..', 0, '', 1, 0, 0, 5, 1),
(335, 'Rodna gruda, emisija pučke i predajne kulture', 0, '2011-06-10 15:25:00', '2011-06-10 15:54:00', '.Što je Hrvatima iz Bosne i Hercegovine, koji su za rata morali napustiti svoje domove, rodna gruda? Kako čovjek istrgnut iz zavičaja može sačuvati nostalgiju i uspomene, ljubav prema rodnoj grudi? Ispričat će nam to članovi tročlane obitelji Dajaković koji su osnovali KUD "Rodna gruda" koji okuplja dvjestotinjak članova među kojima je najviše djece i mladih. Oni uče svirati šargiju, violinu i dvojnice, igrati stara i nova kola i odijevati narodne nošnje iz svih hrvatskih krajeva Bosne i Hercego', 0, '', 1, 0, 0, 5, 4),
