(337, 'Iza ekrana', 0, '2011-06-10 15:59:00', '2011-06-10 16:32:00', '.U jubilarnoj emisiji "Iza ekrana" pogledajte:\nŠto je i na koji način "skriveno" u arhivu Hrvatske radiotelevizije.\nAktivno Vas uključujemo u odabir filmova, blockbustera, koje ćete gledati petkom u 20.10 na Prvom programu HTV-a te u vaše domove vraćamo popularnog Stipu. \nKao i svakog tjedna otkrivamo Vam filmove, serije i emisije koje ćete gledati na malim ekranima..', 0, '', 1, 0, 0, 5, 11),
