(343, 'Dobro je znati, znanstveno-obrazovna emisija', 0, '2011-06-10 17:41:00', '2011-06-10 18:14:00', '.U Slavonskom Brodu poljoprivredna škola iz 22. stoljeća. Učenici kloniraju povrće i uzgajaju ga najmodernijom metodom - bez sadnje u zemlju. Prinosi su 7 do 8 puta veći nego na polju. Sve što proizvede škola i proda, a dio profita dobivaju učenici. Eko kupine izvoze čak u Japan.\nNo to nipošto nije kraj. Šest tisuća vrsta cvjetova koje također prodaju, najljepši školski park u Hrvatskoj, pčele, začinsko bilje, lipicaneri - svega ima na tom imanju od čak 80 hektara. Bivši učenici stečena znanja p', 0, '', 1, 0, 0, 5, 10),
(344, 'U istom loncu, kulinarski show', 0, '2011-06-10 18:14:00', '2011-06-10 19:03:00', '.Kuhari izazivači su članovi Crvene jabuke: Dražen Žerić - Žera, Krešimir Kaštelan - Krešo i Marko Belošević, a TV kuhari Tomislav Špiček i Slavko Večerić. Tko će bolje pripremiti pile u špinatu i obično neobične gljive, odlučit će članovi žirija Zlatko Gall, Željko Pervan i Andrea Baršin Novak.\nGošća kuharica danas je Ivana Vukmanić.\n\n\nSve recepte možete naći na.', 0, '', 1, 0, 0, 5, 21),
(345, 'Dnevnik plavuše: Kad starci prolupaju, emisija pod pokroviteljstvom', 0, '2011-06-10 19:03:00', '2011-06-10 19:13:00', '.Moranini roditelji su ovaj put u svojim novim idejama nadmašili sebe. Predali su zahtjeve za prijevremenu mirovinu i planiraju ostvariti putovanje svoga života u svom novom "pokretnom" domu, kućici na kotačima. Morana je zbunjena i ne može se pomiriti s njihovim novim i iznenadnim odlukama, te zove u pomoć prijateljice. Gabi će savjetovati najpovoljnije kreditno rješenje jer radi u banci, što će inspirirati i Laru za odluku o štednji, ali novi šok za Moranu dolazi kad sazna da roditelji žele pr', 0, '', 1, 0, 0, 5, 2),
