(352, 'SILVERADO, akcijski film', 0, '2011-06-10 20:11:00', '2011-06-10 22:25:00', '.Paden (Kevin Kline) je kauboj slatkoga lica koji se sprijatelji s tri stranca dok traži svoju sreću na američkom zapadu. Loner Emmett (Scott Glenn) prvo spašava Padena od smrti u pustinji, a zatim njih dvojica spašavaju Emmettova brata Jakea (Kevin Costner) iz zatvora. Priključuje im se i Mal (Danny Glover), kauboj crnac koji se bori za očuvanje svog obiteljskog gospodarstva te se njih četvorica upute u Silverado, gradić na granici kojim vlada pokvareni šerif (Brian Dennehy) i u kojemu se nalaz', 0, '', 1, 0, 0, 5, 3),
