(358, 'Filmski maraton - ciklus Anga Leeja: Požuda, oprez - američko-kinesko-tajvansko-hongkonški film (18)(152'')', 0, '2011-06-11 00:06:00', '2011-06-11 02:40:00', '.Ratna drama. Godine 1942. u Šangaju kolaboracionist japanskih okupacijskih vlasti, gospodin Yee, sastaje se u draguljarnici sa svojom mladom ljubavnicom Chia Chiom, koju on poznaje kao gospođu Mak. Radnja filma se vraća unatrag. Godina je 1938., Japan je okupirao Kinu, a mlad, zgodan i domoljubno raspoložen vođa studentskih kazalištaraca Kuang Yu Min dozna da se gospodin Yee nalazi u Hong Kongu. Padne mu na pamet da ''režira'' ''predstavu života'', a sve kako bi mlada i privlačna studentica Chia Ch', 0, '', 1, 0, 0, 5, 3),
(359, 'Filmski maraton: Veličanstveni mesar, hongkonški film', 0, '2011-06-11 02:40:00', '2011-06-11 04:24:00', '.U gradu postoje dvije suprotstavljene kung-fu škole. Škola 5 zmajeva čiji je učitelj Gao Dahai i škola Huang Feihonga. Shi Guang, u potrazi za bratom, stiže u grad sa svojom ženom Yuemin. Sin učitelja Gaoa Dahaia otme lijepu Yuemin, a svemu svjedoči Gaova posvojena kći Lan Xin. Shi Guang konačno pronađe svoga brata mesara Ronga te Rong odlazi u školu 5 zmajeva i oslobodi Yuemin no zajedno s Yuemin odvedu i Gaovu kćer Lan Xin mislivši da je i ona također oteta...\n\nGlavnu ulogu igra legendarni Sa', 0, '', 1, 0, 0, 5, 3),
