(361, 'Muškarci na stablima 2, serija', 0, '2011-06-11 04:34:00', '2011-06-11 05:15:00', '.Marin slavi dovršetak svoje knjige odlaskom u toplice u Anchorageu. Ondje se iznenadi ugledavši Julijinog (Kelli Williams) supruga Jima (Josh Stamberg) s drugom ženom, te se dvoumi treba li reći Jacku. Sada kad mu se vratilo pamćenje, Patricka dočeka nekoliko iznenađenja na povratku u Elmo: Annie i Ivan (Diego Klattenhoff) su postali bliski, a Celia je preuredila njegovu spavaću sobu - za svojeg novog psa. Za to vrijeme u New Yorku Sam (Ty Olsson) neočekivano postane junak, a Jane se boji da mu', 0, '', 1, 0, 0, 5, 1),
