(388, 'Kulturna baština: Krkom uzvodno (2. dio)', 0, '2011-06-11 14:55:00', '2011-06-11 15:10:00', '.Drugi dio emisije putovanja Krkom počinje plovidbom kroz kanjon od Roškog slapa. Ovaj,središnji dio Nacionalnog parka Krka,izvan je pješačke zone i slabije poznat,noi posjetitelji , uz malo truda i muke, mogu vidjeti njegove ljepote, a organizirani su i izleti brodom..', 0, '', 1, 0, 0, 5, 22),
