(390, 'Jelovnici izgubljenog vremena: Antički slanutak', 0, '2011-06-11 15:40:00', '2011-06-11 16:05:00', '.Slanutak je jedna od najstarijih žitarica koja se iz Male Azije još u III. tisućljeću \nprije Krista počela širiti po Sredozemlju, pa potom po cijeloj Europi. Brojni su recepti, poput prastarog namaza od slanutka, egipatskih i grčkih jela, te posebno onih njegovanih u Starom Rimu, ostavili traga na gastronomiji. Potom, zahvaljujući Arapima ova je drevna grahorica zasjela na naše stolove kao nezaobilazni dio naših jelovnika u kojima eto uživamo od antike do danas..', 0, '', 1, 0, 0, 5, 16),
