(395, 'Reporteri: "Bande mladih u Liverpoolu" i "Sudac za maloljetnike u Granadi"', 0, '2011-06-11 16:50:00', '2011-06-11 17:55:00', '.Nema mjesta na svijetu koje se na ovaj ili onaj način ne bori s maloljetničkom delinkvencijom. Uza sve napore mnoštvo je mladih koji završe u krugu kriminalaca, gdje su droga, oružje i nasilje njihova svakodnevica. Primjer dvaju gradova Liverpoola i Granade pokazuje sve neuspjehe i poneki uspjeh u rješavanju problema. Može li nekadašnji izbacivač iz lokala, koji je i sam odslužio godine zatvora, postati zaštitnik sugrađana u starom dijelu Liverpoola, onih između 14 i 18 godina? Koliko je u Gran', 0, '', 1, 0, 0, 5, 8),
(396, 'Prugasta braća: Družba mungosa, dokumentarna serija (2/4)', 0, '2011-06-11 17:55:00', '2011-06-11 18:45:00', '.Obitelj prstenaste braće u nepovoljnom je položaju. Nekoć moćna skupina mungosa morala je preseliti brlog nakon sukoba s prugastim srodnicima i sada više ni po čemu ne podsjeća na nekadašnju moć. Divino najmlađe dijete muči se s preživljavanjem, a ni za dvoje snažnije mladunčadi - Munga i Maru - život ne postaje osobito lakšim.\nSukobi sa suparničkom skupinom sve su češći, kao i ozljede koje proistječu iz tih sukoba. Choker, jedan od starijih mužjaka u skupini, trpi najteže posljedice. Ozljeda s', 0, '', 1, 0, 0, 5, 8),
