(433, 'manjinski MOZAIK: Pogled na rudnik', 0, '2011-06-12 11:40:00', '2011-06-12 11:55:00', '.Više od 400 godina u Labinu i okolici odvijala se intenzivna rudarska djelatnost. Rudnici su dugo bili kralježnica labinskog gospodarstva. Tako su poslije Drugog svjetskog rata u taj kraj počeli dolaziti radnici iz cijele bivše Jugoslavije. Najviše je bilo onih iz Bosne. Tokom godina mnogi od njih stvorili su novi život u Labinu te odlučili ostati. Jedan od njih je i Mehmed Đekić. Iako je došao kao kopač, vrlo je brzo napredovao, školovao se i obavljao rukovodeće poslove. Devedesetih za vrijeme', 0, '', 1, 0, 0, 5, 23),
