(461, 'Izbor Miss i Mr Hrvatske, prijenos', 0, '2011-06-12 21:05:00', '2011-06-12 22:25:00', '.12 djevojaka i 12 mladića pokušat će osvojiti simpatije gledatelja i žirija te se okititi laskavom titulom Miss i Mistera Hrvatske - uživo iz HTV-ovog studija "Anton Marti" pratimo ovogodišnji Izbor.\nUz dobru zabavu i suradnju gledatelja, odabrat ćemo djevojku i mladića koji će nas predstavljati na svjetskim izborima ljepote.\nU glazbenom dijelu nastupaju: Ana Rucner, Jacques Houdek, Ana Karuza, Ivo Gamulin Gianni..', 0, '', 1, 0, 0, 5, 16),
