(464, 'Ciklus europskog filma: Angel, francuski film', 0, '2011-06-12 22:50:00', '2011-06-13 00:45:00', '.Melodrama. Angelica Deverell (R. Garai) piše već od rane mladosti. Iako je profesorica u školi ne shvaća, a ni kod kuće ne nailazi na podršku, ona se uspije probiti do poznatog londonskog izdavača koji joj objavi knjigu. Postigne neočekivani uspjeh, a tako i nekoliko njezinih sljedećih romana. Angelica, koju svi zovu Angel, postane slavna autorica, uzor mnogim ženama i miljenica onih koji su blizu nje, osobito Esméa (M. Fassbender), ambicioznog, no ne osobito talentiranog slikara...\nMelodrama "', 0, '', 1, 0, 0, 5, 3),
(465, 'Monk 7, serija', 0, '2011-06-13 00:45:00', '2011-06-13 01:30:00', '.Monka i Natalie posjećuje stari Mitchev prijatelj, mornarički poručnik Steven Albright. Njegov prijatelj Jason Pierce počinio je samoubojstvo, no Albright sumnja na ubojstvo pa želi da Monk provede istragu. Monk pristane, no iznenadi se kad vidi da je mjesto navodnog zločina podmornica. Albright objašnjava okolnosti Pierceove smrti, no u želji da što prije izađe iz podmornice Monk prihvaća službenu ocjenu da je riječ o samoubojstvu. Nedugo zatim oglasi se alarm i podmornica zaroni pod vodu. Gla', 0, '', 1, 0, 0, 5, 1),
