(469, 'Alpe Dunav Jadran', 0, '2011-06-13 02:50:00', '2011-06-13 03:20:00', '.Kako je s uspjehom obnovljena "Ilztal željeznica" između Passaua i Waldkirchena, upoznat će nas Bavarska televizija BR. Priču o obiteljskom liječniku donosi Švicarska televizija RTSi. Dobrodošli u Heberstein. Tamo nas poziva ugledni austrijski novinar Günther Ziesel. Putopisac na biciklu Emilio Rigatti. Televizijski zapis Talijanske televizije RAI. Bracera - ponos hrvatske tradicionalne drvene brodogradnje. Priča Karmen Šore s Hrvatske televizije HTV..', 0, '', 1, 0, 0, 5, 10),
(470, 'Eko zona', 0, '2011-06-13 03:20:00', '2011-06-13 03:50:00', '.-Zašto je u Njemačkoj više od 250 tisuća niskoenergetskih kuća, a u Hrvatskoj samo nekoliko desetaka?\n-Hoće li politika donijeti smeće iz cijele Dalmacije u šibenski regionalni centar za gospodarenje otpadom Bikarac?\n-Koliko je u Hrvatskoj biomasa iskorištena u energetici?\nOve i ostale zelene vijesti iz naše zemlje pogledajte u Eko zoni..', 0, '', 1, 0, 0, 5, 8),
