(513, 'Dnevnik plavuše: Život je san! emisija pod pokroviteljstvom', 0, '2011-06-13 19:02:00', '2011-06-13 19:12:00', '.Lara sanja san koji ne prestaje ni u budnom stanju. Na granici sna i jave, Lara se pita nije li izgubila pamćenje. U tom snu je u njezin život uletio dečko njezine trudne prijateljice Gabi, a to je nitko drugi nego Toni, koji spava u njezinom krevetu. Lara čeka bebu u tom snu, a Gabi i Morana te cijela Larina obitelj uključena je u pripreme Larinog skorog vjenčanja s Tonijem.\nLijepo je sanjati dečke, dobru hranu, romantična mjesta na koja se odlazi u dvoje, ali pod uvjetom da to nije tuđi dečko', 0, '', 1, 0, 0, 5, 2),
