(529, 'Dva i pol muškarca 5, humoristična serija', 0, '2011-06-14 00:40:00', '2011-06-14 01:00:00', '.Iscrpljen od izlazaka s dosadnim, ispraznim mladim ženama, Charlie dopušta Alanu da ga upozna sa sofisticiranom, inteligentnom sutkinjom Lindom (Ming Wen: Hitna služba). No na nesreću, uplašeni Charlie toliko zabrlja na večeri da ga Linda odbija ponovno vidjeti - sve dok ne završi na njezinom sudu. Za to vrijeme Jake ne prestaje razgovarati na mobitel....', 0, '', 1, 0, 0, 5, 1),
