(531, 'Završni udarac 4, serija', 0, '2011-06-14 01:45:00', '2011-06-14 02:30:00', '.U centru Los Angelesa iz blizine je ustrijeljen čovjek koji je nosio prislušni uređaj, a na mjesto zločina prvi stiže baš Ricardo Ramos (gost Stephen Martines - Opća bolnica), koji za Los Angeles Times prati rad Jedinice za prioritetna ubojstva. Žrtvina povezanost s istragom o drogi preklapa se s Fritzovim poslom u FBI-u i dvoboj između Brende i njezina zaručnika oko kontrole nad slučajem dovodi do sukoba..', 0, '', 1, 0, 0, 5, 1),
(532, 'Zakon i red: Odjel za žrtve 10, serija', 0, '2011-06-14 02:30:00', '2011-06-14 03:10:00', '.Nakon što je na parkiralištu striptiz-kluba nađen teško pretučen muškarac, detektivi imaju veoma malo informacija. Počinju s ispitivanjem plesačica, a zatim sumnjivci postaju žrtvina žena i trinaestogodišnji sin....', 0, '', 1, 0, 0, 5, 1),
