(553, 'Krstarenja svjetskim ljepotama: Krstarenje svijetom Inka - Od Cuzca do Quita, dokumentarna serija (74/75)', 0, '2011-06-14 10:10:00', '2011-06-14 11:00:00', '.Pet stoljeća nakon što je osvajač Pizzaro porazio kralja Inka Atahualpa, zlatom ukrašene katedrale i dalje podsjećaju na sjaj i raskoš hrama Sunca.\nPutujući od Santiaga do glavnoga grada Ekvadora Quita, ispričat ćemo povijest područja u kojem još žive brojne uspomene na najsjajniju, ali i najtajanstveniju civilizaciju koja je ikada živjela na tlu Južne Amerike - na carstvo Inka.\nPloveći duž Anda, otkrit ćemo veličanstvene krajolike, gradove zapanjujuće povijesti i uvjeriti se kako žive nasljedn', 0, '', 1, 0, 0, 5, 8),
