(582, 'Kako je nastao japanski tsunami, dokumentarni film', 0, '2011-06-14 20:10:00', '2011-06-14 21:05:00', '.U petak, 11. ožujka 2011., potres jačine 9,0 stupnjeva po Richteru izazvao je golemi val, tsunami, koji je razorio dijelove japanskog obalnog područja.\nOvaj dokumentarni film istražuje znanstvenu podlogu potresa i tsunamija. Film prati Rogera Bilhama, profesora geoloških znanosti, koji je došao u Japan nekoliko dana poslije prvog udara, i njegovo proučavanje razorena područja iz zraka.\nPotres je pomaknuo Japan gotovo 4 metra bliže SAD-u. Pomaknuo je Zemlju iz njezine osi i promijenio brzinu nje', 0, '', 1, 0, 0, 5, 8),
