(591, 'Magdalena, glazbeno-dokumentarni film', 0, '2011-06-14 23:40:00', '2011-06-15 00:30:00', '.Krajem sedamdesetih godina obitelj Kožena iz Brna umjesto obiteljske limuzine "Trabanta" nabavila je glasovir. No, slomljena ruka na satu tjelesnog odgoja naprasno je prekinula opsesivno vježbanje i snove o pijanističkoj karijeri malene Magdalene. Da nadoknadi gubitak, okrenula se pjevanju. Ostalo je povijest.\nPonovno prikazujemo stilizirani filmski portret velike pjevačke dive, mezzosopranistice Magdalene Kožene, autora Ondreja Havelke. Autoironičan životopis ispričan u stilu baroknoga recitat', 0, '', 1, 0, 0, 5, 8),
(592, 'Dodir života i smrti 2, serija', 0, '2011-06-15 00:30:00', '2011-06-15 01:10:00', '.Ned, Chuck i Emerson istražuju slučaj mrtvog milijunaša (gostujuća zvijezda Shelley Berman) kojeg je vjerojatno ubila njegova mnogo mlađa udovica sponzoruša (gostujuća zvijezda Jennifer Elise Cox) ili moderni Robin Hood (gostujuća zvijezda Danny Comden). Lily šizi jer se sumnjivi Dwight Dixon (gostujuća zvijezda Stephen Root) počne udvarati naivnoj Vivian..', 0, '', 1, 0, 0, 5, 1),
(593, 'Dva i pol muškarca 5, humoristična serija', 0, '2011-06-15 01:10:00', '2011-06-15 01:30:00', '.U jubilarnoj 100. epizodi Charlie se približava konzumaciji veze s Lindom (gostujuća zvijezda Ming Wen), ali nastavlja viđati Roseino (bivša zvijezda serije Melanie Lynskey) lice kamo god se okrene. Gostujuća zvijezda Jane Lynch pojavljuje se u ulozi dr. Freeman..', 0, '', 1, 0, 0, 5, 1),
