(597, 'Trava zelena 4, humoristična serija', 0, '2011-06-15 03:15:00', '2011-06-15 03:45:00', '.Prošle su tri godine kako su Boycie, Marlene i Tyler pobjegli iz grada i navikli se na novi život u Shropshireu gdje uživaju u svim blagodatima ladanjskog života.\nBoycie i Marlene proslavit će 40. godišnjicu braka. Marlene želi da obnove zavjete. Ali dok priprema popis gostiju, saznaje neočekivane istine koje će promijeniti njezin odnos s mužem.\nU jednoj će epizodi svi kupovati starine s katastrofalnim posljedicama. Tyler će trebati novac za svoj bend "Lokva agonije", ali Boycie ne samo da mu g', 0, '', 1, 0, 0, 5, 1),
