(619, '1001 noć, dramska serija', 0, '2011-06-09 14:45:00', '2011-06-09 15:25:00', '.Onur se pojavi kod Šeherezade i zatraži kopiju projekta za koji je zadužena. Uzbuđena zbog njegovog iznenadnog dolaska, iz pristojnosti ga pozove u kuću i upozna s Mirhiban i Kaanom. Burhan je tužan jer mu unuk nije poljubio ruku kad su se sreli na groblju. Ali Kemal obnovi vezu s ljubavnicom, a Fusun je sve više nezadovoljna. Kerem je jednoglasnom odlukom postao predsjednik Upravnog odbora građevinske kompanije Binyapi. Bennu je tužna zbog Keremove neuzvraćene ljubavi..', 0, '', 1, 0, 0, 7, 1),
(620, '1001 noć, dramska serija', 0, '2011-06-09 15:25:00', '2011-06-09 16:05:00', '.Majke Onura i Kerema ponude Šeherezadi sudjelovanje u tvrtkinom dobrotvornom projektu. Ali Kemal se s ljubavnicom potajno nađe u kafiću, ali uoči ih Gani i mobitelom ih fotografira. Zbog neuzvraćene ljubavi, Bennu utjehu potraži u alkoholu. Za doručkom, Ali Kemal slaže obitelji da je radio cijelu noć zbog nove narudžbe, no Gani mu nasamo pokaže fotografiju i zaprijeti mu da će sve reći sestri. Na Burhanovu molbu, Nadida odlazi u posjet unuku i donosi mu poklone. Onur i Šeherezada odlaze na posl', 0, '', 1, 0, 0, 7, 1),
