(625, 'Krv nije voda, serija', 0, '2011-06-09 19:05:00', '2011-06-09 20:00:00', '.Samohrana majka Romana (38) boji se da bi njezina kćer tinejdžerica Jelena (17), mogla poput svog oca krenuti krivim putem jer se druži s osobama sumnjive pozadine. Iako je Jelena sama po sebi jako agresivna djevojka koja nikoga ne poštuje, krade, pije alkohol i markira školu, njezin dečko Miki Romani je najveći trn u oku. Jelena čak pokuša i svoju mlađu sestru Sandru (12) nagovoriti na krađu i time prelazi svaku granicu. Ni Mislav, Romanin suprug kojeg ranije puštaju iz zatvora, ne pridonosi p', 0, '', 1, 0, 0, 7, 1),
(626, 'Ezel, dramska serija', 0, '2011-06-09 20:00:00', '2011-06-09 21:00:00', '.Ramiz upoznaje Ezela sa svojim bankovnim računima, tajnim sefovima i lokacijama na kojima se lako skrivao od neprijatelja. Istovremeno, Kenan susretne svoju kći Damlu, no umjesto da joj kaže tko je, predstavi se kao poduzetnik. Sretan je jer ona živi u dobroj obitelji pa sačuva tajnu samo za sebe i iskrade se sa sastanka. Ezel i Ramiz otkriju da je Temuz oteo Azad i odveo je na skrovitu lokaciju. Nakon krvavog obračuna vatrenim oružjem, Ujak i Ezel sretni su što su izbjegli metke i spasili Azad', 0, '', 1, 0, 0, 7, 1),
