(628, 'Uvod u anatomiju, dramska serija', 0, '2011-06-09 22:00:00', '2011-06-09 22:55:00', '.Seattle Grace – Mercy West bolnica je pod najvećim sigurnosnim mjerama s obzirom da su šef Webber i njegovi doktori dobili novog pacijenta, važnu političku osobu sa Srednjeg istoka kojoj pokušavaju spasiti život. Istovremeno, Cristina je napokon odlučila kako će urediti svoj novi dom pa prije negoli to zaista i učini, priredi zabavu povodom useljenja. Alex zakasni na prvi radni dan svog novog šefa, doktora pedijatrije Phila Starka (Peter MacNicol)..', 0, '', 1, 0, 0, 7, 1),
(629, 'Uvod u anatomiju, dramska serija', 0, '2011-06-09 22:55:00', '2011-06-09 23:50:00', '.Nakon što je Derek dobio potvrdu za svoje novo kliničko ispitivanje, kolege koji sudjeluju u projektu odlučili su ga počastiti pićem u Joe''s baru. Međutim, svi su zapanjeni kada tamo susretnu poznatu osobu. Istovremeno, Meredith i Alex su primorani raditi noćnu smjenu kako bi bili uz novog 9-godišnjeg pacijenta na kojem je netom napravljen težak operativni zahvat i kojeg pod budnim okom čuva vrlo agresivna majka….', 0, '', 1, 0, 0, 7, 1),
