(672, 'Razlazi', 0, '2011-06-11 15:45:00', '2011-06-11 17:25:00', '.Monica (S. Hayek) i Steve (R. Crowe), u istom kadru, ali ne u istom prostoru, svako za sebe pričaju svoju ljubavnu priču, i to gotovo na isti način: kako su na prvi pogled znali da je to to, kako su postali bolji kad su bili zajedno, Steve je prestao pušiti, Monica je izgubila sve svoje strahove i brige; Monica je vjerovala da je stvar u nadi, a Steve je to opisao kao da prije nije bio živ, ali to nije znao dok uz Monicu nije oživio...\nNjihova ljubav je savršena, vole se, seks je sve bolji, ali', 0, '', 1, 0, 0, 7, 3),
(673, 'Zvijezde Ekstra: Miley Cyrus, zabavna emisija', 0, '2011-06-11 17:25:00', '2011-06-11 18:30:00', '.Miley Cyrus nije oduvijek bila sretna. Iako joj je otac poznati američki country pjevač, Billy Ray Cayrus (poznat po hitu „Achy Breaky Heart“), Mileyno djetinstvo nije bilo savršeno. Osim što su ovu djevojčicu iz Tennesseeja od najranije dobi smetala podrugljiva ogovaranja školskih prijatelja i šale na račun očeve slave, nije joj bilo lako niti kasnije kada se s obitelji preselila u Hollywood kako bi se probila u svijet glume i glazbe.\nU današnjoj epizodi „Zvijezdi Ekstra“ uskočit ćemo u svijet', 0, '', 1, 0, 0, 7, 13),
(674, 'RTL Danas, informativna emisija', 0, '2011-06-11 18:30:00', '2011-06-11 19:05:00', '..', 0, '', 1, 0, 0, 7, 13),
(675, 'Moja 3 zida, humoristična serija', 0, '2011-06-11 19:05:00', '2011-06-11 20:00:00', '.Jerko se sažalio nad beskućnikom (Mario Kovač) kojega je sreo u gradu te ga je pozvao k sebi na večeru. No, kako je njegov frižider prazan, večeru je odlučio spremiti i poslužiti u Jadrankinom stanu jer, naravno, nje nema kod kuće! No nedostaje nekolicina namirnica pa Jerko odlazi u trgovinu. Vrlo brzo u stan stiže Jadranka. Uvjerena je da je ulovila provalnika!.', 0, '', 1, 0, 0, 7, 1),
(676, 'Operacija Valkira', 0, '2011-06-11 20:00:00', '2011-06-11 22:15:00', '.Od redatelja filmova Privedite osumnjičene i X-Men dolazi novi filmski hit s Tomom Cruiesom u glavnoj ulozi. Na vrhuncu Drugog svjetskog rata, grupa visoko pozicioniranih njemačkih časnika smislila je plan atentata na Adolfa Hitlera, kako bi preuzeli vodstvo nad vojskom i okončali rat. Operacija je nazvana tajnim imenom ''Valkira'', prema kriznom planu za slučaj pobune protiv nacističke vlade... Temeljen na istinitoj priči o pukovniku Clausu von Stauffenbergu i njegovom odvažnom i genijalnom plan', 0, '', 1, 0, 0, 7, 3),
