(678, 'OZNAČEN ZA SMRT, film, akcijski', 0, '2011-06-11 23:15:00', '2011-06-12 01:00:00', '.Izgubio je nadu u pravdu, dignuo ruke od svega i krenuo u mirovinu, no kada zlo pokuca na vrata, ponekad je jedini odgovor - sila.\nJohn Hatcher (Steven Seagal), bivši DEA agent, vraća se kući iz Kolumbije, gdje je njegov partner ubijen u akciji protiv opasnog dilera droge. I upravo je smrt partnera bila povod zbog kojega se John odlučio povući u mirovinu. No kada otkrije da nemilosrdni raspačavač droge, Jamajčanin Screwface (Basil Wallace) hara njegovim starim kvartom i da pokušava smaknuti nje', 0, '', 1, 0, 0, 7, 3),
