(711, '1001 noć, dramska serija', 0, '2011-06-13 14:40:00', '2011-06-13 15:25:00', '.Šeherezada je izvan sebe zbog nestanka sina i Mihriban, ali Onur je uz nju i pokušava je smiriti. No ispadne da su Kaan i Mirhiban izašli van bez novčanika i ključeva pa su morali čekati Šeherezadin dolazak. Fusun dobije trudove ranije i zajedno s obitelji odlazi u bolnicu. U isto vrijeme, njezin suprug Ali Kemal zabavlja se s ljubavnicom Jansel, što jako razljuti Ganija, koji zna za njegovu tajnu aferu. Nakon poroda, Fusun pada u poslijeporođajnu depresiju. Bennu je uzbuđena zbog odlaska na po', 0, '', 1, 0, 0, 7, 1),
