(738, '1001 noć, dramska serija', 0, '2011-06-14 14:35:00', '2011-06-14 15:20:00', '.Šeherezada ispriča Onuru svoju životnu priču, od dana kada joj je poginuo suprug do noći kada je pristala uzeti novac za liječenje sina. Iako zna da ona želi što prije sve zaboraviti, Onur joj još jednom izjavi ljubav. Fusunina napetost sve više zabrinjava ukućane. Bolesnu Mihriban Šeherezada mora otpratiti u bolnicu i javlja tajnici da neće stići na poslovni sastanak. Njenog sina pričuvat će Nadide, što jako razveseli Burhana. Bennu šokira iznenadni posjet sestre Melek iz Londona….', 0, '', 1, 0, 0, 7, 1),
