(744, 'Krv nije voda, serija', 0, '2011-06-14 19:05:00', '2011-06-14 20:00:00', '.Šesnaestogodišnja Nina Roso potajno je rodila dijete u toaletu Glavnog željezničkog kolodvora. Njezini roditelji Vera (41) i Goran (44) iznenađeni su ovom viješću jer uopće nisu ni slutili da im je kći trudna. No, kada pokušaju saznati ime oca, mlada majka ga odluči sakriti. Kako bi pronašli njegov identitet,  roditelji joj odluče prekopati sobu.  Tamo nađu fotografiju Ninina profesora engleskog jezika ukrašenu srcima. Je li to otac malog Filipa? Ljutiti roditelji pozovu profesora na razgovor. ', 0, '', 1, 0, 0, 7, 1),
(745, 'Ezel, dramska serija', 0, '2011-06-14 20:00:00', '2011-06-14 21:00:00', '.Zahvaljujući Aliju, Tefo je postao drugi čovjek. Više nije ničiji sluga koji izvršava neugodne zadatke, a s novom pozicijom vratilo mu se samopouzdanje jer ga prihvaćaju kao velikog šefa. Tefo tek sada živi lijep život sa Šebnem, ženom s kojom namjerava provesti ostatak života. Istovremeno, Džengiz i Temuz vjeruju da je napokon došlo vrijeme da uzburkaju novonastalu situaciju. Kako bi došli bliže Ezelu i Aliju, momci postave zamku za Tefa. Naime, tijekom posljednjeg poziva u pomoć, Tefa će umje', 0, '', 1, 0, 0, 7, 1),
(746, 'Big Brother, reality show', 0, '2011-06-14 21:00:00', '2011-06-14 22:00:00', '..', 0, '', 1, 0, 0, 7, 21),
(747, 'Jezikova juha, reality show', 0, '2011-06-14 22:00:00', '2011-06-14 22:55:00', '..', 0, '', 1, 0, 0, 7, 21),
(748, 'UROTA, političko - kriminalistički triler', 0, '2011-06-14 22:55:00', '2011-06-15 00:00:00', '.Na velikom međunarodnom političkom skupu izvršen je atentat na hrvatskog premijera Brnasa. U općem metežu i panici tjelohranitelji stavljaju pogođenog Brnasa u auto i uz pratnju jure prema bolnici. Visoki državni dužnosnici, na čelu s ministrom MUP-a, nakon atentata odlaze na tajnu lokaciju održati sastanak. Dok Dijana Supilo izvještava o događaju s mjesta atentata, premijerov savjetnik Vojković u bolnici formira privremeni ured. Agent POA-e, Kesić, iznosi svoja saznanja i pretpostavke Vojković', 0, '', 1, 0, 0, 7, 1),
(749, 'RTL Vijesti, informativna emisija', 0, '2011-06-15 00:00:00', '2011-06-15 00:15:00', '..', 0, '', 1, 0, 0, 7, 2),
(750, 'UROTA, političko - kriminalistički triler', 0, '2011-06-15 00:15:00', '2011-06-15 01:05:00', '.Kesić i Trifunović po Beogradu prate čovjeka koji je izvršio atentat na hrvatskog premijera i u dogovoru s Vojkovićem planiraju njegovo uhićenje. Istovremeno, agenti POA-e upadaju na tajnu lokaciju i ubijaju čuvare. Tijekom napada Ferenčak puca na jednog od agenata. Vojković povlači svoje ljude s imanja, a Ferenčak javlja svojima kako je tajna lokacija otkrivena. Dijana Supilo s TV ekipom dolazi ispred Banskih dvora, gdje se odvija sjednica užeg kabineta Vlade na kojoj ministar MUP-a iznosi svo', 0, '', 1, 0, 0, 7, 1),
(751, 'Big Brother, reality show', 0, '2011-06-15 01:05:00', '2011-06-15 01:55:00', '..', 0, '', 1, 0, 0, 7, 21),
(752, 'Astro show, emisija uživo', 0, '2011-06-15 01:55:00', '2011-06-15 02:55:00', '..', 0, '', 1, 0, 0, 7, 21),
(753, 'RTL Danas, informativna emisija', 0, '2011-06-15 02:55:00', '2011-06-15 04:55:00', '..', 0, '', 1, 0, 0, 7, 13),
(754, 'Astro show, emisija uživo', 0, '2011-06-15 05:40:00', '2011-06-15 06:20:00', '..', 0, '', 1, 0, 0, 7, 21),
(755, 'OSVETNIK', 0, '2011-06-08 22:45:00', '2011-06-09 00:35:00', '.Tijekom Vijetnamskog rata njegov je zadatak bio otkriti i uništiti neprijateljska skloništa u džungli. Međutim, danas Cal Dexter (Sam Elliott - Conagher, Fail Safe) nije ništa doli obični odvjetnik u gradiću u New Jerseyu... ili se većini tako čini. Potajno, unajmio ga je milijarder, rudarski tajkun, da nađe i privede pravdi čovjeka koji je ubio industrijalčeva unuka, djelatnika američke pomoći u Bosni. Dok njegov zadatak Dextera vodi po cijekome planeru, CIA-in agent Frank McBride mora ga zaus', 0, '', 1, 0, 0, 8, 3),
(756, 'NOVA FACA, igrani film', 0, '2011-06-09 00:35:00', '2011-06-09 02:15:00', '.Dizzy Harrison (DJ Qualls) je nepopularan u školi, štreber koji proživljava pakao u četvrtom razredu gimnazije. Nakon pokušaja da stvori nov identitet, Dizzyja izbace iz škole te on u zatvoru nauči kako biti faca. Po izlasku se upiše u novu školu i očekuje da će ga nova sredina prihvatiti. Ubrzo se u njega zagleda navijačica Danielle (Eliza Dushku), a njezin bijesni dečko počne kopati po njegovoj prošlosti….', 0, '', 1, 0, 0, 8, 3),
(757, 'Na putu prema dolje', 0, '2011-06-09 02:15:00', '2011-06-09 03:10:00', '.Odlučivši propustiti svoje kćeri kako bi osigurao prodaju zaliha metha, Walt sebe i Jesseja učini za milijun bogatijima. Kada dolazi u bolnicu spreman da se ispriča, Skyler je dobro raspoložena i odmah mu oprašta jer im se kći Holly rodila zdrava. Skyler želi nagovoriti sve prijatelje da novčano doprinesu njegovu liječenju od raka, a Walt je uvjerava da ima sve pod kontrolom. U međuvremenu, nakon drogiranja s Jessejem Jane zakasni na jedan od sastanaka za odvikavanje od ovisnosti te mora izmišl', 0, '', 1, 0, 0, 8, 1),
(758, 'Ezo TV', 0, '2011-06-09 03:10:00', '2011-06-09 04:10:00', '..', 0, '', 1, 0, 0, 8, 21),
(759, 'Bračne vode', 0, '2011-06-09 04:10:00', '2011-06-09 05:00:00', '..', 0, '', 1, 0, 0, 8, 1),
(760, 'KOBNA ŽENA, romantična komedija', 0, '2011-06-09 05:00:00', '2011-06-09 06:30:00', '.Neil (Cillian Murphy), samoprozvani filmofil i vlasnik prodavaonice starih filmova, uvijek je bio sretan što život posvećuje svojem omiljenom filmskom žanru, ''film noiru''. Neil je toliko zaokupljen gledanjem filmova i citiranjem scenarija da život leti pokraj njega. tu njegovu stras za filmovima podržavaju i njegovi prijatelji (Jason Sudeikis i Michael Panes). Kada upozna Violet (Lucy Liu), pravu ''femme fatale'', njegov svakodnevni život okrene se naopako, a linija između stvarnosti i filmova, u', 0, '', 1, 0, 0, 8, 3),
(761, 'Kraj programa', 0, '2011-06-09 06:30:00', '2011-06-09 06:50:00', '..', 0, '', 1, 0, 0, 8, 6),
(762, 'Naši najbolji dani', 0, '2011-06-09 06:50:00', '2011-06-09 07:40:00', '.Hope se ne predaje i ne želi se oprostiti od muža. Daniel održava Boa na životu dok čekaju da se Chelseano tijelo očisti od alkohola. Daniel, Kayla i Lexie misle da su našli lijek koji može Bou produžiti život još nekoliko sati. Kate je uz Chelsea koja je priključena na aparate. Čekaju da se tijelo očisti od alkohola kako bi započeli operaciju. Chelsea moli Kate vode i bježi kad ona izlazi iz sobe. Dođu Max i Stephanie kako bi razgovarali s Chelsea, ali otkriju da je nema. Svi je mahnito traže,', 0, '', 1, 0, 0, 8, 1),
(763, 'Neustrašivi Scooby doo', 0, '2011-06-09 07:40:00', '2011-06-09 08:05:00', '.Odmor u Italiji prekinut je nevoljama u drevnim Pompejima, a spletom okolnosti, društvo se nađe u krateru ne posve ugaslog vulkana Vezuva.', 0, '', 1, 0, 0, 8, 1),
(764, 'Bakugan', 0, '2011-06-09 08:05:00', '2011-06-09 08:25:00', '..', 0, '', 1, 0, 0, 8, 1),
(765, 'Bumba', 0, '2011-06-09 08:25:00', '2011-06-09 08:40:00', '.Bumba je odlučio napraviti važan zadatak. Bumba broji obojene lopte te ih baca u zdenac. \nBumba odluči napraviti trik. Za taj trik mu je potreban prijatelj nosorog. Bumbum nosorog nakon trika je jako lijep i zgodan.', 0, '', 1, 0, 0, 8, 1),
(766, 'Roary', 0, '2011-06-09 08:40:00', '2011-06-09 08:55:00', '.CiCi je izabrana za Maksove partnericu za treniranje. Roary je ljubomoran na njihovo novo prijateljstvo i smeta mu što ga zanemaruju.', 0, '', 1, 0, 0, 8, 1),
(767, 'Tomica i prijatelji', 0, '2011-06-09 08:55:00', '2011-06-09 09:35:00', '.Kad je Tomica vidio da na Bruninom hangaru propušta krov, dobrovoljno se javio da će organizirati popravak krova za svog prijatelja. Tomica Bruni objasni svoj plan, ali Bruno još uvijek izgleda jako tužan. Kad je novi krov završen, Tomica upita Brunu zašto je još uvijek tužan. Bruno objasni Tomici kako mu je bio draži stari krov s rupama.', 0, '', 1, 0, 0, 8, 1),
(768, 'Pobjeda ljubavi', 0, '2011-06-09 09:35:00', '2011-06-09 11:20:00', '..', 0, '', 1, 0, 0, 8, 1),
(769, 'Čuvar pravde', 0, '2011-06-09 11:20:00', '2011-06-09 12:15:00', '.Sud proglasi Nicka (Simon Baker)  skrbnikom Dalea i Penny Fante. 16-godišnji Dale treba presađivanje koštane srži kako bi se borio protiv leukemije. Laurie nikako ne može naći Daleovu sestru, pa je Nick prijavi policiji kako bi je našli i testirali za moguću donaciju koštane srži. Saznavši da je socijalna radnica već odavno prestala tražiti Penny, Nick kaže Daleu da će se morati obratiti njegovim roditeljima kojima su zbog zlostavljanja oduzeta djeca..', 0, '', 1, 0, 0, 8, 1),
(770, 'IN magazin', 0, '2011-06-09 12:15:00', '2011-06-09 12:59:00', '.Nakon dužeg izbivanja iz medija za IN magazin govori legendarna glazbena skupina ''Prljavo kazalište''. U današnjoj emisiji gledatelji mogu saznatu sve o mezoterapiji. IN magazin u vrijeme priprema za ljetne dane donosi i nove modne savjete Alme Premerl Zoko.', 0, '', 1, 0, 0, 8, 25),
(771, 'PBZ Pitanje dana', 0, '2011-06-09 12:59:00', '2011-06-09 13:00:00', '..', 0, '', 1, 0, 0, 8, 13),
(772, 'Pobjeda ljubavi', 0, '2011-06-09 13:00:00', '2011-06-09 13:55:00', '.Maria Desamparada na rubu je plača kad ugleda Maxa kako ljubi Jimenu. Otac Juan Pablo kaže joj da Max nije kriv jer ga je Jimena prevarila i da ne bi bilo pošteno naljutiti se na njega. Max se iznenadi kad shvati da je poljubio Jimenu. Kaže joj da prema njoj ništa ne osjeća i da ga ostavi na miru. Bijesna, Maria Desamparada ispljuska Jimenu i kaže joj da Max ne želi ništa s njom i da pokuša sačuvati dostojanstvo tako da ga ostavi na miru jer će se njih dvoje vjenčati. Jimena odgovori da Victori', 0, '', 1, 0, 0, 8, 1),
(773, 'Pobjeda ljubavi', 0, '2011-06-09 13:55:00', '2011-06-09 14:45:00', '.Max kaže Fabianu da se Nati pokušala ubiti. Jimena zatraži od Victorije da otpusti Mariju Desamparadu i da je ne vodi u Miami. Victoria joj odvrati da je mislila da je pametnija i nadoda da će, ako sad otpusti Mariju Desamparadu, Max ići za njom i na kraj svijeta. Obeća joj da će je otpustiti nakon povratka s puta, a da se ona pobrine za Maxa u Miamiju. Cruz i gospodin Napo pitaju Lindu shvaća li što je mogla izazvati svojim lažima. Kažu joj da neće dopustiti da povrijedi Juanja i neka nađe izg', 0, '', 1, 0, 0, 8, 1),
(774, 'Asi', 0, '2011-06-09 14:45:00', '2011-06-09 15:45:00', '..', 0, '', 1, 0, 0, 8, 1),
(775, 'Masterchef', 0, '2011-06-09 15:45:00', '2011-06-09 17:00:00', '.Troje natjecatelja očekuje Stres test s posebnim zadatkom. Ovaj put kandidati će pripremati što vjerniju repliku autorskog jela člana žirijia Tomislava Gretića.  Za kuhanje će imati na raspolaganju sat i pol.  Vidjet ćemo hoće li učenici nadjačati glavnog učitelja i koji će od njih biti najmanje uspješan te na žalost napustiti MasterChef.', 0, '', 1, 0, 0, 8, 25),
(776, 'Vijesti Nove TV', 0, '2011-06-09 17:00:00', '2011-06-09 17:25:00', '..', 0, '', 1, 0, 0, 8, 2),
(777, 'IN magazin', 0, '2011-06-09 17:25:00', '2011-06-09 18:05:00', '.U današnjem Vremeplovu gledatelji IN magazina moći će vidjeti člana žirija Masterchefa Tomislava Gretića. IN magazin donosi izvještaj s velikog koncerta Alke Vuice u Umagu. Približavaju se dani kada se većina vremena provodi na plaži. Nakon što su se riješili viška kilograma i odabrali idealan kupaći kostim, gledatelji mogu vidjeti kako se riješiti još jednog estetskog problema, viška dlačica.', 0, '', 1, 0, 0, 8, 25),
(778, 'Pod sretnom zvijezdom', 0, '2011-06-09 18:05:00', '2011-06-09 19:05:00', '.Krešo ne može vjerovati da je Franck odlučio postaviti ga na Slavenovu poziciju. Adam je ljut na Tonku zbog njezine neozbiljnosti. Dina prizna Silviji i Marti da je Frane nestao u Afganistanu i da je pronašla oca. Bijesna zbog prevare, Vesna traži od Nine da otpusti Beti s mjesta psihologa. Vlasta traži od Zlatka da iskopa informacije o Nininom naglom bogatstvu. Beti je u problemu zbog studenta ovisnika. Zlatko se pred Ninom uspije izvući od otkaza. Slaven na fakultetu sretne Enu. Beti se zahva', 0, '', 1, 0, 0, 8, 1),
(779, 'PBZ Pitanje dana', 0, '2011-06-09 19:05:00', '2011-06-09 19:15:00', '..', 0, '', 1, 0, 0, 8, 13),
(780, 'Dnevnik Nove TV', 0, '2011-06-09 19:15:00', '2011-06-09 20:05:00', '..', 0, '', 1, 0, 0, 8, 2);
INSERT INTO `tv_raspored` (`id`, `naziv`, `nepostoji`, `pocetak`, `kraj`, `opis`, `epizoda`, `url`, `automatika`, `premijera`, `repriza`, `kanal_id`, `kategorija_id`) VALUES
(781, 'Asi', 0, '2011-06-09 20:05:00', '2011-06-09 21:00:00', '.Demir je u vrlo teškoj situaciji. Zbog bolesti nije mogao prihvatiti Asin prijedlog da budu ponovno zajedno. I ne želeći je još više rastužiti, ne govori joj da je bolestan. Demir zamoli Ihsana da ne kaže Asi ništa o njegovoj bolesti. Kerim sanja o vjenčanju s Defne. Kupuje novi prsten i odlazi k Defne. Ovaj je put Zafer odlučan. Odlučio je Kerima ukloniti odande. Defne i Kerim provedu noć zajedno..', 0, '', 1, 0, 0, 8, 1),
(782, 'Masterchef', 0, '2011-06-09 21:00:00', '2011-06-09 22:10:00', '.Očekuje nas još jedan Izazov šefa kuhinje u kojem će po treći put kuhati Robert, ovoga puta protiv Denisa Zembe, najboljeg kuhara u Hrvatskoj, vlasnika restorana Le Mandrač, jednog od najcjenjinijih restorana na Kvarneru. Robertov zadatak bit će replicirati dva jela, glavno jelo pod nazivom ‘Nova fritaja’ i desert. Vidjet ćemo hoće li Robert osvojiti imunitet i tako osigurati svoje mjesto u finalu MasterChefa.', 0, '', 1, 0, 0, 8, 25),
(783, 'Provjereno', 0, '2011-06-09 22:10:00', '2011-06-09 23:15:00', '.Zašto su proljetne oluje nepredvidive više nego ikada do sada te koliko opasne mogu biti provjerila je ekipa informativnog magazina. \nEkipa Provjerenog istražila je što uzrokuje prolom oblaka i olujno nevrijeme usred sunčanog dana. Provjerili su načine kako se zaštititi od sijevanja munja  te razgovarali s ljudima koji  su preživjeli njen udar.', 0, '', 1, 0, 0, 8, 25),
(784, 'Večernje vijesti', 0, '2011-06-09 23:15:00', '2011-06-09 23:35:00', '..', 0, '', 1, 0, 0, 8, 2),
(785, 'Paklena vožnja, igrani film', 0, '2011-06-09 23:35:00', '2011-06-10 01:10:00', '.Pistolero, glavešina bande ozloglašenih bajkera pod imenom Victors sprema osvetu za ubojstvo njihova člana a koje je skrivila supranička banda pod imenom 666. Zajedno sa svojim suborcima Gentom i Comancheom, Pistolero želi poraziti Deucea i Billy Wingsa, nadmene vođe 666-ice, no duhovi prošlosti uplest će se u ostvarenju opake misije...', 0, '', 1, 0, 0, 8, 3),
(786, 'OSVETNIK', 0, '2011-06-10 01:10:00', '2011-06-10 03:00:00', '.Tijekom Vijetnamskog rata njegov je zadatak bio otkriti i uništiti neprijateljska skloništa u džungli. Međutim, danas Cal Dexter (Sam Elliott - Conagher, Fail Safe) nije ništa doli obični odvjetnik u gradiću u New Jerseyu... ili se većini tako čini. Potajno, unajmio ga je milijarder, rudarski tajkun, da nađe i privede pravdi čovjeka koji je ubio industrijalčeva unuka, djelatnika američke pomoći u Bosni. Dok njegov zadatak Dextera vodi po cijekome planeru, CIA-in agent Frank McBride mora ga zaus', 0, '', 1, 0, 0, 8, 3),
(787, 'Otok smrti, hit serija', 0, '2011-06-10 03:00:00', '2011-06-10 03:50:00', '.Obitelj i prijatelji ukrcavaju se na trajekt i kreću na otok kako bi prisustvovali vjenčanju Henryja Dunna (Christopher Gorham) i Trish Wellington (Katie Cassidy). Dok se djeveri pripremaju za jedan razvratni vikend, Henryjeva prijateljica iz djetinjstva Abby (Elaine Cassidy) pojavljuje se u taksiju. Abby vozaču taksija kaže kako već godinama nije bila na otoku. Henry i Trish vrlo su sretni što je Abby na vrijeme stigla na trajekt. Trish želi što prije krenuti, no ne zna gdje je njezin bratić  ', 0, '', 1, 0, 0, 8, 1),
(788, 'Ezo TV', 0, '2011-06-10 03:50:00', '2011-06-10 04:50:00', '..', 0, '', 1, 0, 0, 8, 21),
(789, 'KOBNA ŽENA, romantična komedija', 0, '2011-06-10 04:50:00', '2011-06-10 06:25:00', '.Neil (Cillian Murphy), samoprozvani filmofil i vlasnik prodavaonice starih filmova, uvijek je bio sretan što život posvećuje svojem omiljenom filmskom žanru, ''film noiru''. Neil je toliko zaokupljen gledanjem filmova i citiranjem scenarija da život leti pokraj njega. tu njegovu stras za filmovima podržavaju i njegovi prijatelji (Jason Sudeikis i Michael Panes). Kada upozna Violet (Lucy Liu), pravu ''femme fatale'', njegov svakodnevni život okrene se naopako, a linija između stvarnosti i filmova, u', 0, '', 1, 0, 0, 8, 3),
(790, 'Kraj programa', 0, '2011-06-10 06:25:00', '2011-06-10 06:26:00', '..', 0, '', 1, 0, 0, 8, 6),
(791, 'Neustrašivi Scooby doo', 0, '2011-06-10 07:15:00', '2011-06-10 07:40:00', '.Duh slavnoga bejzbolskog igrača pokušava spriječiti trenutačnu zvijezdu kluba u obaranju njegova dosad neoborenog rekorda..', 0, '', 1, 0, 0, 8, 1),
(792, 'Bakugan', 0, '2011-06-10 07:40:00', '2011-06-10 08:05:00', '..', 0, '', 1, 0, 0, 8, 1),
(793, 'Bumba', 0, '2011-06-10 08:05:00', '2011-06-10 08:20:00', '.Bumba razmišlja kako bi bilo lijepo da postoji stroj koji radi igračke. Bumba odluči napraviti magičan stroj koji će raditi igračke. \n Bumba i Bumbalu odluče opet skladati glazbu. Bumba i Bumbalu se odluče da će upotrijebiti koturaljke da proizvedu glazbu..', 0, '', 1, 0, 0, 8, 1),
(794, 'Roary', 0, '2011-06-10 08:20:00', '2011-06-10 08:35:00', '.Majstor  Niko zadužen je za trkalište i mora paziti na Roaryja i Cici. No izgleda da Majstor Niko ne mora paziti na Roarya i Cicija nego bi se oni trebali zabrinuti za njega..', 0, '', 1, 0, 0, 8, 1),
(795, 'Tomica i prijatelji', 0, '2011-06-10 08:35:00', '2011-06-10 09:15:00', '.Na otok je stigla nova dizalica Igor. Igor nema motor i ne može se samostalno kretati. Edo ne uvažava Igora zato što ga smatra besmislenom novotarijom. Kad je Edo uzrokovao rasipanje telegrafskih stupova po tračnicama, nazvao je Janka, manju dizalicu. Ali Janko nije stigao dovoljno brzo, pa se Gordan punom brzinom zaletio u stupove. Janko ne može podignuti Gordana i Edo shvati da je samo Igor dovoljno velik da bi mogao pomoći. Edo nakon svega shvati da je Igor koristan i ponosan je što može bit', 0, '', 1, 0, 0, 8, 1),
(796, 'Pobjeda ljubavi', 0, '2011-06-10 09:15:00', '2011-06-10 11:15:00', '..', 0, '', 1, 0, 0, 8, 1),
