(800, 'Pobjeda ljubavi', 0, '2011-06-10 13:00:00', '2011-06-10 14:00:00', '.Pedro kaže Victoriji da Osvaldo ima snimanje na plaži i da će ondje provesti cijeli vikend te nadoda da joj se na telefon vjerojatno javila šminkerica. Pedro kaže Guillermu da je mogao izazvati probleme Osvaldu i da mu se katkad čini da upravo to i želi. Licemjerni Guillermo uvjeri ga da mu je Osvaldo najbolji prijatelj, a Pedro odvrati da mu se katkad i ne čini tako. Jimena je zabrinuta zbog trudnoće i zato je čvrsto odlučila pridobiti Maxa da se njome što prije oženi. Victoria je ustrajna u s', 0, '', 1, 0, 0, 8, 1),
(801, 'Pobjeda ljubavi', 0, '2011-06-10 14:00:00', '2011-06-10 15:00:00', '.Fernanda i Federico dožive nesreću, ali, nasreću, izvuku se neozlijeđeni. Oscar kaže Federicu da mu je pozvao taksi, a Fernanda ga upozori da ne komplicira stvari. Linda upita Osvalda zašto mu je Victoria dosadila i je li to zato što više vremena posvećuje poslu nego njemu. Osvaldo odgovori da nije samo zbog toga i da misli da Victoria od njega skriva neku veliku tajnu. Linda mu odgovori da on uskoro neće imati što skrivati, a on joj uzrujano odvrati da ništa ne skriva i da mu prestane to spomi', 0, '', 1, 0, 0, 8, 1),
