(803, 'Masterchef', 0, '2011-06-10 16:00:00', '2011-06-10 17:00:00', '.Očekuje nas još jedan Izazov šefa kuhinje u kojem će po treći put kuhati Robert, ovoga puta protiv Denisa Zembe, najboljeg kuhara u Hrvatskoj, vlasnika restorana Le Mandrač, jednog od najcjenjinijih restorana na Kvarneru. Robertov zadatak bit će replicirati dva jela, glavno jelo pod nazivom ‘Nova fritaja’ i desert. Vidjet ćemo hoće li Robert osvojiti imunitet i tako osigurati svoje mjesto u finalu MasterChefa.', 0, '', 1, 0, 0, 8, 25),
