(806, 'Pod sretnom zvijezdom', 0, '2011-06-10 18:10:00', '2011-06-10 19:05:00', '.Marta kaže Kreši da želi pronaći biološke roditelje. Silvija ne može vjerovati da joj Martin nudi ušteđevinu kako bi ponovno mogla studirati u inozemstvu. Krešo pokušava reći Suzani za Martin plan. Sastanak s Kolarićem i Slavenom prolazi upravo onako kako ga je Ena zamislila. Zora ne može vjerovati da je Marta naumila pronaći roditelje. Beti i Fanika sretne su što će Silvija studirati na Berkleyu. Dina pristane pomoći Ivi u njegovoj odluci da oženi Vesnu. Krešo dolazi kod Beti kako bi joj se po', 0, '', 1, 0, 0, 8, 1),
