(809, 'Asi', 0, '2011-06-10 20:05:00', '2011-06-10 21:00:00', '.Asi pogrešno protumači takvo Demirovo ponašanje. Kap koja prelijeva čašu njegov je odlazak u Istambul, s liječnicom Indži, a da njoj ništa o tome ne kaže. Ona misli da su oni zajedno pobjegli. Asi pita Demira zašto je otišao. Ali Demir okoliša s odgovorom. Asi doživi veliko razočaranje kada vidi kako Demir i Indži odlaze držeći se rukom pod ruku. Posumnja da ju je Demir prevario. Ali ovaj put nije spremna žrtvovati svoju ljubav zbog neprovjerenih sumnji i odluči to provjeriti. S druge strane i ', 0, '', 1, 0, 0, 8, 1),
(810, 'Masterchef', 0, '2011-06-10 21:00:00', '2011-06-10 22:40:00', '.Kandidate očekuje posljedjnji Gastro duel, odnosno posljednja borba u crvenim i plavim pregačama i to ovoga puta u hotelu Esplanade. Zadatak će im biti u tri slijeda zadiviti nepca vodećih ljudi tog hotela. Osim što ćemo doznati koji je tim izgubio a koji pobjedio gubitnici će se suočiti s eliminacijskim izazovom. Jedan kandidat napustit će MasterChef, ali to nije sve, MasterChef će time dobiti pet najboljih kuhara amatera, pet finalista.', 0, '', 1, 0, 0, 8, 25),
(811, '15 MINUTA, igrani film', 0, '2011-06-10 22:40:00', '2011-06-11 00:50:00', '.Kada istočnoevropski kriminalci Oleg (Oleg Taktarov) i Emil (Karel Roden) dođu u New York kako bi preuzeli svoj dio obavljene pljačke, Oleg ukrade videokameru i počinje snimati njihove aktivnosti, kako legalne tako i ilegalne. Shvativši kako američki medijski cirkus čak i kriminalce može prikazati kao žrtve, Oleg i Emil počinju pratiti istražitelje Eddieja Flemminga (Robert De Niro) i Jordyja Warsawa (Edward Burns) te ih snime za vrijeme agresivnog ispitivanja njihovog bivšeg partnera u zločinu', 0, '', 1, 0, 0, 8, 3),
(812, 'NAPAD MORSKOG PSA, akcijski film', 0, '2011-06-11 00:50:00', '2011-06-11 02:40:00', '.Prije 24 milijuna godina, Megalodon je bio ubojica od dvadeset tona. Kada dva istražitelja otkriju golemi zub morskog psa, najgore slutnje pokažu se točnima: najopasnija zvijer koja je ikada postojala u morima još je živa i hrani se svime što joj se nađe na putu.', 0, '', 1, 0, 0, 8, 3),
(813, 'Ezo TV', 0, '2011-06-11 02:40:00', '2011-06-11 04:10:00', '..', 0, '', 1, 0, 0, 8, 21),
(814, 'Paklena vožnja, igrani film', 0, '2011-06-11 04:10:00', '2011-06-11 05:35:00', '.Pistolero, glavešina bande ozloglašenih bajkera pod imenom Victors sprema osvetu za ubojstvo njihova člana a koje je skrivila supranička banda pod imenom 666. Zajedno sa svojim suborcima Gentom i Comancheom, Pistolero želi poraziti Deucea i Billy Wingsa, nadmene vođe 666-ice, no duhovi prošlosti uplest će se u ostvarenju opake misije...', 0, '', 1, 0, 0, 8, 3),
(815, 'Domovina terora', 0, '2011-06-11 05:35:00', '2011-06-11 07:10:00', '.Južnoafrička vlada je 1996. godine osnovala Povjerenstvo istine i pomirenja kako bi se istražile povrede ljudskih prava pod apartheidom. Ta saslušanja poslužila bi kao forum da bi se optuženi za ubojstva i mučenja suočili sa svojim žrtvama i da bi, priznajući svoju krivicu, bili amnestirali prema Ubuntu narodnom običaju oprosta. Langston Whitfield (Samuel L. Jackson)  je novinar Washington Posta.  Njegov ga urednik pošalje u Južnu Afriku da poprati rad Povjerenstva… Langston počinje otkrivati k', 0, '', 1, 0, 0, 8, 3),
(816, 'Neustrašivi Scooby doo', 0, '2011-06-11 07:35:00', '2011-06-11 08:00:00', '.Nakon tragične smrti 8-godišnjeg Brendana Caffeyja uslijed napada psa, posvojitelji Tom i Joyce Burke žele da se njegovu ocu Louu, ovisniku i dijabetičaru, oduzmu roditeljska prava. Nick (Simon Baker) počne pripremati dokumente za sudski proces i shvati da dječak možda i nije sam skrivio svoju smrt, nego da su je možda izazvali posvojitelji..', 0, '', 1, 0, 0, 8, 1),
(817, 'Fifi i cvjetno društvo', 0, '2011-06-11 08:00:00', '2011-06-11 08:15:00', '.Fifi je krenula prema kući Zlatke i Latice, a poslije ide po livadi tražiti cvijeće. Pahulja nije mirna, a teta Tuli je kupa. Zlatka i Latica još nisu spremne. Pahulja pobjegne iz kade.  Zlatka i Latica se igraju princeze i hrabrog viteza..', 0, '', 1, 0, 0, 8, 1),
(818, 'Timmy Time', 0, '2011-06-11 08:15:00', '2011-06-11 08:30:00', '.Vrijeme je za veliko proljetno čišćenje vrtića, ali Timmy samo želi izaći van i igrati se. Svojom žurbom je napravio još više nereda I time se samo doveo u neprilku, te je završio na Mjestu za neposlušne. Timmy je tako naučio da mora ispravno napraviti posao a onda se pridružiti ostalima u igri..', 0, '', 1, 0, 0, 8, 1),
(819, 'Peppa', 0, '2011-06-11 08:30:00', '2011-06-11 08:45:00', '.Kompost – Pepa i George su kod djeda i bake. Pomažu djedu u vrtu napraviti kompost. Djed ih nauči kako razvrstati pojedini otpad da bi kompost bio bolji i kako uopće nastaje kompost.\nZečić Robert se došao igrati – Robert i George su najbolji prijatelji. Robert se došao igrati k Georgeu. To se ne sviđa Pepi jer su glasni i smetaju joj. Ona pozove prijateljicu Suzi da se dođe igrati pa njih dvije pokušaju smiriti Georgea i Roberta. Na kraju pronađu igru u kojoj svi uživaju..', 0, '', 1, 0, 0, 8, 1),
(820, 'Bakugan II - New Vestroia', 0, '2011-06-11 08:45:00', '2011-06-11 09:10:00', '..', 0, '', 1, 0, 0, 8, 1),
(821, 'Chuggington', 0, '2011-06-11 09:10:00', '2011-06-11 09:25:00', '.Grga želi biti neovisan, no Edo mu nikada ne dozvoljava da napravi posao po svom. Tada Grga odluči stvari preuzeti u svoje ruke. No nešto poče oo zlu. Sada Grga i Vili moraju popraviti kutije kako Edo ne bi doznao..', 0, '', 1, 0, 0, 8, 1),
(822, 'Beyblade metal fusion', 0, '2011-06-11 09:25:00', '2011-06-11 09:50:00', '.Kyoya je nesretan jer mu nijedan protivnik ne predstavlja pravi izazov. Pobjeđuje ih jednoga za drugim, uključujući i čitave skupine odjednom. Dosadno mu je dok ne sretne Tobija, poznatijeg pod imenom Kapetan Capri. Samodopadni Tobio proračunava svaki potez tako da izgleda neočekivano, a to divljem Kyoyi pruža zanimljivu borbu. Na turniru u Prince Toweru njih dvojica završavaju u finalnoj borbi i čini se da je Kyoya gotovo poražen. No budući da se Tobio pravio važan sa svim svojim trikovima, Ky', 0, '', 1, 0, 0, 8, 1),
(823, 'Winx', 0, '2011-06-11 09:50:00', '2011-06-11 10:15:00', '.Majstori magije će u Crvenoj Fontani pokazati svoje vještine. Blum će doći gledati Brendona, ali će saznati za tajanstvenu i prelijepu djevojku Diaspro. Trix nisu uspjele namamiti Blum da dođe u dvorac, pa su odlučile poslati zlo stvorenje koje napada žrtve hraneći se njihovim strahovima. Ovaj put Winx su uz pomoć ravnateljice Faragonde uspjele pobijediti to zlo stvorenje..', 0, '', 1, 0, 0, 8, 1),
