(825, 'Frikovi', 0, '2011-06-11 11:15:00', '2011-06-11 12:15:00', '.Dok su na odmoru u Kanadi, Shawn i Gus nalaze međunarodnog kradljivca umjetnina.\nShawn i Gus na skijalištima su u Whistleru u Britanskoj Kolumbiji kad Shawn vidi traženoga međunarodnog kradljivca umjetnina Pierrea Despereauxa. Despereaux je toliko dobar da nikada nije ostavio dovoljno dokaza da bi ga optužili pa ubrzo šmugne Shawnu i Gusu. Shawn se za pomoć obraća kanadskoj konjičkoj policiji koju ne treba mnogo uvjeravati u svoje vidovnjačke sposobnosti. Zamjenik načelnika Dykstra zove Lassite', 0, '', 1, 0, 0, 8, 1),
(826, 'Smallville', 0, '2011-06-11 12:15:00', '2011-06-11 13:15:00', '.Osma sezona događa se nekoliko tjedana nakon eksplozije ledene tvrđave. Lexov tim pokušava naći svoga šefa. Liga pravde pod vodstvom Greena Arrowa (Justin Hartley) dolazi spasiti Clarka koji je nestao nakon urušavanja tvrđave. Trojac se suprostavlja novoj direktorici LuthorCorpa, Tessi Mercer (Cassidy Freeman). U međuvremenu, Chloe je zatočila sumnjiva skupina koja je saznala za njezine sposobnosti. \nClarkov je prvi radni dan u Daily Planetu s Lois. Moraju napisati članak o autobusu koji je eks', 0, '', 1, 0, 0, 8, 1),
(827, 'Domovina terora', 0, '2011-06-11 13:15:00', '2011-06-11 15:10:00', '.Južnoafrička vlada je 1996. godine osnovala Povjerenstvo istine i pomirenja kako bi se istražile povrede ljudskih prava pod apartheidom. Ta saslušanja poslužila bi kao forum da bi se optuženi za ubojstva i mučenja suočili sa svojim žrtvama i da bi, priznajući svoju krivicu, bili amnestirali prema Ubuntu narodnom običaju oprosta. Langston Whitfield (Samuel L. Jackson)  je novinar Washington Posta.  Njegov ga urednik pošalje u Južnu Afriku da poprati rad Povjerenstva… Langston počinje otkrivati k', 0, '', 1, 0, 0, 8, 3),
(828, 'Prazne priče', 0, '2011-06-11 15:10:00', '2011-06-11 17:00:00', '.Dokes (Kirby)  upravo je izašao iz zatvora i sada kao bivši kažnjenik putuje kući te je zaprepašten kada vidi koliko je napredak promijenio seoski krajolik njegove mladosti. Tražeći mjesto na kojem će se skriti, Ray se uputi na farmu svoga dobrog prijatelja Petea Culpeppera (Keith Carradine). Farmer koji se guši u dugovima pravi je teksaski kauboj čiji je kukuruz odlučio da ove sezone neće narasti.Ray najprije želi posjetiti svoju staru ljubav, Ettu (Lisa Ray), ali stvari su se zakomplicirale o', 0, '', 1, 0, 0, 8, 3),
