(830, 'Provjereno', 0, '2011-06-11 17:10:00', '2011-06-11 18:05:00', '.Zašto su proljetne oluje nepredvidive više nego ikada do sada te koliko opasne mogu biti provjerila je ekipa informativnog magazina. \nEkipa Provjerenog istražila je što uzrokuje prolom oblaka i olujno nevrijeme usred sunčanog dana. Provjerili su načine kako se zaštititi od sijevanja munja  te razgovarali s ljudima koji  su preživjeli njen udar.', 0, '', 1, 0, 0, 8, 25),
