(833, 'Razbijač 2: Naplata', 0, '2011-06-11 20:05:00', '2011-06-11 21:50:00', '.Nick Prescott (Kevin Sorbo) je sin gradskog šerifa koji se vraća u svoj rodni grad. Kada sazna da je njegov mirni gradić postao leglo kriminalaca, droge i nasilja, Nick odluči tome stati na kraj. U nekad mirnom gradiću sada vlada grupa beskrupuloznih kriminalaca koji siju teror po ulicama Nickovog rodnog mjesta. Da bi situacija bila gora kriminalci imaju podršku i korumpiranog lokalnog policajca koji im pomaže u njihovim ilegalnim poslovima. Kada Nickov otac želi uvesti pravdu biva brutalno ubi', 0, '', 1, 0, 0, 8, 3),
(834, '300', 0, '2011-06-11 21:50:00', '2011-06-12 00:05:00', '.U ovom realističnom prikazu bitke kod Termopila, prema epskom stripu tvorca Sin Cityja, Franka Millera, perzijski kralj Kserkso (Rodrigo Santoro) okupi vojsku od stotina tisuća vojnika, koju je dovukao iz Azije i Afrike, da bi 481. godine pr. K. napao i osvojio malen i podijeljen grčki narod. Međutim, kad perzijska sila prodre u opasan planinski tjesnac Termopile, naleti na spartanskoga kralja Leonidu (Gerard Butler) i njegovu kraljevsku gardu od samo 300 vojnika. Prema legendi, njihova je hrab', 0, '', 1, 0, 0, 8, 3),
(835, 'Zaštitnik', 0, '2011-06-12 00:05:00', '2011-06-12 01:50:00', '.Billy Wong njujorški je policajac čiji partner nastrada za vrijeme pljačke. Billy i njegov novi partner Danny Garoni rade kao zaštitari na modnoj reviji na kojoj dođe do otmice Laure Shapiro, kćeri bogataša. FBI smatra da je Laurin otac povezan s gospodinom Koom, hongkonškim narkobosom pa načelnik njujorške policije šalje dvojicu detektiva da istraže slučaj. Par u Hong Kongu uzrokuje mnoge nevolje gospodinu Kou i lokalnim vlastima.', 0, '', 1, 0, 0, 8, 3),
