(841, 'Fifi i cvjetno društvo', 0, '2011-06-12 07:40:00', '2011-06-12 07:55:00', '.Fifi čeka da dođu Pip, Zlatka i Latica te će im ispričati priču o tri mala praščića. Fifi jedva čeka da započne priču. Zlatka i Latica se skrivaju u svom tajnom mjestu. Pip traži Zlatku i Laticu te ga zanima gdje su. Pip kaže kako ih Fifi već čeka..', 0, '', 1, 0, 0, 8, 1),
(842, 'Timmy Time', 0, '2011-06-12 07:55:00', '2011-06-12 08:10:00', '.Nakon igre s loptom, prljavi Timmy je odlučio da se ne želi oprati i pokuša izbjeći pranje na bilo koji način. Nije ga briga što njegova prljavština smeta prijatelje, sve dok se njegov dragi medno također ne uprlja – a onda Timmy mora priznati da biti čist i nije tako loše..', 0, '', 1, 0, 0, 8, 1),
(843, 'Peppa', 0, '2011-06-12 08:10:00', '2011-06-12 08:25:00', '.Zabavna utrka – Gospođa Gizela organizira utrku u kojoj će se skupljati dobrotvorni prilozi za obnovu školskog krova. Tata će trčati kako bi pomogao dobrotvornu akciju. Hoće li uspjeti izdržati cijelu utrku kako bi se skupio novac za obnovu školskog krova?\nPranje – Tata povremeno s prijateljima igra nogomet. Svi u ekipi imaju majice bijele boje. Ali što se dogodi kad mama stavi prati bijelu majicu zajedno s Pepinom crvenom haljinom?.', 0, '', 1, 0, 0, 8, 1),
