(845, 'Chuggington', 0, '2011-06-12 08:50:00', '2011-06-12 09:05:00', '.Vili pomaže kornetiju da napravi novo jelo za banket. No nakon što naprave otkriju kako je gradonačelnikova supruga alergična na sir koji su oni stavili u jelo. Korneti sada mora izmisliti novo jelo i to do navečer..', 0, '', 1, 0, 0, 8, 1),
(846, 'Beyblade metal fusion', 0, '2011-06-12 09:05:00', '2011-06-12 09:30:00', '.Doji i Yu u potrazi su za talentima koji će nastupati na Borbi blejdera, kako bi Ryuga kasnije mogao apsorbirati njihovu moć. Zadivi ih Tsubasa koji na turniru pobjeđuje njihova blejdera, no ne mogu pronaći nikakve informacije o tome tko je on zaista. Na njihovo iznenađenje, Tsubasa se pojavljuje u sjedištu Dark Nebule i želi prodati svoju vještinu..', 0, '', 1, 0, 0, 8, 1),
(847, 'Winx', 0, '2011-06-12 09:30:00', '2011-06-12 09:55:00', '.Blum je odlučila otići kući. Više ne želi imati nikakve veze s magijom. Ni Gardenija više nije sigurno mjesto, jer se Trix odlučuju za napad riskirajući živote Bloominih roditelja. Blumima prošlost postaje sve jasnija. Teško joj je što se udaljava od Brendona, a još joj teže pada to što je tajanstvena djevojka umiješana u sve to. Blum otkriva da je Brendon u stvari Princ od Erakliona. Otkrila je da jedina sigurna stvar u njezinom životu nije sigurna..', 0, '', 1, 0, 0, 8, 1),
