(850, 'Čarobnice', 0, '2011-06-12 11:25:00', '2011-06-12 12:25:00', '.Piper (Holly Marie Combs) i Leo (Brian Krause) uz pomoć Coopova prstena putuju kroz vrijeme da bi izmijenili događaje koji su doveli do smrti Piperinih sestara i uništenja kuće. U međuvremenu, Billie koristi moć zaštite da bi učinila isto i napokon saznaje u što se pretvorila njezina sestra. Mnogo poznatih likova dolazi pomoći Piper kad joj je najpotrebnije.', 0, '', 1, 0, 0, 8, 1),
(851, 'Dodir s neba', 0, '2011-06-12 12:25:00', '2011-06-12 13:25:00', '.Joan Girardi je šesnaestogodišnja djevojka kojoj jednog dana prilazi netko tvrdeći za sebe da je Bog.  Joan počinje slijediti njegove tajnovite naputke i nastaviti život kao da se ništa nije dogodilo iako joj nitko u njezinoj obitelji ne vjeruje. Njezin otac, Will Girardi postaje novi šef policije u gradiću Arcadia te pokušava riješiti slučaj serijskog ubojice. Nakon pronalaska tijela dviju mrtvih maloljetnica, Will uviđa kako kćerkine tvrdnje o nepoznatoj osobi koja se mota oko kuće nisu posve', 0, '', 1, 0, 0, 8, 1),
(852, 'Elvis ni(je) tu', 0, '2011-06-12 13:25:00', '2011-06-12 15:10:00', '.Harmony Jones (Kim Basinger) je lijepa i uspješna žena koja radi za Pink Lady Cosmetics, koja osjeća da je cijeli život povezana s Kraljem. Elvis je nastupio iste večeri u emisiji da Sullivana kad se Harmony rodila, i čak je i odrasla u istom gradu kao i on. Nije mogla ni pomisliti da će se njihova povezanost pokazati smrtonosnom. Dok putuje u svom ružičastom Cadillac kabrioletu izvodeći prezentacije za Pink Lady usput upoznaje i čovjeka svog života, marketing menadžera Milesa Taylora (John Cor', 0, '', 1, 0, 0, 8, 3),
(853, 'FLIPPER, avantura', 0, '2011-06-12 15:10:00', '2011-06-12 17:00:00', '.Elijah Wood i Paul Hogan u ovom će nas dirljivom filmu o prijateljstvu dječaka i dupina još jednom podsjetiti kako su ljubav i odanost najvažnije stvari u životu, bez kojih ne mogu opstati ni ljudi ni životinje.\n\n        Buntovni četrnaestogodišnjak Sandy (Elijah Wood) teško se nosi s razvodom svojih roditelja. Nadajući se da će mu promjena boravka pomoći, roditelji ga pošalju preko ljeta na otok Coral Key, na Floridu, kod ujaka Portera (Paul Hogan), ostarjelog hipija. Međutim, dječaku izgleda ', 0, '', 1, 0, 0, 8, 3),
(854, 'Vijesti', 0, '2011-06-12 17:00:00', '2011-06-12 17:10:00', '..', 0, '', 1, 0, 0, 8, 18),
(855, 'Masterchef', 0, '2011-06-12 17:10:00', '2011-06-12 19:05:00', '.Kandidate očekuje posljedjnji Gastro duel, odnosno posljednja borba u crvenim i plavim pregačama i to ovoga puta u hotelu Esplanade. Zadatak će im biti u tri slijeda zadiviti nepca vodećih ljudi tog hotela. Osim što ćemo doznati koji je tim izgubio a koji pobjedio gubitnici će se suočiti s eliminacijskim izazovom. Jedan kandidat napustit će MasterChef, ali to nije sve, MasterChef će time dobiti pet najboljih kuhara amatera, pet finalista.', 0, '', 1, 0, 0, 8, 25),
