(858, 'Nad lipom 35', 0, '2011-06-12 20:05:00', '2011-06-12 21:15:00', '.Gosti lokala i gledatelji humoristično-glazbenog showa ove nedjelje uživat će osim u humoru svih prisutnih, slušajući hitove Jasmina Stavrosa, Maje Šuput i Damira Kedže. Na bini će im se pridružiti i Mario Lipovšek Battifiaca.\nDoktorica Anđa ima problema s pacijentima, ali i s radijatorom. Jedan pacijent od prehlade napravit će čitavu dramu te stalno ispitivati doktoricu o bolestima koje bi mogao imati. Srećko će pokušati popraviti radijator i barem malo oraspoložiti zaposlenu doktoricu. Barmen', 0, '', 1, 0, 0, 8, 25),
(859, 'Tarzan, čovjek majmun', 0, '2011-06-12 21:15:00', '2011-06-12 23:20:00', '.Jim Parker (Richard Harris), njegova prelijepa kći Jane (Bo Derke) i safari-fotograf Holt (John Phillip Law ) kreću na ekspediciju u afričku divljinu u potragu za grobljem slonova. Umjesto groblja, nalaze Tarzana (Miles O''Keeffe), čovjeka majmuna. Dok se Jane kupa, Tarzan je otme. Jim zaprijeti kralju džungle, no Tarzan vraća Jane neozlijeđenu i jako zaljubljenu u njega. Nakon toga članove ekspedicije uhvate čuvari groblja slonova. Tarzan spašava Jane od okrutnog poglavice, ali pleme ubije njez', 0, '', 1, 0, 0, 8, 3),
(860, 'Red Carpet', 0, '2011-06-12 23:20:00', '2011-06-13 00:45:00', '..', 0, '', 1, 0, 0, 8, 25),
(861, 'Razbijač 2: Naplata', 0, '2011-06-13 00:45:00', '2011-06-13 02:30:00', '.Nick Prescott (Kevin Sorbo) je sin gradskog šerifa koji se vraća u svoj rodni grad. Kada sazna da je njegov mirni gradić postao leglo kriminalaca, droge i nasilja, Nick odluči tome stati na kraj. U nekad mirnom gradiću sada vlada grupa beskrupuloznih kriminalaca koji siju teror po ulicama Nickovog rodnog mjesta. Da bi situacija bila gora kriminalci imaju podršku i korumpiranog lokalnog policajca koji im pomaže u njihovim ilegalnim poslovima. Kada Nickov otac želi uvesti pravdu biva brutalno ubi', 0, '', 1, 0, 0, 8, 3),
(862, 'Svi mrze Chrisa', 0, '2011-06-13 02:30:00', '2011-06-13 03:00:00', '.Chris (Tyler James Williams) odbija obavljati kućanske poslove kako bi se usprotivio strogim pravilima svoje majke, a Rochelle se zbog toga žali Juliusu da je njezin sin ne poštuje. U međuvremenu, gospodin Omar odlučio je svima reći što misli jer je uvjeren da umire..', 0, '', 1, 0, 0, 8, 1),
(863, 'Njeno pravo', 0, '2011-06-13 03:00:00', '2011-06-13 03:55:00', '.Dok radi na oslobađaju optužene pljačkašice banke Annabeth Mills, Elizabeth nije svjesna da je državni tužilac Zach Williams pokušava optužiti za utjecanje na porotu u slučaju Ethana Fostera. Frank je pokušava upozoriti, ali ona mu odbija uzvratiti pozive pa ni ne sluti kakvu optužbu Williams sprema.  Ali kada je Frank uspije pronaći i osobno joj javiti vijesti, Elizabeth se zabrine saznavši da se Williams okomio na porotnika od kojeg je privatni istražitelj tražio povjerljive informacije koje ', 0, '', 1, 0, 0, 8, 1),
(864, 'Njeno pravo', 0, '2011-06-13 03:55:00', '2011-06-13 04:45:00', '.Suočena s vlastitom noćnom morom nakon uhićenja zbog utjecanja na porotu, Elizabeth mora ostati pribrana zbog svojih novih klijenata, Linde Matthews i Isabelle Shapir, 16-godišnjih najboljih prijateljica optuženih za planiranje ubojstva svoje školske kolegice Caroline Parsons. Iako zabrinuta zbog arogantnog ponašanja djevojaka i njihova popisa „Ljudi koje želimo mrtve“, Elizabeth je uvjerena da nema čvrstih dokaza koji ih povezuju s Caroline koju je ubio James Moffit, njihov društveno neprilago', 0, '', 1, 0, 0, 8, 1),
