(866, 'Naši najbolji dani', 0, '2011-06-13 06:00:00', '2011-06-13 06:50:00', '.Užurbani je dan u reklamnoj agenciji jer Tony radi s Ethanom i Morgan. Anna uđe i pokuša preoteti Ethana da radi za nju. Ali Ethanova je plaća previsoka. A Morgan? U tom je pokušaju spriječi Tony. Anna je izvan sebe jer treba pomoć. Njih dvoje nastavljaju svoje male igre sve dok ne završe na Tonyjevu stolu u ljubavnom zagrljaju. Chelsea je u svojoj sobi poslije operacije. Kate je uz nju. Chelsea pita za tatu i kaže Kate da se ide doma odmoriti. Daniel uđe i kaže da je i Bo u svojoj sobi. Sad če', 0, '', 1, 0, 0, 8, 1),
