(869, 'Bumba', 0, '2011-06-13 07:40:00', '2011-06-13 07:55:00', '.Majmun Poppa odluči imitirati Bumbu. To sve jako razveseli zato se majmun i bumba počnu odlično zabavljati.  \n\nPoppa ima zanimljiv bumerang u obliku banane. Majmun tako uspije napraviti zanimljiv trik te tako prevari Bumbu. Bumba i majmun se počnu smijati.', 0, '', 1, 0, 0, 8, 1),
