(871, 'Tomica i prijatelji', 0, '2011-06-13 08:10:00', '2011-06-13 08:50:00', '.Na otok je stigla nova dizalica Igor. Igor nema motor i ne može se samostalno kretati. Edo ne uvažava Igora zato što ga smatra besmislenom novotarijom. Kad je Edo uzrokovao rasipanje telegrafskih stupova po tračnicama, nazvao je Janka, manju dizalicu. Ali Janko nije stigao dovoljno brzo, pa se Gordan punom brzinom zaletio u stupove. Janko ne može podignuti Gordana i Edo shvati da je samo Igor dovoljno velik da bi mogao pomoći. Edo nakon svega shvati da je Igor koristan i ponosan je što može bit', 0, '', 1, 0, 0, 8, 1),
