(873, 'Čuvar pravde', 0, '2011-06-13 10:45:00', '2011-06-13 11:40:00', '.Lulu (Wendy Moniz)  rješava još jedno posvojenje za Saru, cimericu s fakulteta i njezina muža Roberta kada sazna da je jedna od Twainovih kćeri pronađena ubijena u parku blizu njihova doma. Lulu pokušava sakriti Robertu detalje istrage, a Nick nevoljko pristane pomoći Hughu Williamsu, 33-godišnjem mentalno retardiranom bivšem prijatelju iz djetinjstva koji tvrdi da treba odvjetnika. Hughov pas je ugrizao policajca i smješten je u šinteraj, a Nick ga pokušava izbaviti..', 0, '', 1, 0, 0, 8, 1),
