(876, 'Pobjeda ljubavi', 0, '2011-06-13 12:30:00', '2011-06-13 13:30:00', '.Antonieta kaže Pipinu da je Victoria imala kćer prije nego što se udala i da ju je izgubila.  Nadoda da ju je uspjela pronaći, ali da je problem u tome što ona živi s Bernardom jer joj je otac Juan Pablo. Victoria bijesno prekori Mariju Desamparadu jer je poljubila Maxa u javnosti. Ponizi je i upozori da će se Max vjenčati s Jimenom. Optuži je da je od početka pokušavala zavesti njezina muža koji je nije doživljavao jer je vjeran i da je onda odlučila zavesti Maxa. Maria Desamparada odgovori jo', 0, '', 1, 0, 0, 8, 1),
(877, 'Pobjeda ljubavi', 0, '2011-06-13 13:30:00', '2011-06-13 14:30:00', '.Max upita oca što radi s Lindom. Ona mu odgovori da nije imao šminkericu za snimanje i da joj je ljubazno ponudio da je povede, da zaradi nešto novca. Jimena prizna mami da je trudna i da je zato morala spavati s Maxom. Kaže da će ga za nekoliko dana obavijestiti o trudnoći i da će se onda morati oženiti njome pa će imati sve što zaslužuju. Oscar obavijesti Osvalda i Victoriju da su Fernanda i Federico doživjeli nesreću. Zamoli ih da je ne prekoravaju jer joj je obećao da će se za nju zauzeti. ', 0, '', 1, 0, 0, 8, 1),
