(882, 'Pod sretnom zvijezdom', 0, '2011-06-13 18:10:00', '2011-06-13 19:05:00', '.Svi su osupnuti viješću kako je Vedran herojskim podvigom spasio putnike. Nera pokušava skrenuti pažnju na sebe glumeći da je bolesna. Ena je ljutita na Kolarića jer traži daljnje druženje s njom ne shvaćajući kako ih je uhvatio Vlastin paparazzo. Krešo se brine što će biti s njegovim poslom sada kad je Franck preminuo. Tonka i Nina planiraju veliki doček za Vedrana, a Adam jedva skriva ljubomoru. Ivo je zabrinut za Neru, ali Dina ga uvjerava da ona samo glumi kako bi mu upropastila vjenčanje. ', 0, '', 1, 0, 0, 8, 1),
