(885, 'Kad lišće pada', 0, '2011-06-13 20:05:00', '2011-06-13 21:00:00', '.Gospodin Ali Riza koji je čitav život posvetio odgajanju svoje petero djece na ispravan i moralan način daje ostavku na mjesto poglavara općine kad se od njega traži da zažmiri na nepravdu. Kada mu kći Nedžla biva primljena na sveučilište u Istanbulu, obitelj se odlučuje preseliti onamo..', 0, '', 1, 0, 0, 8, 1),
(886, 'Asi', 0, '2011-06-13 21:00:00', '2011-06-13 22:00:00', '.Defne je uzbuđena zbog ponovnog vjenčanja s Kerimom. Ali on se ne pojavljuje. Zafer je zatočio Kerima i odlučio ga je mučiti dok on ne odustane od Defne. Zafer shvaća da nema više mogućnosti da on bude s Defne i gubi kontrolu nad sobom. Defne i Kerim doživjet će veliku avanturu..', 0, '', 1, 0, 0, 8, 1),
(887, 'Masterchef', 0, '2011-06-13 22:00:00', '2011-06-13 23:20:00', '.Početak je finalnog tjedna, posljednjeg tjedna kojeg će kandidati provesti u Masterchef kuhinji, tjedna u kojem će jedan od njih postati prvi hrvatski Masterchef. Na početku svakog tjedna kandidate je do sada dočekivala Kutija iznenađenja, a ovoga tjedna to neće biti kutija, ali će definitivno biti iznenađenje. Preostalih pet finalista Masterchefa kuhat će za najmilije, za članove svojih obitelji. Uz članove obitelji jela će kao i uvijek kušati žiri. Tri kandidata koja će biti lošija u ovom pos', 0, '', 1, 0, 0, 8, 25),
