(890, 'Smrt u sumrak 1', 0, '2011-06-14 01:40:00', '2011-06-14 03:10:00', '.Ova mini serija je nominirana za Emmy 1996\nBrad (Ken Olin) je šarmantni manipulator i zlostavljač koji je opsjednut sa svojim sinovima. Nakon što njegov brak s  Cheryl (Annette O’Toole) dođe do svog kraja, Brad se mora suočiti s činjenicom da će razvodom njegova supruga dobiti skrbništvo njihova tri dječaka. S obzirom da je Brad opsjednut djecom počinje shvaćati da je jedini izlaz za puno skrbništvo ubojstvo njegove vlastite žene…Nakon ubojstva svoje supruge Brad postane glavni osumnjičeni za C', 0, '', 1, 0, 0, 8, 3),
(891, 'Medij', 0, '2011-06-14 03:10:00', '2011-06-14 04:00:00', '.Zbog svojih zbunjujućih snova Allison (Patricia Arquette) optužuje pogrešnu osobu za ubojstvo, no duh agenta FBI-a, Cooper (Kurtwood Smith), posjećuje je i daje savjete kako da uhvati pravog kriminalca. Allison počne sumnjati u motive agenta Coopera i oklijeva udružiti se s njim kako bi riješili više ubojstava. U međuvremenu, Joe (Jake Weber) zapošljava čovjeka čiji životopis ne zadovoljava kriterije..', 0, '', 1, 0, 0, 8, 1),
