(901, 'Tomica i prijatelji', 0, '2011-06-14 08:35:00', '2011-06-14 09:15:00', '.Zima je i Tomica skuplja drvene grede za krov farmera Đure. U luci Tomica i Pero vide kako se djeca igraju velikim balonom u obliku snjegovića. Nalet vjetra zakači balon na Tomičine odbojnike. Balon prati Tomicu diljem cijelog otoka Sodora, ali Tomica ne zna zašto. Bilo gdje da se pojavi, ljudi mu pokušavaju reći za balon, ali Tomica je zabrinut da bi ih slušao. Zbog zabrinutosti ne može ni svoj posao obaviti kako treba i pokupi samo jednu pošiljku drvenih greda za farmera Đuru. Kad Tomica shva', 0, '', 1, 0, 0, 8, 1),
(902, 'Pobjeda ljubavi', 0, '2011-06-14 09:15:00', '2011-06-14 10:15:00', '..', 0, '', 1, 0, 0, 8, 1),
(903, 'Čuvar pravde', 0, '2011-06-14 10:15:00', '2011-06-14 11:10:00', '.Nakon što je predao sve svoje dokumente za skorašnje udruživanje tvrtki Trison Irrigation i American Hydrant, Burton (Dabney Coleman ) je najavio da ide na još jednu operaciju očiju. Međutim, zbog krvarenja u oku koje zakomplicira oporavak, stari Fallin biva osuđen na mirovanje u krevetu pa Nick (Simon Baker) i Jake (Raphael Sbarge) moraju preuzeti slučaj udruživanja tvrtki. U međuvremenu, Jamesu (Charles Malik Whitfield) jave da su mu nećaka Levija prebili članovi bande u domu u kojem odslužuj', 0, '', 1, 0, 0, 8, 1),
