(906, 'Pobjeda ljubavi', 0, '2011-06-14 12:00:00', '2011-06-14 13:00:00', '.Uplakana Maria Desamparada kaže Maxu da ju je uvijek varao i ismijavao njezinu ljubav i da ga ne želi ponovno vidjeti. Max joj kaže da se neće vjenčati s Jimenom jer je ne voli. Kaže da će priznati dijete i dati mu svoje prezime, ali da voli samo nju i da je ne želi izgubiti. Maria mu odvrati da i ona njega voli, ali da neće dopustiti da se njegovo dijete njezinom krivicom rodi bez oca i kaže mu da je sam za to kriv. Max kaže Victoriji da je Maria Desamparada žena njegova života te da sam odluč', 0, '', 1, 0, 0, 8, 1),
(907, 'Pobjeda ljubavi', 0, '2011-06-14 13:00:00', '2011-06-14 14:00:00', '.Victoria upozorava Maríju Desperadu da će je uništiti. Maríja joj odgovara da je se ne boji i da ne odlazi zato što ju je otpustila, nego zato što daje otkaz. Kaže joj da zadrži svoj novac, carstvo i oholost, a da će ona sa sobom odnijeti nešto mnogo vrednije. Antonieta kaže Victoriji da María Desamparada izgleda grozno. Upita je zašto je katkad toliko hladna i nemilosrdna. Victora joj odgovori da se zaklela da će biti takva. Max predbacuje Victoriji što je otpustila Maríju Desamparadu iako zna', 0, '', 1, 0, 0, 8, 1),
