(909, 'Asi', 0, '2011-06-14 15:00:00', '2011-06-14 16:00:00', '.Defne je uzbuđena zbog ponovnog vjenčanja s Kerimom. Ali on se ne pojavljuje. Zafer je zatočio Kerima i odlučio ga je mučiti dok on ne odustane od Defne. Zafer shvaća da nema više mogućnosti da on bude s Defne i gubi kontrolu nad sobom. Defne i Kerim doživjet će veliku avanturu..', 0, '', 1, 0, 0, 8, 1),
(910, 'Masterchef', 0, '2011-06-14 16:00:00', '2011-06-14 17:00:00', '.Početak je finalnog tjedna, posljednjeg tjedna kojeg će kandidati provesti u Masterchef kuhinji, tjedna u kojem će jedan od njih postati prvi hrvatski Masterchef. Na početku svakog tjedna kandidate je do sada dočekivala Kutija iznenađenja, a ovoga tjedna to neće biti kutija, ali će definitivno biti iznenađenje. Preostalih pet finalista Masterchefa kuhat će za najmilije, za članove svojih obitelji. Uz članove obitelji jela će kao i uvijek kušati žiri. Tri kandidata koja će biti lošija u ovom pos', 0, '', 1, 0, 0, 8, 25),
