(913, 'Pod sretnom zvijezdom', 0, '2011-06-14 18:10:00', '2011-06-14 19:05:00', '.Ivo je utučen zbog Silvijinog odlaska u Ameriku. Ena se teško nosi s Kolarićevim željama i Vlastinim ucjenama. Marta se uvrijedi kada joj Dina kaže da mora biti zahvalna Suzani na svemu što joj je pružila. Slaven pokušava dogovoriti večeru s Nerom i Ninom kako bi se njih dvije bolje upoznale. Nina je i dalje zabrinuta zbog Zlatkovih mutnih poslova. Adam ne želi da Tonka ide s njim na sastanak s novom profesoricom. Nera se iznenadi kada ju Milić pita što ona ima protiv Nine Herceg. Zlatko u stra', 0, '', 1, 0, 0, 8, 1),
