(916, 'Kad lišće pada', 0, '2011-06-14 20:05:00', '2011-06-14 21:00:00', '.Preuređenje obiteljske kuće, Lejlin pripremni tečaj za sveučilište, Nedžlina i Ajšeina školarina počinju stanjivati mirovinu gospodina Alija Rize i on ponovno počinje raditi. Kad na novom poslu od njega zatraže da učini iznimku i ne slijedi svoje principe, ponovno daje ostavku. Budući da su uvjeti sada postali još teži, gđa Hajrije ne podupire tu odluku i u kući nastaje nemir. Kad Ševket, koji se vratio iz vojske, počne raditi u banci, teret Alija Rize postaje lakši. No kad Ševket ukrade srce u', 0, '', 1, 0, 0, 8, 1),
(917, 'Asi', 0, '2011-06-14 21:00:00', '2011-06-14 22:00:00', '.Demir se s jedne strane bori s bolešću, a s druge s čežnjom. Započinje terapija i raspravlja se o mogućnosti duge izolacije i razdvojenosti od svih. U neočekivanom trenutku pred njim se stvori Asi. Asi želi da joj objasni zašto je nestao. Demir neće ustuknuti.Asi doznaje da Demir boluje od raka i ona i obitelj počinju borbu kako bi mu pomogli na sve načine..', 0, '', 1, 0, 0, 8, 1),
(918, 'Masterchef', 0, '2011-06-14 22:00:00', '2011-06-14 23:20:00', '.Troje kandidata suočit će sa Stres testom koji će jednoga od njih poslati kući nadomak superfinala. Bit će to dva sata intenzivnog kuhanja koje će im uoči završnice “zapapriti” David Skoko, profesionalni šef kuhinje koji je već gostovao u Masterchefu. Zadatak će im biti replicirati njegovo jelo, odnosno dva jela, a onaj kome to najlošije pođe za rukom napustit će Masterchef. Vidjet ćemo kome će crna pregača uistinu pisati crnu sudbinu i odrediti kraj njegove kulinarske priče.', 0, '', 1, 0, 0, 8, 25),
