(920, 'Nuklearna opasnost, film, akcijski triler / komedija', 0, '2011-06-14 23:40:00', '2011-06-15 01:30:00', '.Na Istoku ništa novo: Jackie Chan ovaj put oduševljava kao honkonška inačica Jamesa Bonda u potrazi za nestalom nuklearnom glavom! Od Hong Konga, preko Ukrajine pa do Australije, našem omiljenom akcijskom junaku nikada ne nedostaje protivnika.\n\n        Chan Ka Kui (Jackie Chan) je honkonški policajac koji se pridružuje snagama CIA-e u Ukrajini. Tragajući za nestalom nuklearnom glavom, Chan otkriva kako se potencijalni kupci smrtonosnog oružja skrivaju u redovima ruske mafije. Stupivši u kontakt', 0, '', 1, 0, 0, 8, 3);
