(1117, 'Zabranjena ljubav, sapunica', 0, '2011-06-09 12:40:00', '2011-06-09 13:10:00', '.Ana se pokuša ispričati Nikoli zbog prizora u kojem ju je zatekao, ali on je odbija čuti. Između Tine i Ane dolazi do sukoba, a svađa se ubrzo pretvara u tučnjavu. Megi još uvijek ne zna da boluje od neizlječive bolesti i da može svaki tren umrijeti. Antun joj poklanja mali dnevnik u koji može ovjekovječiti sve svoje avanture. Luka je utučen - privlači ga Iva, ali ljubavni odnos kosi se s njegovim pozivom svećenika….', 0, '', 1, 0, 0, 10, 1),
(1118, 'Zabranjena ljubav, sapunica', 0, '2011-06-09 13:10:00', '2011-06-09 13:40:00', '.Luka i dalje odolijeva Ivinom šarmu. U trenutku kad ih prekine u razgovoru, Marinko shvaća da se Luka sve teže bori s osjećajima koje gaji prema Ivi. Razočaran u ljubavi, Borna se posvećuje poslu i dogovara u klubu sastanak s Charliejem. Tamo mu za oko zapne predivna plesačica Lea, koja u plesnom zanosu padne ravno u njegovo naručje..', 0, '', 1, 0, 0, 10, 1),
(1119, 'Večera za 5, lifestyle emisija', 0, '2011-06-09 13:40:00', '2011-06-09 14:00:00', '.Nastavlja se kuhanje u dobrotvorne svrhe pod pokroviteljstvom humanitarne udruge „RTL pomaže djeci“. Naša omiljena kulinarska lifestyle emisija ugostila je novih pet poznatih osoba koje će svojim kulinarskim umijećem pomoći izgradnji objekta štićenicima Centra za autizam u Zagrebu. Petar Dragojević, Lana Banely, Natali Dizdar, Aleksandra Grdić i Mario Mlinarić primili su kuhače i noževe u ruke te pokazali što i kako kuhaju. Otkrivamo kako su se zabavljali te tko je najviše, a tko najmanje jeo..', 0, '', 1, 0, 0, 10, 13),
(1120, 'Osveta ljubavi, telenovela', 0, '2011-06-09 14:00:00', '2011-06-09 14:45:00', '.Pepa posjeti Normu želeći je upozoriti na čudne događaje koji se zbivaju na hacijendi Elizondo. Norma potvrdi da Martin i Gabriela nisu u Santa Clari te se počinje brinuti za njih. Kreće na hacijendu u Evinoj pratnji. Fernando se razbjesni kada ne uspije pronaći dragulje koje je Gabriela držala skrivene u sefu. Kada Norma stigne, Fernando zamoli Dinoru da se sakrije u podrum. Norma pronađe Martinova kolica, ali ne i njega..', 0, '', 1, 0, 0, 10, 1),
