(1125, 'Punom parom, kulinarski izazov', 0, '2011-06-09 17:20:00', '2011-06-09 17:50:00', '.Drugi dan je dan zdrave hrane. Osim Marijaninog odojka za glavno jelo, pogledajte kakve pržene afrodizijake priprema teta Margita za toplo predjelo i može li šef Pero, jedini muškarac u kuhinji, odoljeti tom izazovu..', 0, '', 1, 0, 0, 10, 13),
(1126, 'Punom parom, kulinarski izazov', 0, '2011-06-09 17:50:00', '2011-06-09 18:15:00', '.Sredina tjedna je mirna u kuhinji restorana Spoon. Glavni komad, teta Margita danas šarmira salu, a ostala sveženska ekipa u kuhinji pokušava nadomjestiti prazninu. Ili možda uživa u danu slobode?.', 0, '', 1, 0, 0, 10, 13),
(1127, 'Poroci Miamija, kriminalistička serija', 0, '2011-06-09 18:15:00', '2011-06-09 19:00:00', '.Odjel za poroke je prisiljen osloniti se na mutnog kriminalca, koji im pomaže u istrazi vezanoj uz provale i razbojstva vezane uz drogu. On im je jedina veza s brutalnom jamajkanskom bandom koja hara gradom..', 0, '', 1, 0, 0, 10, 1),
(1128, 'Princ iz Bel Aira, humoristična serija', 0, '2011-06-09 19:00:00', '2011-06-09 19:30:00', '.Will i Carlton planiraju večer provesti zabavljajući dvije prekrasne mlade Francuskinje, ali im planove poremeti nenajavljen dolazak Willove tetke Helen, koja je ostavila muža zbog nevjere. Zbog toga Philip i Vivian otkazuju svoje putovanje na jazz festival, pa momci moraju odgoditi susret s Monique i Renee. Međutim, ni iduće večeri ne uspijevaju ostvariti svoje romantične planove jer se u kući pojavi Helenin muž Lester, koji odbija otići dok mu se supruga ne vrati..', 0, '', 1, 0, 0, 10, 1),
(1129, 'Princ iz Bel Aira, humoristična serija', 0, '2011-06-09 19:30:00', '2011-06-09 20:00:00', '.Trinaestogodišnju Ashley sve više nervira što se obitelj prema njoj odnosi kao prema djetetu pa se u potrazi za ljubavnim savjetima obraća Willu. Ashley osjeća uzajamnu seksualnu privlačnost prema svome dečku Kevinu, što Willa prepadne pa zajedno s Carltonom odlazi u ambulantu po odgovore na Ashleyna pitanja..', 0, '', 1, 0, 0, 10, 1),
(1130, 'RAT U KUĆI, humoristična serija', 0, '2011-06-09 20:00:00', '2011-06-09 20:25:00', '.Nakon što dožive prometnu nesreću, Vicky i Dave odluče ponovno razmotriti svoje oporuke i ostale pravne dokumente. Osim toga, zamole Jeffa i Wendy da u slučaju njihove nesposobnosti brinu o njihovoj djeci, ali oni ih odbiju jer su to isto već obećali drugim prijateljima..', 0, '', 1, 0, 0, 10, 1),
(1131, 'Raymond, humoristična serija', 0, '2011-06-09 20:25:00', '2011-06-09 20:50:00', '.Dugoočekivani tjedan kada joj u posjetu stiže majka Lois, Debri se pretvori u razočaranje. Očekivala je da će provesti kvalitetno vrijeme s majkom, no Lois više zanima izložba Renoira i rješavanje križaljki nego njezina kćer i unučad..', 0, '', 1, 0, 0, 10, 1),
(1132, 'Raymond, humoristična serija', 0, '2011-06-09 20:50:00', '2011-06-09 21:15:00', '.Ray kupi kutiju različito obojanih kondoma, a Frank ih zamijeni za čokoladice upakirane u okruglu ambalažu pa ih podijeli djeci za Noć vještica..', 0, '', 1, 0, 0, 10, 1),
(1133, 'Paklena kuhinja, reality show', 0, '2011-06-09 21:15:00', '2011-06-09 22:00:00', '.U večerašnjoj epizodi na redu je najveći restoran u Gordonovoj karijeri, The Granary u ruralnom Hampshiru. Taj restoran bi trebao posluživati šminkersku, modernu britansku kuhinju, no ispada da poslužuju hranu iz svih krajeva svijeta, koja se ne sviđa nikome od potencijalnih gostiju. Restoran radi ogromne gubitke, a Gordonu ne pomaže doslovno nitko, od vlasnika koji ne želi vidjeti uzroke problema, do nadmenog kuhara i bezobraznih pomoćnika. Hoće li ih Gordon dovesti u red ili će restoran nasta', 0, '', 1, 0, 0, 10, 21),
