(1149, 'Zabranjena ljubav, sapunica', 0, '2011-06-10 12:40:00', '2011-06-10 13:10:00', '.Biba se vraća ljuta s fotografiranja za pozivnicu na vjenčanje. Razlog njezinom nezadovoljstvu je Jurino pojavljivanje s lovačkim šeširom. Od svog duhovnog vođe, oca Julijana, Luka traži savjet o svjetovnim osjećajima i strastima. Tada otkrije da postoji i drugačiji način služenja Bogu. Borna shvati da je Lea Charliejeva djevojka….', 0, '', 1, 0, 0, 10, 1),
(1150, 'Zabranjena ljubav, sapunica', 0, '2011-06-10 13:10:00', '2011-06-10 13:35:00', '.Borna predlaže Tini da u videospotu iskoristi ljepotu i umijeće instruktorice plesa Lee..', 0, '', 1, 0, 0, 10, 1),
(1151, 'Večera za 5, lifestyle emisija', 0, '2011-06-10 13:35:00', '2011-06-10 14:00:00', '.Nastavlja se kuhanje u dobrotvorne svrhe pod pokroviteljstvom humanitarne udruge „RTL pomaže djeci“. Naša omiljena kulinarska lifestyle emisija ugostila je novih pet poznatih osoba koje će svojim kulinarskim umijećem pomoći izgradnji objekta štićenicima Centra za autizam u Zagrebu. Petar Dragojević, Lana Banely, Natali Dizdar, Aleksandra Grdić i Mario Mlinarić primili su kuhače i noževe u ruke te pokazali što i kako kuhaju. Otkrivamo kako su se zabavljali te tko je najviše, a tko najmanje jeo..', 0, '', 1, 0, 0, 10, 13),
(1152, 'Osveta ljubavi, telenovela', 0, '2011-06-10 14:00:00', '2011-06-10 14:45:00', '.Norma ispriča sestrama sve što je vidjela na hacijendi. Malcom i Carmela odbijaju priznati da su oni ukrali dragulje. Braća Reyes predbace sestrama Elizondo zbog odlaska na hacijendu, zbog čega se Norma ozbiljno naljuti. U tom trenutku stignu vijesti da su Martin i Hortensia pronađeni. Dinora odluči mučiti Malcoma dok ne otkrije gdje su dragulji..', 0, '', 1, 0, 0, 10, 1),
(1153, 'Osveta ljubavi, telenovela', 0, '2011-06-10 14:45:00', '2011-06-10 15:30:00', '.Malcom vrati dragulje Fernandu. Gabriela je zgrožena saznanjima na što su sve spremni novi radnici. Martin ispriča obitelji sve što mu se dogodilo, na što Oscar i Franco pobjesne, spremni odmah podići tužbu protiv Fernanda. Jimena misli da bi trebali spasiti Gabrielu, ali Norma kaže da je to posao policije. Međutim, Juan sam odlazi na hacijendu. Ruth je sretna zbog ponovnog susreta s Martinom..', 0, '', 1, 0, 0, 10, 1),
(1154, 'Studio 45, talk show', 0, '2011-06-10 15:30:00', '2011-06-10 16:15:00', '..', 0, '', 1, 0, 0, 10, 21),
