(1156, 'Punom parom, kulinarski izazov', 0, '2011-06-10 17:00:00', '2011-06-10 17:30:00', '.Danas je šef kuhinje, Pero, ponovo na meti tete Margite, a Ljiljanino glavno jelo predmet čudnih vještičjih rituala. U međuvremenu, Marina se odmara od ženskih hormona u kuhinji i sva je usredotočena na zadatke u sali. Ili ipak nije?.', 0, '', 1, 0, 0, 10, 13),
(1157, 'Punom parom, kulinarski izazov', 0, '2011-06-10 17:30:00', '2011-06-10 17:55:00', '.Zadni je dan u popularnoj Žlici. Dok se žene u kuhinji muški bore za zadnje bodove, Ivana u sali dere po podiju za ples. Petak je dan za salsu u Spoonu..', 0, '', 1, 0, 0, 10, 13),
