(1159, 'Princ iz Bel Aira, humoristična serija', 0, '2011-06-10 18:40:00', '2011-06-10 19:10:00', '.Nadajući se profitirati korištenjem nezakonite burzovne tajne, Will i Carlton založe Vivianinu dijamantnu narukvicu za 400 dolara kojima kupe nekoliko dionica Westworld Airlinesa. Ali, umjesto da se njena vrijednost poveća, kako se predviđalo, tvrtka odjednom bankrotira pa rođačke dionice postaju bezvrijedne. U očajničkim pokušajima da zarade novac prije nego Vivian primijeti kako joj nedostaje narukvica, rođaci se čak planiraju okušati i kao striperi..', 0, '', 1, 0, 0, 10, 1),
(1160, 'Princ iz Bel Aira, humoristična serija', 0, '2011-06-10 19:10:00', '2011-06-10 19:35:00', '.Nakon ljetnog odmora u rodnoj Philadelphiji, Will se vraća na Beverly Hills kod Banksovih. Odjeven po posljednjoj hip hop modi, Will osramoti Philipa ispred Whiteyja i Norme Komfield, potencijalnih klijenata, te mu ovaj naredi hitnu promjenu stila odijevanja i zabrani mu korištenje pagera kojim se dogovara sa svojim djevojkama. Kada mu se Will usprotivi, Philip ga izbacuje iz kuće!.', 0, '', 1, 0, 0, 10, 1),
(1161, 'RAT U KUĆI, humoristična serija', 0, '2011-06-10 19:35:00', '2011-06-10 20:00:00', '.Nakon što Larry prizna da pati od određene vrste tjeskobe, Dave i Vicky mu daju lijekove. No Larry ih odbije piti, uvjeren kako ga roditelji žele promijeniti. U međuvremenu, Hillary se priprema za maturalnu večeru, a Dave se zabrine, uvjeren da ona želi izgubiti nevinost na zabavi. Vicky sada s kćerkom ima neugodan razgovor o seksu..', 0, '', 1, 0, 0, 10, 1),
(1162, 'Raymond, humoristična serija', 0, '2011-06-10 20:00:00', '2011-06-10 20:25:00', '.Osjećajući se jadno jer živi s roditeljima, Robert konačno skupi hrabrost i odseli se u svoj apartman, koji na koncu nalikuje na onaj u kojem je živio s ocem i majkom..', 0, '', 1, 0, 0, 10, 1),
(1163, 'Raymond, humoristična serija', 0, '2011-06-10 20:25:00', '2011-06-10 20:50:00', '.Andy s ponosom javi Rayu da će poznati spotski časopis Sprts Illustrated objaviti njegov članak. Iako isprva ljubomoran na Andyjev uspjeh, Ray se ohladi kad sazna da je urednik istog časopisa prepravio Andyjev članak u cijelosti..', 0, '', 1, 0, 0, 10, 1),
(1164, 'Chuck, akcijska humoristična serija', 0, '2011-06-10 20:50:00', '2011-06-10 21:35:00', '.Chuck se obratio Orion, čovjeku koji je stvorio Intersect. Počinje imati probleme, jer nije siguran kome bi se trebao javiti za pomoć. U međuvremenu ekipa iz Buy Morea pokušava zaštititi svoju prinovu od ljubomornog odjela u Beverly Hillsu, nisu svjesni da je to Orionovo djelo, namijenjeno Chucku..', 0, '', 1, 0, 0, 10, 1),
(1165, 'Chuck, akcijska humoristična serija', 0, '2011-06-10 21:35:00', '2011-06-10 22:15:00', '.Agentica dolazi ocijeniti Sarahine vještine kao Chuckove šefice, kada general Beckman primijeti da njihov odnos nije baš strogo profesionalan. U svakom slučaju, prisustvo nove agentice uzrokuje komplikacije. U međuvremenu Morgan, Jeff i Lester se pokušavaju uvaliti na momačku večer Kapetana Prekrasnog..', 0, '', 1, 0, 0, 10, 1),
(1166, 'Mjenjačnica, zabavna emisija', 0, '2011-06-10 22:15:00', '2011-06-10 23:05:00', '.Robert Knjaz, kojega javnost uglavnom percipira kao nabildanog i načitanog muškarca, napokon je odlučio pokazati svoje drugo, politički osviješteno i nadasve misaono biće. Stoga je u „Mjenjačnicu“ pozvao čak 10 (slovima: deset) gostiju - članove plesne grupe Hladno pivo te vrijedne pregaoce Specijalne policije Osijek. Kroz ljudskom oku neshvatljivu obuku i ljudskom uhu nedokučivu svirku ovi prvorazredni mladići pokazat će nam da se metroseksualizam ne događa samo drugima..', 0, '', 1, 0, 0, 10, 13),
