(1181, 'Moderna čuda, dokumentarna serija', 0, '2011-06-11 18:15:00', '2011-06-11 19:00:00', '.U svijetu mesoždera, mesar je nezaobilazna karika u prehrambenom lancu, pripremajući sirovo meso u slasne buduće obroke. Pratit ćemo evoluciju toga posla, od nekadašnjih mesara, koji su radili u mesnicama u svakoj ulici, do današnjih mesara koji rade na industrijskim trakama. Zavirit ćemo u pomalo zloglasne čikaške klaonice, u kojima je tehnologija prerade mesa doživjela procvat i postavila temelje za današnju, modernu mesnu industriju. Vidjet ćemo brzinsko trančiranje i tvornicu koja non-stop ', 0, '', 1, 0, 0, 10, 8),
(1182, 'Pocahontas, animirani film', 0, '2011-06-11 19:00:00', '2011-06-11 20:00:00', '.sinkroniziran na hrvatski\nIndijanska princeza Pocahontas živi okružena prekrasnim travnatim dolinama i predivnim planinama Amerike. Ona i njezino pleme žive u sladu s prirodom i uživaju u životu. Jednoga dana na njihove obale doplove brodovi s bijelim doseljenicima i ona upoznaje kapetana Smitha. Naravno, stvari se kompliciraju, ali vremenom oni postaju sve bliskiji i bliskiji. A to je priča koja ne samo da je jedna od najvećih američkih legendi, nego i jedna od najljepših ljubavnih priča ikada', 0, '', 1, 0, 0, 10, 6),
(1183, 'Neobična gozba, gastronomska dokumentarna serija', 0, '2011-06-11 20:00:00', '2011-06-11 20:55:00', '.U ovoj epizodi Heston Blumenthal priprema blagdanski obrok na temelju bajke braće Grimm. Naravno, to ne znači ništa jednostavnog kao lijepa jabuka koje bismo mogli ponuditi Snjeguljici, niti poseban grah koji bi mogao izrasti u nebesa. Ne, Heston je priredio novu gozbu u kojoj su glavno jelo pijetlovi testisi. Njegovi poznati gosti su ovaj puta bili stvarno na rubu mogu li pojesti njegove pomaknute delicije. No, svakako je čudesno zabavno pogledati kako Hestonovi pripiti gosti jedu Snjeguljicin', 0, '', 1, 0, 0, 10, 8),
(1184, 'Neobična gozba, gastronomska dokumentarna serija', 0, '2011-06-11 20:55:00', '2011-06-11 21:45:00', '.Hestonova je najveća želja da njegova hrana bude "spektakularna pustolovina", ali u ovoj emisiji njegova hrana je više kao zanimljiva spaljena fantazija. U ovoj epizodi on smišlja neobičan jelovnik za posljednji obrok na Titanicu, u počast edwardianskim pustolovima. Nadahnut Scottom, poslužio je, osim jestivog snijega, i hamburger od devetine (s jestivim pijeskom, naravno), sve u čast Lawrencea od Arabije. Je li Hestonova nemoguća hrana uspjela bolje nego poslastice koje su kuhali kuhari na Tit', 0, '', 1, 0, 0, 10, 8),
(1185, 'Festivalac: Plešem u sebi, igrani film, humorna drama', 0, '2011-06-11 21:45:00', '2011-06-11 23:30:00', '.U Dublinu, vječiti pobunjenik Rory O''Shea (James McAvoy) seli u Carrigmoreove stambene kuće za osobe s invaliditetom, i svojom zanimljivom osobnošću utiče na život njihovih stanovnika. Rory je u stanju razumjeti nerazumljiv govor Michaela Connollyja (Steven Robertson), kojeg je prije puno godina u toj instituciji ostavio njegov poznati i utjecajni otac zbog cerebralne paralize. Njih dvojica vrlo brzo postaju bliski prijatelji i krenu planirati nov i zanimljiviji život. Rory nagovara Michaela da', 0, '', 1, 0, 0, 10, 3),
