(1192, 'Columbo: Kandidat za ubojstvo, kriminalistička serija', 0, '2011-06-12 15:00:00', '2011-06-12 16:40:00', '.Za vrijeme svoje senatorske kampanje, Nelson Hayward (Jackie Cooper) od svoga savjetnika Harryja Stonea (Ken Swofford) dobiva savjet da se otarasi ljubavnice. Istovremeno, njih dvojica fabriciraju priču kako nepoznati ljudi političaru prijete oduzimanjem života. Kada Stone bude ubijen, svi pretpostavljaju kako je riječ o potvrdi obznanjenih prijetnji, osim sumnjičavoga Columba..', 0, '', 1, 0, 0, 10, 1),
(1193, 'Neobična gozba, gastronomska dokumentarna serija', 0, '2011-06-12 16:40:00', '2011-06-12 18:15:00', '..', 0, '', 1, 0, 0, 10, 8),
