(1195, 'Putovanje u središte Zemlje, animirani film', 0, '2011-06-12 19:00:00', '2011-06-12 20:00:00', '.U legendarnoj priči Julesa Vernea, profesor Lindenbruck se uputi na ekspediciju u središte Zemlje, u pratnji svoje kćeri Alekse i njenog morskog praščića Herkulesa, koji može govoriti i pjevati. Cijela avantura postaje opasna kada im zli doktor Greed odluči pokvariti planove.  A kako će sve završiti, e, to ćemo tek vidjeti….', 0, '', 1, 0, 0, 10, 6),
(1196, 'Kraljevi leda, dokumentarni', 0, '2011-06-12 20:00:00', '2011-06-12 20:45:00', '.Upoznajte šest kraljeva leda, šest vozača tegljača koji preko ledene ceste vuku opremu i namjernice rudarima u Yellowknife, u Kanadi. Ekipa za izgradnju ceste počinje graditi 350 milja dugu autocestu od leda. Vozači iz cijele Sjeverne Amerike dolaze u kanadsku tundru da bi zaradili brzi novac. Kada je temperatura dovoljna za vožnju, a led po kojemu voze spreman, vozači kreću na neizvjesni put radeći jedan od najopasnijih poslova na svijetu..', 0, '', 1, 0, 0, 10, 8),
(1197, 'Muškarci sa sjekirama, dokumentarni', 0, '2011-06-12 20:45:00', '2011-06-12 21:35:00', '.Dan zahvalnosti je gotov i muškarci sa sjekirama se vraćaju svojim svakodnevnim brigama. Gustafsonov tim se, nakon dvotjedne prisilne stanke, vraća na posao i dobiva rokove koje je nemoguće ispoštovati. Pig Farm sustiže rok, a polovica Pihlovog tima ne radi, ostavljajući žutokljuncu Codiju da se s tim nosi kako zna. Pogreške i nesporazumi u Stump Branchu uzrok su velikih rizika po zaradu, a i živote drvosječa. Jay Browning otkriva zabrinjavajuće podatke vezane uz njegov budući posao..', 0, '', 1, 0, 0, 10, 8),
(1198, 'Trava', 0, '2011-06-12 21:35:00', '2011-06-12 22:10:00', '.Nakon što su joj zaprijetili U-Turn i Armenci, Nancy kreće u potragu za Silasom i njezinom ukradenom travom. U međuvremenu, Celia sredi Silasovo uhićenje zbog krađe njezinih znakova „Zona bez droga“. Nancy ga posjećuje u zatvoru samo da bi otkrila je li trava još u njegovu autu – onim kojim se Celia upravo odvezla..', 0, '', 1, 0, 0, 10, 1),
(1199, 'Trava', 0, '2011-06-12 22:10:00', '2011-06-12 22:40:00', '.Nakon što je izvadila travu koja je plutala u njezinu bazenu, Nancy je panično pokušava vratiti u uporabno stanje. Budući da nije uspjela, odlazi Heyliji obavijestiti je o situaciji. U međuvremenu, Andyjeva potraga se isplatila – policija je locirala Shanea i drži ga u postaji sa Silasom. No Andy uskoro otkriva nenamjerne posljedice svoje potrage. .', 0, '', 1, 0, 0, 10, 1),
(1200, 'Moderna čuda, dokumentarna serija', 0, '2011-06-12 22:40:00', '2011-06-12 23:30:00', '.Od najstarijih poznatih svjetionika, Aleksandrijskog na otoku Pharosu, jednog od sedam čuda antičkog svijeta, do današnjih modernih automatskih svjetionika pogonjenih solarnim ćelijama. Priče o svjetionicima prepune su neobičnih događaja i konstrukcijskih inovacija. Danas, budući da su zamijenjene modernijim i preciznijim sredstvima za navigaciju, te elegantne građevine služe kao slikoviti hoteli, restorani ili pribježišta za robinzonski turizam..', 0, '', 1, 0, 0, 10, 8),
(1201, 'Festivalac: Plešem u sebi, igrani film, humorna drama', 0, '2011-06-12 23:30:00', '2011-06-13 01:30:00', '.U Dublinu, vječiti pobunjenik Rory O''Shea (James McAvoy) seli u Carrigmoreove stambene kuće za osobe s invaliditetom, i svojom zanimljivom osobnošću utiče na život njihovih stanovnika. Rory je u stanju razumjeti nerazumljiv govor Michaela Connollyja (Steven Robertson), kojeg je prije puno godina u toj instituciji ostavio njegov poznati i utjecajni otac zbog cerebralne paralize. Njih dvojica vrlo brzo postaju bliski prijatelji i krenu planirati nov i zanimljiviji život. Rory nagovara Michaela da', 0, '', 1, 0, 0, 10, 3),
