(1208, 'Zabranjena ljubav, sapunica', 0, '2011-06-13 12:30:00', '2011-06-13 13:00:00', '.Baš kad dođe po svoje stvari, Ana sretne Nikolu koji želi znati zašto ga je prevarila. Marinko u Nani primijeti da je odnos između Luke i Petre prisan. Tina je uzbuđena zbog snimanja svog prvog videospota, no šokira je neprofesionalno ponašanje redatelja i producenta. Prekida snimanje i zahtijeva objašnjenje od Borne….', 0, '', 1, 0, 0, 10, 1),
(1209, 'Zabranjena ljubav, sapunica', 0, '2011-06-13 13:00:00', '2011-06-13 13:25:00', '.Tina se sama pozove na večeru kod Barišića i tamo moli Nikolu za oprost. No iza njezinog ponašanja stoji skriveni motiv. Iva ne može sakriti ljubomoru koju osjeti kad ugleda Petru i Luku skupa.  Za vrijeme mirne obiteljske večeri, Iva iznenadi sve prisutne kada napadne Petru zahtijevajući od nje da ostavi Luku na miru. Marijana predloži Bruni raciju u Charliejevom noćnom klubu….', 0, '', 1, 0, 0, 10, 1),
(1210, 'Večera za 5, lifestyle emisija', 0, '2011-06-13 13:25:00', '2011-06-13 13:55:00', '.Nena, Slavonka, majka dvojice sinova, naučila je kuhati od svoje majke, podrijetlom Mađarice. Preferira domaću slavonsku kuhinju, no draga joj je i meksička jer voli začinjeniju hranu. Obožava raditi dizana tijesta, kolače i tjestenine, no nikako ne voli perad. Nena se voli družiti pa često u svojem domu ugošćuje i kuha svojim prijateljima..', 0, '', 1, 0, 0, 10, 13),
(1211, 'Kraljevi leda, dokumentarni', 0, '2011-06-13 13:55:00', '2011-06-13 14:40:00', '..', 0, '', 1, 0, 0, 10, 8),
