(1213, 'Columbo: Kandidat za ubojstvo, kriminalistička serija', 0, '2011-06-13 15:25:00', '2011-06-13 16:35:00', '..', 0, '', 1, 0, 0, 10, 1),
(1214, 'Veseli mladunci, zabavni', 0, '2011-06-13 16:35:00', '2011-06-13 17:20:00', '..', 0, '', 1, 0, 0, 10, 13),
(1215, 'Punom parom, kulinarski izazov', 0, '2011-06-13 17:20:00', '2011-06-13 17:50:00', '.Na samom početku ovotjednog druženja u restoranu Panino riječi dobrodošlice će našim kandidatima uputiti šefovi kuhinje i sale, Tomislav i Maja, nakon čega slijedi odlazak većinskog dijela ekipe na rad u kuhinju i ostanak mlade Ane u sali. Što će se sve dogoditi prvog dana u ovom restoranu, pogledajte u današnjoj emisiji..', 0, '', 1, 0, 0, 10, 13),
(1216, 'Punom parom, kulinarski izazov', 0, '2011-06-13 17:50:00', '2011-06-13 18:15:00', '.Druženje u restoranu Panino se nastavlja, kandidati se već pomalo upoznaju s načinom rada i funkcioniranjem same kuhinje, ali počinju i stvarati mišljenja jedni o drugima. Kakvo ozračje će se stvoriti u kuhinji, odnosno hoće li naši kandidati pokazati međusobne simpatije i kulinarsko umijeće te što će druga ovotjedna kandidatkinja u sali, Ivana, naučiti i demonstrirati, saznat ćete ako pogledate današnju emisiju..', 0, '', 1, 0, 0, 10, 13),
(1217, 'Poroci Miamija, kriminalistička serija', 0, '2011-06-13 18:15:00', '2011-06-13 19:00:00', '.Calderone, vječiti Tubbsov neprijatelj, unajmljuje zloglasnog plaćenog ubojicu, koji treba ukloniti sve njegove neprijatelje. Odjel za poroke saznaje da je i Crockett na ubojičinoj listi za odstrjel..', 0, '', 1, 0, 0, 10, 1),
(1218, 'Princ iz Bel Aira, humoristična serija', 0, '2011-06-13 19:00:00', '2011-06-13 19:25:00', '.Kada njihova stara četvrt bude uništena u uličnim neredima, Philip i Vivian okupe cijelu obitelj te odlaze pomoći stanovnicima da se što prije vrate normalnom životu. Carlton se brzo izgubi u društvu lijepe Simone, dok Will biva optužen za krađu tostera jedne od žrtava, Hectora Alvareza. Ispostavi se, međutim, kako Hector poznaje Banksove iz dječjih dana te se zajedno prisjećaju svoje prošlosti. Nakon sentimentalnog razgovora, Vivian prizna Philipu da je trudna..', 0, '', 1, 0, 0, 10, 1),
(1219, 'Princ iz Bel Aira, humoristična serija', 0, '2011-06-13 19:25:00', '2011-06-13 19:50:00', '.Kada Bel-Air postane spolno miješana škola, Will i Carlton misle kako će im se napokon ostvariti svi snovi. Ashley se, međutim, osjeća zanemareno, pa se idući dan u školi pojavi odjevena u minicu i visoke pete, što odmah privuče pozornost starijih učenika. Willa ljuti takvo ponašanje njegovih kolega te strahuje za svoju mladu sestričnu, istodobno shvaćajući da izgled ne smije biti najvažnija stvar kod procjene djevojaka. Kod kuće, Philip i Vivian šokiraju obitelj objavom njezine trudnoće..', 0, '', 1, 0, 0, 10, 1),
(1220, 'RAT U KUĆI, humoristična serija', 0, '2011-06-13 19:50:00', '2011-06-13 20:15:00', '.Tri su tjedna do kraja školske godine pa Dave i Vicky počnu planirati Hillarynu maturalnu večeru da bi kasnije saznali da ona možda uopće neće maturirati jer je pala tjelesni. Na sreću, Dave uspije uvjeriti ravnatelja da joj da još jednu priliku i ponudi se biti njezin osobni trener. U međuvremenu, iscrpljena zbog manjka spontanosti u svom i Daveovom seksualnom životu, Vicky mu predloži vazektomiju..', 0, '', 1, 0, 0, 10, 1),
(1221, 'Raymond, humoristična serija', 0, '2011-06-13 20:15:00', '2011-06-13 20:45:00', '.Robert i Amy prekinuli su svoju romantičnu vezu, a glavni krivac tome je Ray koji je Robertu napunio glavu svakakvim glupostima vezanim za brak..', 0, '', 1, 0, 0, 10, 1),
(1222, 'Raymond, humoristična serija', 0, '2011-06-13 20:45:00', '2011-06-13 21:10:00', '.Poučeni lošim rezultatima zdravstvenih pregleda, Marie i Frank odlučni su promijeniti svoju, ali i prehranu cijele obitelji. Frank mora započeti s dijetom, a Marie je zbog visoke razine kolesterola bacila svu nezdravu i masnu hranu pa će ovogodišnju puricu za Dan zahvalnosti napraviti od tofua..', 0, '', 1, 0, 0, 10, 1),
(1223, 'Gospodin pravi, dramska serija', 0, '2011-06-13 21:10:00', '2011-06-13 22:00:00', '.Bela ulazi u trag bivšem koji ju je znao dobro nasmijavati i otkriva da se pretvorio u razumnog i odgovornog samohranog oca, koji ju i dalje nasmijava, no nije sigurna je li to dovoljno da se makne njena kletva..', 0, '', 1, 0, 0, 10, 1),
(1224, 'Studio 45, talk show uživo', 0, '2011-06-13 22:00:00', '2011-06-13 22:50:00', '..', 0, '', 1, 0, 0, 10, 21),
(1225, 'Mjenjačnica, zabavna emisija', 0, '2011-06-13 22:50:00', '2011-06-13 23:35:00', '.Karijera Roberta Knjaza ne bi bila tako blistava da od početka nije imao podršku boljih gospođa. Stoga je, u znak pažnje i zahvalnosti, u novoj „Mjenjačnici“ zamijenio dva mladića besprijekornih manira – Edu Maajku, pasioniranog ljubitelja balova i Voju Perića, glumca u kazalištu slijepih i slabovidnih. Deklamiranje stihova i humorističnih zgoda, udaranje po glasoviru i rješavanje zagonetki samo su dio uglađene zabave koja će, vjerujemo, privući pozornost i mlađe publike, one koja karta, galami', 0, '', 1, 0, 0, 10, 13),
