(1239, 'Zabranjena ljubav, sapunica', 0, '2011-06-14 13:10:00', '2011-06-14 13:40:00', '.Prilikom racije u Charliejevom noćnom klubu policajac namjerava uhititi Leu, ali je Borna zaštiti i slaže da mu je djevojka. Nakon što je rekla Petri da se drži podalje od njenog muškarca, Iva se neuspješno pokušava pomiriti s njom. Petra razgovara s Lukom o svađi s Ivom i njezinoj ljubomori. Antun želi prekinuti sve odnose s Tinom..', 0, '', 1, 0, 0, 10, 1),
(1240, 'Zabranjena ljubav, sapunica', 0, '2011-06-14 13:40:00', '2011-06-14 14:05:00', '.Dok se Franjo i Dunja druže, Angelina se osjeća isključenom. Franjo kupi Dunji test za trudnoću, ali ona želi otići na liječnički pregled. No izmišlja isprike i stalno odgađa posjetu doktoru. Jure i Karolina sretnu se u vinariji i odmah se počnu svađati. No kada Karolina dotakne Juru, prepirka prestaje. Jure osjeti ''kemiju'' koja nedostaje u njegovoj vezi s Bibom..', 0, '', 1, 0, 0, 10, 1),
(1241, 'Večera za 5, lifestyle emisija', 0, '2011-06-14 14:05:00', '2011-06-14 14:30:00', '.Željko Radečić, precizni mehaničar iz Zagreba, u kuhinji boravi od malena jer je uvijek pomagao svojoj majci, a danas kuha svojoj obitelji. U kuhinji voli eksperimentirati i uživa pripremati morske plodove. Njegovi specijaliteti su namaz od tune i kravljeg sira, te pohane srdele s parmezanom i likerom Sambucom, a to je odlučio pripremiti i svojim večerašnjim gostima. Osim morskih specijaliteta i hrvatske kuhinje, voli još kinesku i mađarsku, a naročito jela s piletinom i puretinom..', 0, '', 1, 0, 0, 10, 13),
(1242, 'Osveta ljubavi, telenovela', 0, '2011-06-14 14:30:00', '2011-06-14 15:20:00', '.Dinora pokaže svoje pravo lice kada napadne Armanda unatoč svemu što je učinio za nju. Juan traži Gabrielu u podrumu, ali za to vrijeme zlikovci primijete njegovo vozilo. Baš u trenutku kada je pronađe, u podrum uđe Malcom i zaprijeti im pištoljem. Juan ga uspije svladati te zajedno s Gabrielom stigne do automobila, ali im bijeg onemogući naoružani Memo. Braća Reyes dolaze pomoći Juanu, zbog čega nastaje pucnjava..', 0, '', 1, 0, 0, 10, 1),
(1243, 'Gospodin pravi, dramska serija', 0, '2011-06-14 15:20:00', '2011-06-14 16:10:00', '..', 0, '', 1, 0, 0, 10, 1),
(1244, 'Studio 45, talk show', 0, '2011-06-14 16:10:00', '2011-06-14 16:50:00', '..', 0, '', 1, 0, 0, 10, 21),
(1245, 'Divlji boravak, zabavni', 0, '2011-06-14 16:50:00', '2011-06-14 17:30:00', '..', 0, '', 1, 0, 0, 10, 13),
(1246, 'Punom parom, kulinarski izazov', 0, '2011-06-14 17:30:00', '2011-06-14 18:00:00', '.Početak današnjeg dana Lidiji ne obećava odmor i opuštanje jer izgleda da Maja danas ne želi prihvatiti „neuspjeh“ u sali. U kuhinji ćemo uz sveprisutnog Damira naučiti još neke nekonvencionalne metode osvajanja naklonosti gostiju..', 0, '', 1, 0, 0, 10, 13),
(1247, 'Punom parom, kulinarski izazov', 0, '2011-06-14 18:00:00', '2011-06-14 18:30:00', '.Svoj „izlet“ u salu danas će imati Damir, a da sve ne bi ostalo samo na tome, pobrinut će se šefica Maja, koja će za njega osmisliti posebne, „muške“ zadatke. Dok Damir odrađuje svoj posao, ekipa u kuhinji ima više sreće jer je njihov šef uz njih i priskočit će im u pomoć kad god im zatreba..', 0, '', 1, 0, 0, 10, 13),
(1248, 'Poroci Miamija, kriminalistička serija', 0, '2011-06-14 18:30:00', '2011-06-14 19:20:00', '.Crockett je preživio Calderoneov napad, no poručnik Rodrigez nastrada u napadu plaćenog ubojice. Crockett i Tubbs odlaze na Bimini, kako bi osvetili poručnikovu smrt. Tubbs se zaljubljuje u predivnu ženu, čije su veze s Clalderoneom puno dublje nego što on misli..', 0, '', 1, 0, 0, 10, 1),
(1249, 'Princ iz Bel Aira, humoristična serija', 0, '2011-06-14 19:20:00', '2011-06-14 19:45:00', '.Will se svim silama trudi spriječiti rušenje sportskog centra za mlade te misli kako mjesna televizijska postaja o cijelom slučaju ne izvještava objektivno. Zbog toga odlazi izravno u studio i zahtijeva da mu se omogući vrijeme u kojem bi mogao predstaviti svoje ideje. Producent informativnog programa Willa ignorira, ali privlači ga prelijepa Hilary, koja je došla pomoći Willu, a kući odlazi kao nova prezenterica vremenske prognoze!.', 0, '', 1, 0, 0, 10, 1),
(1250, 'Princ iz Bel Aira, humoristična serija', 0, '2011-06-14 19:45:00', '2011-06-14 20:10:00', '.Carlton se priprema za večeru s bivšom djevojkom Cindy, spreman oprostiti joj što ga je prije nekoliko mjeseci iznenada ostavila, ali cijela obitelj ostaje zapanjena kada se ona pojavi sa sinčićem, Carltonom mlađim. Philip odbija prihvatiti unuče sve dok to ne potvrde medicinski testovi, a slično misli i Will, koji sumnja u Caltonovo seksualno iskustvo. Carlton mu naposljetku priznaje kako je uistinu još djevac, ali da je bio spreman oženiti Cindy nadajući se da će ga ona s vremenom zavoljeti..', 0, '', 1, 0, 0, 10, 1),
(1251, 'U dobru i zlu, humoristična serija', 0, '2011-06-14 20:10:00', '2011-06-14 20:30:00', '.Eddie i Joy odlaze na romantičnu večeru u centar grada. Joy se zaljubi u moderan život u centru i predloži Eddiju da se odsele iz predgrađa. Iako Eddie smatra da je to suluda ideja, počne se premišljati nakon posjete luksuznoj zgradi u kojoj bi mogao biti njihov novi dom..', 0, '', 1, 0, 0, 10, 1),
(1252, 'Raymond, humoristična serija', 0, '2011-06-14 20:30:00', '2011-06-14 20:55:00', '.Rayevi roditelji i dalje nepozvani navraćaju u kuću svog sina i snahe pa se Debra odluči malo našaliti s Frankom i Marie te im „pomoći“, baš kao što oni uvijek njoj „pomažu.“.', 0, '', 1, 0, 0, 10, 1),
(1253, 'Raymond, humoristična serija', 0, '2011-06-14 20:55:00', '2011-06-14 21:15:00', '.Ray je za savršen dar svojim roditeljima izabrao personalizirani toster koji su pohvalili  njegovi prijatelji. No nezadovoljna Marie ga je zamijenila za puno korisniji aparat za kavu, što je Rayja jako razljutilo..', 0, '', 1, 0, 0, 10, 1),
(1254, 'Kako sam upoznao vašu majku, humoristična serija', 0, '2011-06-14 21:15:00', '2011-06-14 21:40:00', '.Otkako je Marshall solo Barney ga pokušava oraspoložiti pozivima na izlaske sa ženskim društvom. Lily se odmorna i vesela vratila s putovanja i odmah zamoli Robin da joj pomogne pronaći novi dom u koji se želi što prije useliti..', 0, '', 1, 0, 0, 10, 1),
(1255, 'Teorija velikog praska, humoristična serija', 0, '2011-06-14 21:40:00', '2011-06-14 22:00:00', '.Penny su prerezali vod od kablovske, pa odlazi kod svojih susjeda genijalnih mulaca gledati America''s Next Top Model. To Sheldonu toliko ide na živce da počinje izvoditi klinačke štoseve, kako bi ju otjerao. Ukinuo joj je WI-FI, zasuo joj je e-mail hrpom kretenskih viceva i krenuo ponašati se ispod svake razine pristojnosti. Penny je bespomoćna, no Leonard se sažali nad njom i daje joj razorno oružje, Sheldonov kriptonit, telefonski broj od Sheldonove majke. Pakao za Sheldona počinje, a Howard ', 0, '', 1, 0, 0, 10, 1),
(1256, 'Studio 45, talk show uživo', 0, '2011-06-14 22:00:00', '2011-06-14 22:40:00', '..', 0, '', 1, 0, 0, 10, 21),
(1257, 'Koledžicom po svijetu, zabavna emisija', 0, '2011-06-14 22:40:00', '2011-06-14 23:35:00', '.Maja Šuput potražit će ženika u plemenu Masai. U podnožju Kilimanjara na visokoj peti Maja će pokušati izvršiti sve zadatke ne bi li se svidjela nekom od ratnika i time mu postala peta ili, ako je sreća posluži, četvrta žena. Kakvu je ulogu u svemu tome odigrao poglavica plemena Masai, gledatelji će moći vidjeti samo u „Koledžici“..', 0, '', 1, 0, 0, 10, 13),
