(1530, 'SVETO IN SVET: ETIKA DANES', 0, '2011-06-08 23:05:00', '2011-06-09 00:25:00', '.Opredeliti in uveljaviti najvišje dobro je smoter etike že po Aristotelu, ki ga opredeli kot srečnost. Srečnost, ki ni pogojena z uživaštvom, ampak v življenju, ki je usklajeno z vrlino ali krepostjo. Biti srečen - je danes vodilo zahodne družbe. A kako biti srečen? Po Aristotelovo ali kako drugače? Ali je etika še prisotna v družbi? Katere vrline so danes tiste, ki jih priznavamo za etične? Kaj je v informacijski družbi najvišje dobro?.', 0, '', 1, 0, 0, 13, 28),
