(1623, 'ZGODBE IZ ŠKOLJKE - IZ POPOTNE TORBE: GOVOREČE ŽIVALI', 0, '2011-06-11 07:00:00', '2011-06-11 07:15:00', '.Otroci, ki imajo težave s sluhom in govorom, so prikrajšani za mnoge stvari, ki so sestavni del otroštva njihovih vrstnikov. Ena od teh je svet pravljic, ki buri in bogati otroško domišljijo in se ostali otroci srečujejo z njim tudi v televizijskih oddajah. To vrzel skušamo zapolnjevati v Otroškem in mladinskem programu TV Slovenija. V sodelovanju z Zavodom za slušno in govorno motene iz Ljubljane že od leta 1990 pripravljamo oddaje z naslovom ''Zgodbe iz školjke''. Gre za izbor že posnetih otroš', 0, '', 1, 0, 0, 13, 29),
(1624, 'PEPI VSE VE O POROKI, POUČNO-ZABAVNA ODDAJA', 0, '2011-06-11 07:15:00', '2011-06-11 08:10:00', '.Hude sanje ima naš Pepi - da se je v jabolko spremenil in skoraj pohrustan bil.\n\nPrelepa Rozi s svojimi zobmi toliko, da konca mu ne stori. Čarobne Mihove besede ga obvarujejo vsega hudega.\n\nSkupaj sanje potem veselo rišeta in največjega mojstra stripa Mikija Mustra za nasvet povprašata..', 0, '', 1, 0, 0, 13, 40),
(1625, 'POD KLOBUKOM: NAJ ŽIVI NAŠ TRG', 0, '2011-06-11 08:10:00', '2011-06-11 09:00:00', '.Oddaja Pod klobukom nastaja v Otroškem in mladinskem programu že več let. V tem času je doživela kar nekaj preobrazb. Začeli smo v ''parku'', kjer sta poleg glasbenih in plesnih gostov, najboljših s pevskega tekmovanja ''Korajža velja'', sodelovali tudi dve skupini šolarjev, ki so se pomerili v različnih šaljivih igrah in kvizu o poznavanju določene knjige..', 0, '', 1, 0, 0, 13, 29),
