(1628, 'TEDNIK', 0, '2011-06-11 12:00:00', '2011-06-11 13:00:00', '.Lanskega novembra je politični prostor pretresla afera, da naj bi poslanec Magajna, ki je le nekaj dni pred hišno preiskavo zapustil poslansko skupino SD, konzumiral otroško pornografijo. Pol leta po slovenski preiskavi, ki je bila del mednarodne preiskave proti otroški pedofiliji na medmrežju, poslanec zagotavlja, da kriminalisti sporne fotografije dekleta, ki je bila povod za odrejeno hišno preiskavo , niso našli. Gre za strokovno preiskavo zlorabe otrok ali politično motiviran proces?.', 0, '', 1, 0, 0, 13, 41),
