(1648, 'SPET DOMA (HD)', 0, '2011-06-11 20:00:00', '2011-06-11 21:40:00', '.Oddaja Spet doma se po sedmih letih poslavlja od svojih gledalcev. Mario je povabil na ta poseben večer v svojo družbo svoje dobre prijatelje, ki bodo pričarali posebno nostalgično vzdušje. Nastopili bodo Desa Muck in Boris Kobal, Helena Blagne, Lorrella Flego, Nuša Derenda in Latino, Anika Horvat, Petar Grašo, Omar Naber, Nina Pušlar, Eva Černe, Gal in Severa Gjurin, Miha Debevc in zagotovo še kdo. To bo nepozabnih 100 minut, s katerimi se bo po 212 oddajah končala uspešna zgodba priljubljene ', 0, '', 1, 0, 0, 13, 21),
