(1658, 'ŽIV ŽAV: PAJKOLINA IN PRIJATELJI S PRISOJ: KAPITAN PRISOJNIK SPET LETI, RISANA NANIZANKA; KLJUKEC S STREHE: KLJUKEC ULOVI PTIČKA, RISANA NANIZANKA', 0, '2011-06-12 07:00:00', '2011-06-12 09:55:00', '.Risanke so ena izmed zvrsti oddaj, ki prve pritegnejo pred ekrane najmlajše gledalce. Če jih želimo vzgojiti v kritične mladostnike, jim moramo takoj na začetku ponuditi najboljše. Zato so vse risanke, ki jim jih premišljeno izbrane ponujamo, tudi poslovenjene. Pri sinhronizaciji smo pozorni predvsem na dve temeljni postavki, ki sta nam vodilo: slovenski jezik in skrben izbor igralcev, ki z izvrstnimi interpretacijami razveseljujejo zvedave otroke..', 0, '', 1, 0, 0, 13, 6),
