(1664, 'LJUDJE IN ZEMLJA, ODDAJA TV MARIBOR', 0, '2011-06-12 12:00:00', '2011-06-12 13:00:00', '.Oddaja Ljudje in zemlja je izobraževalno-svetovalna, namenjena vsem, ki jih zanimajo kmetijske teme. V oddaji predstavljamo kmetije širom po Sloveniji, ob aktualni sezonski  kmetijski tematiki poskušamo pripraviti čim več uporabnih strokovnih nasvetov, seznanjamo z ukrepi kmetijske politike in novostmi na področju zakonodaje..', 0, '', 1, 0, 0, 13, 46),
