(1705, 'ALI ME POZNAŠ: JAZ SEM JABLANA JESENI, POUČNA NANIZANKA', 0, '2011-06-13 10:30:00', '2011-06-13 10:35:00', '.V poletnih mesecih se jablana posveti skrbi za jabolka – redi in čuva jih kot živalske samice svoje mladiče in zelo je nesrečna, ko nepridipravi, kot npr. žuželke, ptice ali objestni ljudje, segajo predčasno po nezrelih sadovih, kajti šele konec poletja jabolka zares dozorijo. Potem jih je treba obrati čim prej. Ko so jabolka obrana, jablani ostane le še, da se pripravi na zimo, dolgo, pusto in mrzlo obdobje od decembra do marca, ko  tako ali tako vsa narava potone v mirovanje. Glas zrele jabla', 0, '', 1, 0, 0, 13, 29),
(1706, '(NE)POMEMBNE STVARI: ZAPRTOST, MOZAIČNA ODDAJA ZA MLADE', 0, '2011-06-13 10:35:00', '2011-06-13 11:25:00', '..', 0, '', 1, 0, 0, 13, 13),
(1707, 'MODRO POLETJE, ŠPANSKA NADALJEVANKA, 3/38', 0, '2011-06-13 11:25:00', '2011-06-13 12:00:00', '.Pred vami je zadnja oddaja Modro, ki se poslavlja z malih zaslonov. Tako vam njeni ustvarjalci še zadnjič ponujajo Modre teme: kako se učiti s pomočjo lutk, kako se z učenjem na pamet spopadajo igralci, kdo in kje vam lahko svetuje pri iskanju dela, kaj dela psihološki astrolog, kako naj se starši in otroci pogajajo o uri prihoda domov z decembrskih zabav. A to še ni vse! V zadnji oddaji se bodo od nekaterih gledalcev poslovili tudi z darili.\n\nVoditeljica in urednica: Milica Prešeren.', 0, '', 1, 0, 0, 13, 35),
(1708, 'LJUDJE IN ZEMLJA, ODDAJA TV MARIBOR', 0, '2011-06-13 12:00:00', '2011-06-13 13:00:00', '.Oddaja Ljudje in zemlja je izobraževalno-svetovalna, namenjena vsem, ki jih zanimajo kmetijske teme. V oddaji predstavljamo kmetije širom po Sloveniji, ob aktualni sezonski  kmetijski tematiki poskušamo pripraviti čim več uporabnih strokovnih nasvetov, seznanjamo z ukrepi kmetijske politike in novostmi na področju zakonodaje..', 0, '', 1, 0, 0, 13, 46),
