(1714, 'BINE: TELEVIZIJA, LUTKOVNO - IGRANA NANIZANKA', 0, '2011-06-13 16:05:00', '2011-06-13 16:25:00', '.Bine zelo rad gleda televizijo. Ajda mu vseh oddaj ne dovoli gledati, zato jih gleda skrivaj. Seveda niso vse oddaje in filmi primerni za Bineta, zato ga je večkrat strah. Ajda in Bine doma naredita televizijsko oddajo, kjer sta glavna junaka. Zelo se zabavata, potem pa gresta še na pravo televizijo pogledat, kako delajo oddaje za otroke..', 0, '', 1, 0, 0, 13, 29),
(1715, 'RIBIČ PEPE: PENTLJA OKROG TRŽIČA IN ŠTEVILKE OSEM', 0, '2011-06-13 16:25:00', '2011-06-13 17:00:00', '.Morda se rdečerepi lisjak Foksner s svojim zakladom skriva v starem čevljarskem in nekdaj živahnem trgovskem mestu Tržič? Morda. Bo Pepetu in Kakaduduju uspelo najti tega zmikavta? No, med iskanjem boste dobro spoznali številko osem, Pepe bo narisal grb mesta, naredil papirnato hišico in napisal ljubezensko pismo - pa ne Foksnerju..', 0, '', 1, 0, 0, 13, 29),
(1716, 'NOVICE, SLOVENSKA KRONIKA, ŠPORT, VREME', 0, '2011-06-13 17:00:00', '2011-06-13 17:30:00', '..', 0, '', 1, 0, 0, 13, 13),
