(1718, 'ŽREBANJE 3X3 PLUS 6', 0, '2011-06-13 18:25:00', '2011-06-13 18:40:00', '.V igri 3x3 plus 6 številk ne izbirate sami, temveč ob nakupu igre prejmete potrdilo o vplačilu, na katerem je natisnjena kartica. To pomeni, da za igranje ne potrebujete nobenega znanja. Igra je sestavljena iz dveh delov: žrebanja devetih številk za kombinacijo 3x3 in žrebanja šestih številk za Plus 6.V igri je 9 vrst dobitkov..', 0, '', 1, 0, 0, 13, 32),
