(1724, 'TEDNIK', 0, '2011-06-13 20:00:00', '2011-06-13 21:00:00', '.Lanskega novembra je politični prostor pretresla afera, da naj bi poslanec Magajna, ki je le nekaj dni pred hišno preiskavo zapustil poslansko skupino SD, konzumiral otroško pornografijo. Pol leta po slovenski preiskavi, ki je bila del mednarodne preiskave proti otroški pedofiliji na medmrežju, poslanec zagotavlja, da kriminalisti sporne fotografije dekleta, ki je bila povod za odrejeno hišno preiskavo , niso našli. Gre za strokovno preiskavo zlorabe otrok ali politično motiviran proces?.', 0, '', 1, 0, 0, 13, 41),
(1725, 'STUDIO CITY', 0, '2011-06-13 21:00:00', '2011-06-13 22:00:00', '.V tokratni oddaji bodo gostili mednarodno priznanega svetovalca podjetjem, dr. Petra Kraljiča. Slovenske  pisatelje bodo postavili pod Objektiv  - kaj so želeli z odprtim pismom povedati politikom? Gostili bodo še poznavalce notranjepolitičnega dogajanja in jih vprašali, kako naprej po superreferendumu. Po vladnem opravičilu medijem za cenzuro v času Miloševića bodo objavili prispevek o današnjem stanju medijske svobode v Srbiji, nato pa bodo osvetlili še ozadje afere, ki pretresa FIFO..', 0, '', 1, 0, 0, 13, 30),
(1726, 'ODMEVI, KULTURA, ŠPORT, VREME', 0, '2011-06-13 22:00:00', '2011-06-13 23:00:00', '.Ozadja dogodkov in pojavov, prikrite podrobnosti in nove plati vznemirljivih zgodb predstavljajo novinarji in izbrani gosti, ki jih izprašajo voditelji oddaje ali pa se soočijo med seboj. V studiu damo besedo obema, oziroma toliko stranem, da si naši gledalci lahko ustvarijo čim bolj celostno podobo aktualnih dogajanj. Poleg tega pa še kratek pregled dnevnih svetovnih in domačih novic, ki ste jih morda zamudili ali preslišali čez dan..', 0, '', 1, 0, 0, 13, 2),
(1727, 'Globus', 0, '2011-06-13 23:00:00', '2011-06-13 23:30:00', '..', 0, '', 1, 0, 0, 13, 13);
