(1728, 'GLASBENI VEČER: JUBILEJNI KONCERT OB 80-LETNICI IGORJA OZIMA (J. BRAHMS, F. MENDELSSOHN), POSNETEK IZ SLOVENSKE FILHARMONIJE', 0, '2011-06-13 23:30:00', '2011-06-14 01:05:00', '.V mesecu maju je 80 let praznoval naš mednarodno priznani violinist in pedagog Igor Ozim, ki že dolga leta živi in deluje v tujini. Slavnostni koncert ob njegovem jubileju mu je v Slovenski filharmoniji pripravila mednarodna zasedba glasbenikov, med katerimi so bili tako njegovi učenci kot tudi nekdanji glasbeni sodelavci: Andreas Janke, Primož Novšak, Yi-Chen Lin, Miran Kolbl, Mile Kosi, Maja Rome, Susanne Basler in Petra Gačnik-Greblo. \nIgor Ozima je svojo glasbeno pot začel kot nadarjen mlad', 0, '', 1, 0, 0, 13, 49),
