(1743, 'ZGODBE IZ ŠKOLJKE - RIBIČ PEPE', 0, '2011-06-14 10:40:00', '2011-06-14 11:00:00', '.Otroci, ki imajo težave s sluhom in govorom, so prikrajšani za mnoge stvari, ki so sestavni del otroštva njihovih vrstnikov. Ena od teh je svet pravljic, ki buri in bogati otroško domišljijo in se ostali otroci srečujejo z njim tudi v televizijskih oddajah. To vrzel skušamo zapolnjevati v Otroškem in mladinskem programu TV Slovenija. V sodelovanju z Zavodom za slušno in govorno motene iz Ljubljane že od leta 1990 pripravljamo oddaje z naslovom ''Zgodbe iz školjke''. Gre za izbor že posnetih otroš', 0, '', 1, 0, 0, 13, 29),
(1744, 'SINJE NEBO, NORVEŠKA DRUŽINSKA NADALJEVANKA', 0, '2011-06-14 11:00:00', '2011-06-14 11:55:00', '..', 0, '', 1, 0, 0, 13, 1),
(1745, 'VEČERNI GOST: POLDE BIBIČ', 0, '2011-06-14 11:55:00', '2011-06-14 13:00:00', '.Gotovo sodi med najbolj priljubljene in zaželjene igralce svoje generacije. V spominu nam je ostal kot dvorni norček (''Kralj Lear''), romantični zaljubljenec (''Cvetje v jeseni'') in povratnik iz druge vojne( ''Moj oče socialistični kulak''). Poznamo ga tudi kot avtorja izredno zanimive serije knjig o gledališkem življenju: Igralec, Soigralci, Soigralke. Njegovo najnovejše delo Spominjarije je izredno sveža in očarljiva knjiga spominov na otroška in mladeniška leta v Mariboru..', 0, '', 1, 0, 0, 13, 39),
