(1747, 'GLOBUS', 0, '2011-06-14 13:15:00', '2011-06-14 13:55:00', '.Republika Ciper je te dni na veliko praznovala 50. obletnico obstoja. A to je bilo veselje s priokusom, saj je sredozemski otok že skoraj štirideset let razdeljen na turški sever in grški jug, tako imenovano zeleno črto pa nadzira mednarodna vojska. Še najbližje politični rešitvi so bili Ciprčani leta 2004, ko je mirovni predlog pripravil nekdanji generalni sekretar OZN Kofi Anan. Ciprski Grki so načrt takrat zavrnili in bili še isto leto sprejeti v Evropsko unijo, turški del otoka pa je ostal ', 0, '', 1, 0, 0, 13, 48),
(1748, 'BABILON.TV: SMEH', 0, '2011-06-14 13:55:00', '2011-06-14 14:15:00', '.Smeh ni zgolj zabava, je tudi pol zdravja, zato se ne smemo pozabiti smejati! O fizikalnih in psiholoških dimenzijah smeha je z nami spregovorila prva gostja oddaje, igralka in klovnesa Nataša Sultanova. A kaj se zgodi, ko smeha drugih ne slišiš? Se ga lahko nalezeš? Kako ga zaznaš? Odgovore na ta vprašanja nam odkrije drugi gost oddaje Damjan Šebjan, slovenski gluhi igralec, ki že leta poskuša v svojih predstavah izvabljati smeh tako med gluhim kot slišečim občinstvom..', 0, '', 1, 0, 0, 13, 37),
(1749, 'OBZORJA DUHA', 0, '2011-06-14 14:15:00', '2011-06-14 15:00:00', '.V njej spremljamo dogodke v velikih verstvih doma in po svetu. Veliko pozornost namenjamo avtohtonima verskima skupnostima Katoliški in Evangeličanski cerkvi.Posamezna oddaja prinaša: - poročila o najnovejših dogodkih v Sloveniji in svetu - čim celoviteje poskušamo osvetliti prireditve, dejavnosti in ustanove, ki pomembno sooblikujejo religiozno polje v Sloveniji - spremljamo umetniške stvaritve (knjige, glasba, razstave likovnih del) z religiozno tematiko - občasno pripravimo ''temo tedna''..', 0, '', 1, 0, 0, 13, 28),
